"<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"><html><head><title>Luxe Public Relations: Luxury Hotel/Restaurant/Catering Industry PR Agency, for Promotion &amp; Representation in London/International Markets</title><meta name=Keywords content="Luxury Hotel PR, Hotel Representation, Public Relations, Restaurant Promotion, London PR Agency, Hotel & Catering Public Relations"><meta name=Description content="London Based Hotel & Catering Public Relations Agency - 18 Years Service Experience"><meta http-equiv=Content-Type content="text/html; charset=iso-8859-1"></head><body background=gfx/ahpr_bg.gif topmargin=0 marginwidth=0 marginheight=0><div align=center><object classid=clsid:D27CDB6E-AE6D-11cf-96B8-444553540000 codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width=670 height=500><param name=movie value=ah_main.swf><param name=quality value=high><embed src=ah_main.swf quality=high pluginspage=http://www.macromedia.com/go/getflashplayer type=application/x-shockwave-flash width=670 height=500></object></div><script language=JavaScript><!--
