"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"><html xmlns=http://www.w3.org/1999/xhtml><head><meta name=generator content="Adobe GoLive"><meta http-equiv=content-type content="text/html;charset=utf-8"><title>North Wales Attractions Things to Do Places to Go.</title><!-- #BeginHeadLocked "" --><link href=css/basic.css rel=stylesheet type=text/css media=all><!-- #EndHeadLocked --><meta name=Description content="North Wales Attractions family days out. Where to go in Snowdonia and North wales."><meta name=keywords content="north wales attractions, snowdonia attractions, places to visit in north wales, family days out in North wales, places to go in north Wales, Welsh mountain Zoo, Pili Palas, Sun Centre Rhyl,Tweedmill Factory outlet,Anglesey Sea Zoo, Caernarfon Castle, Portmeirion Village, Llechwedd Slate Caverns, Greenwood Forest Park, Bodnant Garden"></head><body><div id=pagelayout><!--body content absolutely positioned--><div id=contentbox><div id=content><!--left content--><div id=leftcol><div id=leftcolCont><h1>Top Places to visit in North Wales</h1><p>Take a train to the summit of the highest mountain in England and Wales, or stand at the foot of a record breaking giant red wood tree. </p><p>Marvel at the subterranean lake featured in Hollywood films or meet some of the aquatic stars of the Blue Planet natural history series. </p><p>Climb the towers of a 'world heritage' castle, or visit a village whose pantheon and piazza were inspired by the architecture of Italy. </p><p>There's something for everyone in the Ten Top Attractions.</p><h2>Hands up if YOU'RE coming too!</h2><p>Ten Top Attractions members have been approved by the Wales Tourist Board's Quality Assurance Service</p><p>A network of Tourist Information Centres can give useful advice to help you make the most of your visit to North Wales. To book a short break call 08705 168767 or visit the website: <a href=http://www.nwt.co.uk>www.nwt.co.uk</a></p></div><!--menu--><div id=menubox><div id=menu><ul><li class=first><a href=shop.html>Shop, eat and drink</a></li><li><a href=family.html>Family fun</a></li><li><a href=history.html>Step into the past</a></li><li><a href=nature.html>Walk on the wild side</a></li><li><a href=learning.html>Educational resources</a></li></ul></div><div id=undermenu><p><q><span>There's something for everyone at North Wales's Ten Top Attractions!</span></q></p></div></div><!--end menu--></div><!--left content--><!--right content--><div id=rightcol><div id=rightcolCont><h2>News</h2><p>SPRING AT THE WELSH MOUNTAIN ZOO <a href=/attractions/mountainzoo.html>..read more</a></p><p>2007 Season opening <a href=/attractions/snowdonrailway.html>..read more</a></p><p>Spring Launch <a href=/attractions/tweedmill.html>..read more</a></p><p>The Choughs are coming! <a href=/attractions/llechwedd.html>..read more</a></p><p>GreenWood Half Term Fun! <a href=/attractions/greenwood.html>..read more</a></p></div></div><!--right content--><!--footer--><div id=footer><div id=footercontent><div id=attractions><ul><li><a href=attractions/seazoo.html>Anglesey Sea Zoo</a></li><li><a href=attractions/pilipalas.html>PiliPalas</a></li><li><a href=attractions/llechwedd.html>Llechwedd Slate Caverns</a></li><li><a href=attractions/mountainzoo.html>Welsh Mountain Zoo</a></li><li><a href=attractions/caernarfoncastle.html>Caernarfon Castle</a></li><li><a href=attractions/portmerion.html>Portmeirion</a></li><li><a href=attractions/bodnantgardens.html>Bodnant Gardens</a></li><li><a href=attractions/suncentre.html>Rhyl Sun Centre</a></li><li><a href=attractions/tweedmill.html>The Tweedmill Factory Outlet</a></li><li><a href=attractions/greenwood.html>The Greenwood Forest Park</a></li><li><a href=attractions/snowdonrailway.html>Snowdon Mountain Railway</a></li></ul></div><h3><span>Ten Top Attractions, Tourism attractions in North Wales</span></h3><p>&copy; 2005 Copyright Ten Top Attractions. Site design and hosting by Nettability</p></div></div></div></div><!--end body content absolutely positioned--><!--header content absolutely positioned--><div id=header><div id=banner><h1><span>Ten Top Attraction logo &amp; photos of the Ten Top <meta name=keywords content="tourism attractions in North Wales, Anglesey Sea Zoo, PiliPalas, Llechwedd Slate Caverns, Mountain Zoo, Caernarfon Castle, Portmeirion, Bodnant Gardens, Rhyl Sun Centre, The Tweedmill Factory Outlet, The Greenwood Forest Park, Snowdon Mountain Railway"> .</span></h1></div><div id=map><!--<h1><span>Interactive Map to navigate to Ten Top tourism attractions in North Wales: Anglesey Sea Zoo, PiliPalas, Llechwedd Slate Caverns, Mountain Zoo, Caernarfon Castle, Portmeirion, Bodnant Gardens, Rhyl Sun Centre, The Tweedmill Factory Outlet, The Greenwood Forest Park, Snowdon Mountain Railway.</span></h1>--><img src=images/imap.gif usemap=#imapc0449d69 border=0><map name=imapc0449d69><area shape=poly coords=216,142,124,141,124,128,114,129,109,120,116,117,125,122,172,120,178,131,217,130 href=attractions/snowdonrailway.html alt><area shape=poly coords=149,115,86,115,88,97,91,87,99,86,104,95,149,94 href=attractions/greenwood.html alt><area shape=poly coords=222,171,222,162,205,160,206,150,146,150,138,144,130,147,131,154,141,156,148,173 href=attractions/llechwedd.html alt><area shape=poly coords=28,162,93,161,97,172,105,163,115,166,111,176,123,176,128,183,28,184 href=attractions/portmerion.html alt><area shape=poly coords=84,136,50,136,49,124,25,124,21,112,65,112,69,103,77,102,79,108,78,114,85,115 href=attractions/caernarfoncastle.html alt><area shape=poly coords=201,109,162,109,159,90,151,85,153,76,161,77,165,86,202,85,210,92,202,109 href=attractions/bodnantgardens.html alt><area shape=poly coords=208,63,208,72,204,79,209,86,219,84,221,93,265,94,264,62,208,63 href=attractions/tweedmill.html alt><area shape=poly coords=182,31,241,30,243,53,219,53,203,55,200,48,184,42,183,31 href=attractions/suncentre.html alt><area shape=poly