"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"><html xmlns=http://www.w3.org/1999/xhtml xml:lang=en lang=en><head><title>Open Source Software Support, Open Source Support Services and Linux Support</title><link rel="SHORTCUT ICON" href=http://global.gbdirect.co.uk/favicon.ico><meta http-equiv=Content-Type content="text/html; charset=ISO-8859-1"><meta name=robots content=noindex><meta name=keywords content="open source support, open source software support, open source support solutions, open source support contract, open source support contracts, open source support contracts, open source contractors, open source services, open source consulting, open source consultant, open source consultants, open source consulting, open source consultancy, open source maintenance contract, open source maintenance contracts, open source support uk, open source support services uk, open source support solutions uk, open source support contract uk, open source support contracts uk, open source support contracts uk, open source contractors uk, open source services uk, open source consulting uk, open source consultant uk, open source consultants uk, open source consulting uk, open source consultancy uk, open source maintenance contract uk, open source maintenance contracts uk, open source software support, open source software support services, open source software support solutions, open source software support contract, open source software support contracts, open source software support contracts, open source software contractors, open source software services, open source software consulting, open source software consultant, open source software consultants, open source software consulting, open source software consultancy, open source software maintenance contract, open source software maintenance contracts, open source software support uk, open source software support services uk, open source software support solutions uk, open source software support contract uk, open source software support contracts uk, open source software support contracts uk, open source software contractors uk, open source software services uk, open source software consulting uk, open source software consultant uk, open source software consultants uk, open source software consulting uk, open source software consultancy uk, open source software maintenance contract uk, open source software maintenance contracts uk, linux support, linux software support, linux support services, linux support solutions, linux support contract, linux support contracts, linux support contracts, linux contractors, linux services, linux consulting, linux consultant, linux consultants, linux consulting, linux consultancy, linux maintenance contract, linux maintenance contracts, linux support uk, linux software support uk, linux support services uk, linux support solutions uk, linux support contract uk, linux support contracts uk, linux support contracts uk, linux contractors uk, linux services uk, linux consulting uk, linux consultant uk, linux consultants uk, linux consulting uk, linux consultancy uk, linux maintenance contract uk, linux maintenance contracts uk"><style type=text/css>
   <!--
     @media print, screen {
       body { font-family: Helvetica, Arial, sans-serif; }
     }
     -->
  </style></head><body bgcolor=white text=black link=blue vlink=#52188c alink=red><table width=600 align=center><tr valign=top id=Main><td><h1>Linux &amp; Open Source Software Support</h1><p><a href=http://www.gbdirect.co.uk/ ><img id=Logo src=http://global.gbdirect.co.uk/Themes/GBdirect.gif height=22 width=122 alt="GBdirect Homepage" border=0></a></p><br><p><small>This is a printer-friendly version of a page on the <a href=http://www.gbdirect.co.uk/ >GBdirect</a> web site. The original page may be found at <a href=http://software-support.gbdirect.co.uk/ >http://software-support.gbdirect.co.uk/</a>.</small></p><p>GBdirect staff were providing open source support services long before the company&#8217;s incorporation in 1995, and we&#8217;ve been offering Linux support since we migrated our own infrastructure to Linux way back in 1998.</p><p>Until recently, however, most of our open source software support focused on applications or systems that we had a hand in designing, writing, building, installing or integrating, i.e. a relatively specialised, hand-crafted, service. </p><p>In response to customer demand and to the increasing maturity of the open source software market, we are now offering Linux support and open source software support in simpler, packaged, formats, i.e. our open source maintenance contracts are now what are known in the awful jargon of our times as &lsquo;support solutions&rsquo;.</p><p>As time allows, we will detail our range of open source support &lsquo;solutions&rsquo; on pages shown in the indented section of the left hand menu. In the meantime, this page will serve as a general introduction to our maintenance offerings; providing an outline of the major open source packages supported, the different forms of open source support available, models of delivery and basic cost structures.</p><h2>Open Source Support &amp; Linux Support Requires Real Experience</h2><p>In fast developing technologies like Linux and open source, experience counts for even more than it does in older and more mature markets. Recent converts to Linux and open source, however prestigious their name and reputation, are unlikely to have the depth of knowledge and experience to efficiently address the most common requirement for Linux and open source support, i.e. <strong>serious troubleshooting skills</strong>. This depth of experience is, however, precisely what long-term open source experts like GBdirect and its associates can provide.</p><p>For most companies information technology (IT/ICT) is simply a means to an end. Economic logic dictates that many will retain technical staff to meet routine day-to-day exigencies, but use external support to tackle those situations which are too occasional to justify the cost of retaining in-house experts, e.g. catastrophic failure, security threat, upgrade, extension/customisation, migration, or the like.</p><p>One of the principal reasons for the growth of open source software is its affinity with this business model. The big name open source packages (e.g. Apache, Bind and Sendmail) are typically robust, stable and infrastructural in nature. They are usually installed and configured just once, then run and run without interruption or maintenance until they are either retired or redirected towards new tasks and functions.</p><p>Most open source packages of this kind are written by and for experts, with the unfortunate side-effect that accessible documentation for new users (including the technically skilled users) can be hard to find. As a consequence, even experienced contractors can be hard-pushed to find a quick and lasting solution to open source problems if they lack deep knowledge of system internals and the familiarity to read and modify source code with confidence. The technical principles may be same as those on other systems, but the practice of maintenance can be rather different.</p><p>If you are considering an alternative supplier of Linux support or open source support, remember to ask them how much of their own business runs on open source, and how long they&#8217;ve depended on it for their livelihoods. Every application in our company, bar one, has run on open source software since 1998. The accounts package&#8217;s days are numbered, unless Sage comes up with a Linux port fairly soon.</p><h2>Channels of Linux Support &amp; Open Source Software Support</h2><p>One notable difference from the proprietary model of software support is that very few open source applications have a single commercial provider or distribution channel. In many cases, traditional proprietary methods of escalating support simply become redundant.</p><p>When a package author has no economic or legal obligation to his/her users, no amount of channel pressure may be enough to secure end-user driven changes from him/her. On the other hand, open source licencing permits skilled third parties, like GBdirect, to modify his/her packages in whichever way their clients see fit.</p><p>In effect, providers of open source support can completely short-circuit the escalation procedures of the traditional channel, delivering a fast one-stop shop solution. If a client needs an answer, a new feature, or a fix, we can get it straight from the author or we can simply provide it ourselves, without time consuming conditions, qualifications and referrals up the chain.</p><p>Another difference is that the modular, component-based, character of open source software multiplies the potential external dependencies in a package; requiring open source support companies to draw upon a wider range of skills and knowledge than traditional &lsquo;solutions providers&rsquo; typically have to hand.</p><p>This is why the support company&#8217;s embeddedness in open source communities and ecosystems should matter to the end-user. Companies that have worked in this enviroment for years have networks of mutual support which are both wider and deeper than you are ever likely to find in a proprietary channel, i.e. in addition to being vertically integrated with their own suppliers and resellers, open source support companies are horizontally integrated with an entire community, including direct competitors. In effect, the end-user user&#8217;s support contract with a single company like GBdirect allows that user to tap into the skills and knowledge of individuals inside dozens of other companies.</p><p>The economic paradox here is that open source support companies frequently help themselves by helping their competitors. By sharing skills, they enable one another to offer better and cheaper services than the mutually exclusive channels of the proprietary world.</p><p>GBdirect take this practice of co-operation for mutual competitive advantage to a further level. Not only do we consult experts in competitor companies, we also sell their expertise directly to our clients (even when we have similar in-house skills). This allows us to provide a quality, quantity, range and depth of open source software support which even some of consulting &lsquo;giants&rsquo; would be hard-pushed to match.</p><p>Moreover, we can offer high quality service at competitive prices, because neither we nor our customers carry the full burden of risk typically associated with immature, fast changing, markets. If, for whatever reason, we or our partners should be pressed to meet a support obligation at a particular moment, our other associates are committed to pick-up the slack. In effect, by sharing a necessary minimum of spare capacity between us, we reduce the total amount required (and, hence, the cost to each of us of maintaining it).</p><h2>Practical Linux Support &amp; Open Source Software Support</h2><p>Software support can mean a great many different things, indeed there are even international standards which identify dozens of different categories and service levels. In the real world, however, distinctions between factors like maintenance, customisation, integration, software development, etc. are hard to draw and none-too-relevant for the commercial goals of a business.</p><p>GBdirect&#8217;s recognises that support of one kind tends to overflow into another and organises it&#8217;s services accordingly. Insofar as they are necessary at all, transitions between one level or type of GBdirect support and another are seamless.</p><p>With the exception of initial incident reporting, helpdesk support is typically provided by the same experienced software developers and system administrators who provide our remote and onsite intervention services. These technical experts really are as comfortable answering end-user queries as they are editing source code.</p><p>On the rare occasions that an issue extends beyond the first individual&#8217;s field of knowledge, it is automatically passed to an established expert in the domain, without the need for any formal escalation or referral. The same procedure applies whether the experts involved are GBdirect associates or members of the company&#8217;s permanent staff. Needless to say, more bureacratically formal procedures are available to those who prefer them.</p><p>Although they can be structured in different ways, our charges simply reflect the amount of time taken by the relevant expert to address the problems covered by a support contract.</p><h2>Types of Linux and Open Source Software Support</h2><p>Our two broad categories of support are:</p><ul><li>Helpdesk advice and diagnostic research</li><li>Direct intervention to diagnose and resolve problems</li></ul><p>Most of our clients combine the two; relying on the helpdesk to deal with the vast majority of incidents, but retaining the option to invoke direct intervention in exceptional circumstances.</p><h3>Linux &amp; Open Source Support: Helpdesk</h3><p>This form of open source software support is designed primarily for those who would expect their own technical staff to handle everyday problems, i.e. it backs-up and extends in-house resources when they are approaching their limits.</p><p>For relatively simple, or standalone applications, helpdesk support may also be used to back-up comparatively unskilled (non-technical) staff with responsibility for software maintenance in smaller businesses.</p><p>Larger clients may provide the first line of helpdesk support themselves (e.g. sourcing it from a hardware supplier), using GBdirect&#8217;s helpdesk to provide expert and guru level back-up.</p><p>We can, however, provide direct front line support for those who require it.</p><p>Helpdesk support is normally staffed within office hours, but 24x7 support can be arranged as appropriate.</p><p>Pricing usually involves a relatively modest annual fee based on the number, scale and type of software systems involved, plus charges for the exact amount of helpdesk time used in a given period. For accounting convenience, some customers prefer to pay a single consolidated charge for a fixed amount of annual helpdesk time (with higher rates for any excess). While this is usually the more expensive option, we are happy to provide quotes for either form of payment.</p><h3>Linux &amp; Open Source Support: Intervention</h3><p>This form of open source support essentially involves GBdirect staff and associates directly monitoring, configuring or managing your software systems, rather than merely advising your own technical staff on the matter. Obviously, the extent of that intervention is an issue for mutual discussion and agreement. It is most commonly invoked to cover emergencies and one-off system changes.</p><p>Most clients will employ this form of support alongside a helpdesk service, rather as a complete alternative to it. Some will, however, simply opt for a fully managed service in which the helpdesk fulfills the residual function of logging incident reports.</p><p>Routine intervention is most commonly delivered through remote management software and secure shell access, but all contracts provide the option of invoking onsite support when these are impracticable or undesirable.</p><p>New customers often choose a low cost package which provides remote intervention during office hours within a single annual fee and charges for exceptional onsite support during working hours based on our standard consulting rates.</p><p>Larger companies may employ such support as a means of evaluating our performance on &lsquo;edge&rsquo; services before purchasing it for other systems.</p><p>Intervention support (onsite or remote) can be provided out of office hours and for a single consolidated annual fee, subject to negotiation. As with helpdesk support, the single flat rate option is essentially for those who prefer predictability over the fine-grained savings that come with payment for exact work done.</p><p>The precise charges for intervention support vary (depending on the scale and complexity of the systems concerned), but are essentially proportional to the cost of staff time we actually devote to the it. Managed services are an obvious exception, where charges also reflect the cost of holding staff available for contingencies which may not actually occur</p><h2>Applications &amp; Services Covered by Open Source Support</h2><p>The following list is far from exhaustive. It is mostly a list of the open source applications that our full-time staff have historically supported and maintained. There are many other OSS applications which we and our associates have some experience of maintaining, but which we have not listed (e.g. because they are either relatively immature, are subject to dramatic change, or of purely minority interest) . A number of newer cross platform and &lsquo;cross-over&rsquo; applications, particularly those associated with the proprietary Java and .Net frameworks belong in this category.</p><p>If you have an open source application which needs support, and isn&#8217;t on the following list, just get in touch. If it&#8217;s not something our full-time staff specialise in, there&#8217;s still a very good chance that it is covered by one or more of our associates.</p><ul><li>Operating Systems <ul><li>Debian GNU/Linux</li><li>Novell/SUSE Linux</li><li>Red Hat Enterprise Linux</li><li>Legacy Red Hat Linux and Fedora Core</li></ul></li><li>Web servers and web applications: <ul><li>Apache web server</li><li>Apache core modules, plus tomcat, mod_php, mod_perl, mod_rewrite, etc.</li><li>Application Servers, JBoss, WebLogic</li><li>Content Management Systems (CMS), APLAWS+, Bricolage, WebGUI, Zope, bespoke</li><li>Browsers and browser-based applications, Mozilla, Firefox, Internet Explorer, XUL, JavaScript</li></ul></li><li>Networking: <ul><li>Bind DNS &#8212; Domain Name Server</li><li>Samba &#8212; SMB/CIFS Windows Networking</li><li>NFS &#8212; Unix/Linux Network File System</li><li>Firewalls &#8212; hardware and software</li></ul></li><li>Identity and authentication: <ul><li>OpenLDAP, including integration with Active Directory and eDirectory</li><li>SASL</li><li>PAM</li><li>NIS, NIS+</li></ul></li><li>RDBMs database servers: <ul><li>MySQL</li><li>PostgreSQL</li></ul></li><li>Mail and Messaging: <ul><li>Sendmail, Postfix and Exim mail servers</li><li>Cyrus IMAP mailbox management</li><li>Mail User Agents / Clients (MUAs), Thunderbird, Kmail, Evolution</li><li>SpamAssassin &#8212; Spam filter</li><li>ClamAV &#8212; Anti-virus filter</li></ul></li><li>Groupware, Calendaring and Teamwork <ul><li>SUSE OpenExchange Server</li><li>Open Groupware</li><li>Evolution, Mozilla Thunderbird, Mozilla Calendar clients</li></ul></li><li>Help desk request tracking <ul><li>RT</li></ul></li><li>Desktop and office productivity <ul><li>OpenOffice.org</li><li>Thin clients, xterminals, Linux Terminal Server Project (LTSP)</li><li>GNOME, KDE</li></ul></li><li>Source code version control systems and IDEs <ul><li>CVS</li><li>Subversion</li><li>Eclipse</li><li>Mono Develop (C# IDE)</li></ul></li><li>Bespoke applications written in these programming languages: <ul><li>C</li><li>C++</li><li>Perl</li><li>PHP</li><li>Python</li><li>Java</li></ul></li></ul></td></tr></table></body>",nonspam

