><span class=arrow>&gt;</span><a href=user/register.html accesskey=s title='Keyboard shortcut "S".'>Keep in Touch</a></td></tr><tr><td id=menu_15 align=left valign=top><span class=arrow>&gt;</span><a href=http://www.eastmidslibdems.org.uk>Bill Newton Dunn <acronym title="Member of the European Parliament">MEP</acronym></a></td></tr><tr><td id=menu_16 align=left valign=top><span class=arrow>&gt;</span><a href=http://www.libdems.org.uk/ >National Lib Dems</a></td></tr><tr><td id=menu_17 align=left valign=top><span class=arrow>&gt;</span><a href=http://bookshop.libdems.org.uk/ >Lib Dem Bookshop</a></td></tr><tr><td class=separator></td></tr><tr><td id=menu_18 align=left valign=top><span class=arrow>&gt;</span><a href=http://www.libdems.org.uk/justice/issues/clegg-webcast.html>Nick Clegg - Six months as Liberal Democrat Shadow Home Secretary</a></td></tr><tr><td id=menu_19 align=left valign=top><span class=arrow>&gt;</span><a href=results/871.html>Election Result</a></td></tr><tr><td class=separator></td></tr><tr><td id=menu_20 align=left valign=top><span class=arrow>&gt;</span><a href=user/login.html accesskey=l title='Keyboard shortcut "L".'>Log In</a></td></tr></table><p>You are not logged in.</p><p class=pin><span class=pinarr>*</span><a href=http://www.w3.org/WAI/WCAG1A-Conformance title="Accessible web site"><img alt="Accessible web site" title="Accessible web site" src=images/pins/wcag1A-standard.gif border=0 width=88 height=31 id=waipin class=pin></a><span class=pinarr>*</span></p><p class=pin><span class=pinarr>*</span><a href=http://validator.w3.org/check/referer title="Valid XHTML 1.0"><img alt="Valid XHTML 1.0" title="Valid XHTML 1.0" src=images/pins/xhtml10-standard.gif border=0 width=88 height=31 id=htmlpin class=pin></a><span class=pinarr>*</span></p><p class=pin><span class=pinarr>*</span><a href="http://jigsaw.w3.org/css-validator/validator?uri=http%3A%2F%2Fderbyshiredaleslibdems.org.uk%2F&warning=1&profile=css2" title="Valid CSS"><img alt="Valid CSS" title="Valid CSS" src=images/pins/css-standard.gif border=0 width=88 height=31 id=csspin class=pin></a><span class=pinarr>*</span></p><p>You can make the text on this site bigger or smaller using your web browser's text size controls.</p><p> We respect your right to privacy. Read <a href=privacy.html>our privacy policy</a> to find out more. </p><p><a href=http://www.prai.co.uk/ >Development and hosting by Prater Raines Partners</a>. </p><p><a href=other.html>Other party sites</a>. </p><p>Additional design by: 20:20 London.</p></map></td><td class=panel id=central align=left valign=top><a name=postbar id=postbar></a><a name=welcome-to-the-website-of-the-liberal-democrats-in-the-new-constituency-of-derbyshire-dales></a><h1>Welcome to the website of the Liberal Democrats in the new constituency of Derbyshire Dales</h1><a name=we-aim-to-trust-in-people-make-derbyshire-dales-free-fair-and-green></a><h2>We aim to: Trust in People - Make Derbyshire Dales Free, Fair and Green</h2><p style="text-align: left; font-style: normal; font-weight: normal; ">Free local education and healthcare so that everyone is free to make the most of their lives. Fair taxes because taxes should help improve our environment or make life in Derbyshire Dales more fair, not less. And finally, Trust, because it is time to restore trust in local and national government.</p><p>Our intention is that this website will be a useful resource for local people to find out more about Liberal Democrats in Derbyshire Dales and the campaigns we are running.</p><p>However, we would like it to be more than that - we would like to hear from you. Online you can:</p><ul><li><p class=hyperlink><a href=/views.php>Send us your views</a>. </p></li><li><p class=hyperlink><a href=/register.php>Register for our Free Email News Updates</a>. </p></li><li><p class=hyperlink><a href=/join.php>Join the Liberal Democrats today</a>! </p></li><li><p class=hyperlink><a href=http://www.derbyshiredales.gov.uk/NR/rdonlyres/71FDD53B-5CBD-4F6F-986B-D263CBE8F48D/0/Postalapplicationform.doc>Register for Postal Vote</a>. </p></li></ul><a name=be-green-check-prices-here-before-you-shop-and-help-to-fund-our-election-campaign></a><h1>Be Green - Check Prices here before you shop and help to fund our election campaign </h1><iframe src="http://rcm-uk.amazon.co.uk/e/cm?t=derbyshired05-21&o=2&p=26&l=ez&f=ifr&f=ifr" width=468 height=60 scrolling=no marginwidth=0 marginheight=0 border=0 frameborder=0 style=border:none;></iframe><script type=text/javascript><!--
  amazon_ad_tag = "derbyshired05-21";  amazon_ad_width = "468";  amazon_ad_height = "60";//--></script><script type=text/javascript src=http://www.assoc-amazon.co.uk/s/ads.js></script><iframe src="http://rcm-uk.amazon.co.uk/e/cm?t=derbyshired05-21&o=2&p=44&l=ur1&category=homepage&banner=19B7CDVNDT0TC1FYJH82&f=ifr" width=100 height=70 scrolling=no border=0 marginwidth=0 style=border:none; frameborder=0></iframe><hr class=clearance><table class=mediumemp width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000038.html>A NEW VISION FOR DERBYSHIRE DALES OPEN, LOCAL, CLEAN &amp; GREEN</a></h3><p class=datefollowsh><acronym title=Wednesday>Wed</acronym> 25th <acronym title=April>Apr</acronym> 2007 </p><p class=news>Manifesto for Derbyshire Dales District Council Elections</p></td><td class=image valign=top align=right><a href=news/000038.html><img alt=Chatsworth title=Chatsworth src=images/sites/82.165.40.25-421a27b3343a54.44886981/thumbs/34.jpeg border=0 width=96 height=128 class=small></a></td></tr><tr><td class=link colspan=2><p class=hyperlink><a href=news/000038.html>Read &quot;A NEW VISION FOR DERBYSHIRE DALES OPEN, LOCAL, CLEAN &amp; GREEN&quot; in full (258 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000037.html>JOINT DERBYSHIRE DALES AND HIGH PEAK HOUSING NEEDS SURVEY</a></h3><p class=datefollowsh><acronym title=Monday>Mon</acronym> 23rd <acronym title=April>Apr</acronym> 2007 </p><p class=news>&quot;Over the next five years Derbyshire Dales is facing an exodus of local young people to areas where housing is more affordable,&quot; says Councillor David Fearn, Deputy Leader of the Liberal Democrats on Derbyshire Dales District Council. Councillor Fearn is shocked by the findings of a recently produced Housing Needs Survey commissioned by the District Council, which shows a serious shortfall in the number of affordable dwellings being provided.</p></td><td class=image valign=top align=right><a href=news/000037.html><img alt="DAvid Fearn" title="DAvid Fearn" src=images/sites/82.165.40.25-421a27b3343a54.44886981/thumbs/31.jpeg border=0 width=98 height=128 class=small></a></td></tr><tr><td class=link colspan=2><p class=hyperlink><a href=news/000037.html>Read &quot;JOINT DERBYSHIRE DALES AND HIGH PEAK HOUSING NEEDS SURVEY&quot; in full (196 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000036.html>DEFECTORS - WHAT DEFECTORS?</a></h3><p class=datefollowsh><acronym title=Sunday>Sun</acronym> 22nd <acronym title=April>Apr</acronym> 2007 </p><p class=news>The recent Conservative claim about three defectors from the Liberal Democrats in Matlock would be laughable, except that their combined actions have been so dishonest and deceitful.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000036.html>Read &quot;DEFECTORS - WHAT DEFECTORS?&quot; in full (178 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000034.html>The Closure of Darley Dale company - Cobb Slater Ltd</a></h3><p class=datefollowsh><acronym title=Tuesday>Tue</acronym> 17th <acronym title=April>Apr</acronym> 2007 </p><p class=news>David Fearn, Deputy Leader of Derbyshire Dales District Council Liberal Democrats says: The closure of Cobb Slater Ltd is terrible news for the loyal employees who work there. BNL purchased the company knowing full well the lease on the site and buildings was only short term. Basically they've taken over the business so as to move the production elsewhere. It's suspected by many that the owners of the site think they can build houses on the land and so profit from the booming housing market.&quot;</p></td><td class=image valign=top align=right><a href=news/000034.html><img alt="David Fearn - Liberal Democrat District Councillor for Darley Dale " title="David Fearn - Liberal Democrat District Councillor for Darley Dale " src=images/sites/82.165.40.25-421a27b3343a54.44886981/thumbs/29.jpeg border=0 width=98 height=128 class=small></a></td></tr><tr><td class=link colspan=2><p class=hyperlink><a href=news/000034.html>Read &quot;The Closure of Darley Dale company - Cobb Slater Ltd&quot; in full (173 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000033.html>Liberal Democrats Candidates for May Elections </a></h3><p class=datefollowsh><acronym title=Monday>Mon</acronym> 16th <acronym title=April>Apr</acronym> 2007 </p><p class=news>Twenty four Liberal Democrat candidates are standing throughout the area for Derbyshire Dales District Council elections on May 3rd as follows:-</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000033.html>Read &quot;Liberal Democrats Candidates for May Elections &quot; in full (175 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000032.html>NICK CLEGG says &quot;SAY NO to ID CARDS&quot;</a></h3><p class=datefollowsh><acronym title=Monday>Mon</acronym> 12th <acronym title=March>Mar</acronym> 2007 </p><p class=news>You may have seen the news in Monday's Daily Mail that the Government is planning to sell access to our personal data once the unpopular ID cards scheme has been introduced.</p></td><td class=image valign=top align=right><a href=news/000032.html><img alt="Nick Clegg" title="Nick Clegg" src=images/sites/82.165.40.25-4291a46af15792.61365242/thumbs/40.jpeg border=0 width=128 height=117 class=small></a></td></tr><tr><td class=link colspan=2><p class=hyperlink><a href=news/000032.html>Read &quot;NICK CLEGG says &quot;SAY NO to ID CARDS&quot;&quot; in full (243 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3><a href=news/000031.html>Liberal Democrat Councillors act to stop anti-social behaviour in Willow Way, Darley Dale </a></h3><p class=datefollowsh><acronym title=Sunday>Sun</acronym> 11th <acronym title=March>Mar</acronym> 2007 </p><p class=news>Concern has been expressed about anti-social behaviour and other problems associated with Willow Way in Darley Dale. All three district councillors for Darley Dale have been aware of the situation for sometime now and have sought to do something about it.</p></td><td class=image valign=top align=right><a href=news/000031.html><img alt="DAvid at sign" title="DAvid at sign" src=images/sites/82.165.40.25-421a27b3343a54.44886981/thumbs/27.jpeg border=0 width=104 height=128 class=small></a></td></tr><tr><td class=link colspan=2><p class=hyperlink><a href=news/000031.html>Read &quot;Liberal Democrat Councillors act to stop anti-social behaviour in Willow Way, Darley Dale &quot; in full (487 words)</a>. </p></td></tr></table><p class=hyperlink><a href=news/ >Archive of earlier news stories</a>. </p><address> Printed and hosted by Prater Raines Partners, 82b Sandgate High Street, Folkestone CT20 3BX. <br> Published and promoted by Derbyshire Dales Liberal Democrats, (Shirley Holt) The Barn, High Street, Stoney Middleton, Hope Valley, Derbyshire, S32 4TL. <br> The views expressed are those of the party, not of the service provider. </address></td><td class=panel id=rhs width=210 align=center valign=top><table class=rhsbox width=200 bgcolor=#cccccc border=1 cellspacing=0 cellpadding=2><tr><td><script type=text/javascript src="http://petitions.libdems.org.uk/showTV.php?width=190&text=off"></script></td></tr></table><table class=rhsbox width=200 bgcolor=#cccccc border=1 cellspacing=0 cellpadding=2><tr><td></td></tr><tr><th>Liberal Democrat Campaigns</th></tr><tr><td><script type=text/javascript src=http://petitions.libdems.org.uk/showButtons.php></script></td></tr></table><table class=rhsbox width=200 bgcolor