t student ... <span class=news_date>01.03.07</span></a></div><div class=NewsCTA-InnerInnerWrap><a href=http://www.sie.ac.uk/index.cfm/display_page/News2/control_contentType/news_list/display_open/news_313/ ><span class=news_headline>Johnston Carmichael accelerate Scottish students</span> Johnston Carmichael partners SIE as new Business P... <span class=news_date>31.01.07</span></a></div></div></div><div class=CTAWrapper><div class=CornerTR><h3>Ignite Magazine</h3></div><div class=CTA_InnerWrapper><div class=InrInrWrapper><p align=center><a href=http://www.sie.ac.uk/index.cfm/display_page/media_ignite><img width=76 height=70 border=0 src=/UserFiles/Image/Homepage-Ignite(1).jpg alt></a></p><p align=center> </p><p align=center>&nbsp;&nbsp;&nbsp; </p><p align=center>By students, for students.</p></div></div><div class=FindMore><a href=/index.cfm/display_page/media_ignite/ > find out more ></a></div></div></div><div id=contentNoNav><div id=breadcrumb> | <span class=BC1>home</span></div><div class=PrintIcon><a href=javascript:window.print()>Print this page</a></div><h2>Developing tomorrow's talent, today</h2><table border=0 cellspacing=0><tr><td><p>Welcome to the Scottish Institute for Enterprise (SIE).&nbsp; We're&nbsp;here to help you. Help you start your own business, help you land a top job and help you stand out from the other 180,000 students in Scotland. Look around, what makes you special? </p><p>&nbsp; </p><p>Our programmes can give you the skills, confidence and experience to make your impact on the world. SIE's commitment is to developing you to be all you can be and, in turn, help towards the creation of a Smart, Successful Scotland. </p><p>&nbsp;</p><div class=CTAWrapper><div class=CornerTR><h3>Got a business Idea? </h3></div><div class=CTA_InnerWrapper><div class=InrInrWrapper><p><table cellspacing=1 cellpadding=1 summary border=0><tbody><tr><td><font size=2></font><a href=http://www.sie.ac.uk/index.cfm/display_page/yourbusinessadvisors><img alt src=/UserFiles/Image/Summit07_-_EXHIBIT_03(1).jpg></a>&nbsp;&nbsp; </td><td><p><strong>Fancy being the next Tom Hunter or Richard Branson?</strong> </p><p><strong>Why not be your own Boss? </strong></p><p>&nbsp;</p><p>SIE advisors are here to help you develop your ideas into real businesses. </p><p>They offer the advice and support to help take your idea off the ground. Why not give us a call?&nbsp;</p></td></tr></tbody></table></p></div></div><div class=FindMore><a href=/index.cfm/display_page/yourbusinessadvisors/ > find out more ></a></div></div><div class=CTAWrapper><div class=CornerTR><h3>2007 Social Enterprise Conference</h3></div><div class=CTA_InnerWrapper><div class=InrInrWrapper><table cellspacing=1 cellpadding=1 summary border=0><tbody><tr><td align=center><a href=http://www.sie.ac.uk/index.cfm/display_page/socialenterpriseprogramme/ ><img height=67 width=100 alt src=/UserFiles/Image/Small_SIBBALD_04.jpg></a>&nbsp;&nbsp;&nbsp; </td><td><p><strong>2007 Social Enterprise Conference</strong></p><p><strong>Entrepreneurial people changing Scotland</strong></p><p>&nbsp; </p><p>Business isn't all about making money. It's about making positive changes.</p><p>Innovative solutions to serious issues. Find out what you missed.</p></td></tr></tbody></table></div></div><div class=FindMore><a href=/index.cfm/display_page/socialenterpriseprogramme/ > find out more ></a></div></div><div class=CTAWrapper><div class=CornerTR><h3>SIE International Student Enterprise Summit</h3></div><div class=CTA_InnerWrapper><div class=InrInrWrapper><table cellspacing=1 cellpadding=1 summary border=0><tbody><tr><td align=center><a href=http://www.sie.ac.uk/index.cfm/display_page/2007_summit_speakers/ ><img height=71 alt width=100 src=/UserFiles/Image/Small_Bear_Grylls_Front.jpg></a>&nbsp;&nbsp;&nbsp; </td><td><p><strong>Wednesday 7th March, SIE Summit bigger than ever.</strong></p><p><strong>1,650&nbsp;students&nbsp;headed to Dundee. Find out what you missed</strong></p><p>&nbsp; </p><p>Listen to inspirational people from all walks of life tell you their stories. </p><p>Learn some of the secrets to success and walk away a different person.</p></td></tr></tbody></table></div></div><div class=FindMore><a href=/index.cfm/display_page/2007_summit_speakers/ > find out more ></a></div></div></td></tr></table><div id=cleardiv></div></div><div id=FooterWrapper><div id=footer><div id=OurLink><h3><a href=http://www.alienationpublish.co.uk/ target=_blank><span>powered by alienation publish</span></a></h3></div><div id=FooterText>copyright 2006 sie</div></div></div></div></body>",nonspam

