</style></head><body><div id=container><div id=header><img class=headerview src=images/morning-view.jpg alt="A constant changing vista of sea and mountains can be seen from the cottage" title="An early morning view from Fossil Cottage"><h1>Fossil Cottage</h1><h2 class=banner>Lower Breakish</h2><h2 class=banner>Isle of Skye</h2></div><div id=centerDoc><p><a class=pic1 href=#></a><strong>Fossil Cottage</strong> is a small, charming old croft house situated right by the seashore in a secluded and peaceful location. Three paces from the front door and you are on the shores of a tidal estuary full of wildlife &#45; a haven for otters and seals, seabirds and waders, rare orchids and other plants and a designated Site of Scientific Interest for its geology. You can find giant fossils in a hidden bay nearby, and several smaller ones in the walls of the cottage and in the stones of the path just outside. </p><p><a class=pic2 href=#></a></p><p>Over 100 years old, Fossil Cottage has been modernised to offer you tasteful comfort while retaining its traditional character. From the big window in the sitting room you can watch the high tide lapping a few feet away, spectacular sunsets dramatically colouring the evening sky or herons standing like sentinels by the water&#39;s edge. In spring you will be amused by the sheep and lambs waiting for the tide to go out to cross over to their moorland grazings. The sheep wade, and lambs learn to swim only hours after being born. If you&#39;re lucky you might catch a glimpse of a seal or an otter swimming by on the tide just outside the window.</p><img class=ammonitepic src=images/ammonite50.jpg alt="Ammonite fossils are common in local stones" title="ammonite fossil"><p class=aside>There&#39;s an ammonite<br>in the lintel above the old doorway.</p><p class=rollover>Hover over these pictures for more views</p><h3 class=banner>We look forward to welcoming you to Fossil Cottage<br>for a special holiday in a special place.</h3><div id=footerText><p>&copy; 2006 <a href=index.html title="Fossil Cottage - a special place on the Isle of Skye">Fossil Cottage</a>&nbsp;&#124;&nbsp;All rights reserved</p><p>Thanks to Shirley Grant and Martin Benson for their excellent photos</p></div></div><div id=navigation><a class=nav id=item1 href=index.html>Home</a><a class=nav id=item2 href=cottage.html>The Cottage</a><a class=nav id=item3 href=photos.html>More pictures</a><a class=nav id=item4 href=activities.html>Activities</a><a class=nav id=item5 href=map.html>Find us</a><a class=nav id=item6 href=availability.html>Rates and availability</a><a class=nav id=item7 href=booking.html>Booking</a><a class=nav id=item8 href=links.html>Links</a><a class=nav id=item9 href=contactus.html>Contact Us</a></div></div><script src=http://www.google-analytics.com/urchin.js type=text/javascript>
</script><script type=text/javascript>
