px?id=67">Click here </a>to download copies of the MID Guidance Notes</h2><p><br><img style="WIDTH: 195px; HEIGHT: 195px" height=1072 alt src=http://www.nwml.gov.uk/Images/NWML/GuidanceNotes.jpg width=1390><br><br><br><br>Following the coming into force of the MID implementing Regulations on 30th October 2006, NWML has&nbsp;formally published&nbsp;guidance documents for those instruments under our regulatory responsibility ie. 11 sets of Documents. </p></td></tr><tr valign=top><td><h2><a href=http://www.nwml.gov.uk/video.aspx>Click here for a Video tour of NWML</a></h2><p><img alt src=http://www.nwml.gov.uk/Images/NWML/Homepage/video2_small.JPG></p><ul style="CLEAR: both"><li>Type Approval &amp;Testing</li><li>Training &amp; Consultancy</li><li>Calibration</li><li>ACB &amp; Audit Services</li><li>Legislation &amp;Enforcement</li><li>Our Customers Say..</li></ul></td><td><h2>New notified body search facility for the NAWI and MID Directives</h2><p><img style="WIDTH: 188px; HEIGHT: 206px" height=249 alt src=http://www.nwml.gov.uk/Images/NWML/Legislation/UKmap.gif width=196><br><br><br>Our facility has been developed to help those who wish to find an organisation in the UK with the competence to undertake conformity assessment. Click&nbsp;<a href=http://www.nwml.gov.uk/InstrumentSearch.aspx target=_self>here </a>to identify your nearest notified body.<br><br><br><br></p></td></tr></tbody></table></div></div><div id=side_bar><h5><span id=News1_lblNews>Latest News</span></h5><ul><li><a href="/news/newsarticle.aspx?id=69">Trainee Approvals Engineer required</a></li><li><a href="/news/newsarticle.aspx?id=67">MID Guidance Notes now published</a></li><li><a href="/news/newsarticle.aspx?id=66">Case Studies on What Work We Do at NWML</a></li><li><a href="/news/newsarticle.aspx?id=65">Consultation notice on the proposed changes to the Non-Automatic Weighing Instruments Regulations </a></li><li><a href="/news/newsarticle.aspx?id=64">Transfer of CCP responsibilities for weights and measures issues to NWML</a></li></ul><h5>Events</h5><ul><li><a href="/news/newsarticle.aspx?id=48">MID Awareness Day</a></li></ul><h5>Latest Press Articles</h5><ul><li><a href="/documents/NWML mission and vision March 2007 v2.pdf">NWML's mission and vision</a></li><li><a href="/documents/Camelot press story for web.pdf">Everyone's A Winner</a></li><li><a href="/documents/PRESS RELEASE medal.pdf">OIML medal winner</a></li><li><a href="/documents/Walk to work week at NWML.pdf">Walk To Work Week</a></li><li><a href="/documents/Post Office PRESS RELEASE final.pdf">NWML helps Royal Mail Measure Up</a></li></ul><a href=http://www.rohs.gov.uk target=_blank><img src=images/rohs_vertical.gif width=250 height=114 border=0 alt=ROHS></a><br><span style=padding-left:7px;><a href=http://www.dti.gov.uk/ target=_blank><img src=images/dti_small.gif border=0 alt=DTI></a></span><span style=padding-left:10px;><a href=http://www.businesslink.gov.uk/ target=_blank><img src=images/business_link_small.gif border=0 alt="Business Link"></a></span></div><div style=clear:both;><!--clearing div to fix IE float issuses.--></div></div><div id=footer><div id=footer_bar></div><div id=shadow_bottom><div id=shadow_bottomleft><div id=shadow_bottomright><div id=footer_content><div class=small_print><div>&copy; 2007 NWML</div><div class=links> | <a href=mailto:feedback@nwml.gov.uk>Send us your feedback</a> | <a href=/TandC.aspx>Conditions &amp; Privacy Policy</a></div></div><div class=site_credits><a href=http://www.activeis.net target=_blank>Design and technology by ActiveIS</a></div><div class=print_button><script language=JavaScript>
