--></style><title>Steve Goddard</title><link rel=home href=index.html><link rel=contents href=index.html><link rel=alternate type=application/rss+xml title="News from Steve Goddard" href=news.rdf><link rel="shortcut icon" href=images/logos/liberal-democrat.ico></head><body bgcolor=#ffffff text=#000000 link=#0000cc alink=#ff3333 vlink=#660099><table id=top width=100% border=1 cellspacing=0 cellpadding=0 bgcolor=#ffffff><tr><td id=toplogo valign=top><img alt="Liberal Democrats" title="Liberal Democrats" src=images/logos/liberal-democrat.gif border=0 width=200 height=66 id=logo></td><td id=toptitle align=right valign=top><p id=topname>Steve Goddard</p><p id=topdescription>The best choice to be Oxford East's next <acronym title="Member of Parliament">MP</acronym>! </p></td><td id=topportrait style="width: 80px;" width=80 align=right valign=top><img alt title src=images/sites/82.165.40.25-43ff2c8d19b758.93819568/portrait.jpeg border=0 width=80 height=94 id=photobox></td></tr></table><table id=banner width=100% bgcolor=#cccccc border=0 cellspacing=0 cellpadding=2><tr><td id=bannername style="width: 25%;" width=25% height=30 align=right valign=middle><span>Steve Goddard</span></td><td id=bannermail style="width: 25%;" width=25% height=30 align=left valign=middle><span>&lt;<a href=mailto:steve@stevegoddard.org.uk>steve@stevegoddard.org.uk</a>&gt;</span></td><td id=bannerdate style="width: 25%;" width=25% height=30 align=center valign=middle>4th May 2007</td><td class=bannersearch style="width: 25%;" width=25% height=30 align=center valign=middle><form action=search.php method=get><p class=bannersearch><label for=searchbox style="visibility: hidden; display: none;">Search this site:</label><input id=searchbox name=query type=text value="Enter search here..." onfocus="if (this.value == 'Enter search here...') this.value = '';"><input id=searchbutton type=submit value=Search.></p></form></td></tr></table><table id=content width=100% border=0 cellspacing=0 cellpadding=5><tr><td id=navigation bgcolor=#cccccc width=150 align=center valign=top><map id=navigationmenu title="Navigation Menu"><table id=menu border=1 cellspacing=0 cellpadding=2><tr id=skipnav><td align=left valign=top><a href=#postbar>Skip Navigation Menu</a></td></tr><tr><td id=menu_1 align=left valign=top class=selected bgcolor=#999999><span class=arrow>&raquo;</span> Home Page </td></tr><tr><td id=menu_2 align=left valign=top><span class=arrow>&raquo;</span><a href=pages/Biography.html>About Steve</a></td></tr><tr><td id=menu_3 align=left valign=top><span class=arrow>&raquo;</span><a href=pages/SteveMedia.html>Steve and the Media</a></td></tr><tr><td id=menu_4 align=left valign=top><span class=arrow>&raquo;</span><a href=articles/recent.html>Recent Articles</a></td></tr><tr><td id=menu_5 align=left valign=top><span class=arrow>&raquo;</span><a href=news/ accesskey=n title='Keyboard shortcut "N".'>News Archive</a></td></tr><tr><td id=menu_6 align=left valign=top><span class=arrow>&raquo;</span><a href=pages/Policy.html>Policy </a></td></tr><tr><td id=menu_7 align=left valign=top><span class=arrow>&raquo;</span><a href=pages/Personal.html>Why I'm a Liberal</a></td></tr><tr><td id=menu_8 align=left valign=top><span class=arrow>&raquo;</span><a href=contact/ >Contact Us</a></td></tr><tr><td id=menu_9 align=left valign=top><span class=arrow>&raquo;</span><a href=http://www.libdems.org.uk/ >National Lib Dems</a></td></tr><tr><td id=menu_10 align=left valign=top><span class=arrow>&raquo;</span><a href=join.php>Join The Party</a></td></tr><tr><td class=separator></td></tr><tr><td id=menu_11 align=left valign=top><span class=arrow>&raquo;</span><a href=user/login.html accesskey=l title='Keyboard shortcut "L".'>Log In</a></td></tr></table><p>You are not logged in.</p><p class=pin><span class=pinarr>*</span><a href=http://www.w3.org/WAI/WCAG1A-Conformance title="Accessible web site"><img alt="Accessible web site" title="Accessible web site" src=images/pins/wcag1A-small.gif border=0 width=80 height=15 id=waipin class=pin></a><span class=pinarr>*</span></p><p class=pin><span class=pinarr>*</span><a href=http://validator.w3.org/check/referer title="Valid XHTML 1.0"><img alt="Valid XHTML 1.0" title="Valid XHTML 1.0" src=images/pins/xhtml10-small.gif border=0 width=80 height=15 id=htmlpin class=pin></a><span class=pinarr>*</span></p><p class=pin><span class=pinarr>*</span><a href="http://jigsaw.w3.org/css-validator/validator?uri=http%3A%2F%2Fstevegoddard.org.uk%2F&warning=1&profile=css2" title="Valid CSS"><img alt="Valid CSS" title="Valid CSS" src=images/pins/css-small.gif border=0 width=80 height=15 id=csspin class=pin></a><span class=pinarr>*</span></p><p>You can make the text on this site bigger or smaller using your web browser's text size controls.</p><p> We respect your right to privacy. Read <a href=privacy.html>our privacy policy</a> to find out more. </p><p><a href=http://www.prai.co.uk/ >Designed and developed by Prater Raines Partners</a>. </p><p><a href=other.html>Other party sites</a>. </p></map></td><td class=panel id=central align=left valign=top><a name=postbar id=postbar></a><a name=a-record-of-action-a-promise-of-more></a><h1>A record of action -- a promise of more</h1><p>Welcome to the official website of Steve Goddard, Liberal Democrat Candidate for Oxford East in 2001 and 2005 -- and the man to beat Labour next time round! Steve has led the team that has turned a Labour safe seat into one of the top LibDem targets in the <acronym title="United Kingdom">UK</acronym>. Give him the tools and he'll finish the job. Whatever you want to know -- whether it's about what Steve has done or what he would campaign on as an <acronym title="Member of Parliament">MP</acronym> -- you should find it here. This site is updated regularly, so check back often... If you want to learn more or to support Steve, you can email him on: <a href=mailto:steve@stevegoddard.org.uk>steve@stevegoddard.org.uk</a>.</p><a name=steve-is-selected-as-parliamentary-candidate-for-oxford-east></a><h1>04/04/06 - Steve is Selected as Parliamentary Candidate for Oxford East.</h1><p class=hyperlink><a href="http://www.stevegoddard.org.uk/news/10.html?PHPSESSID=3a4251c605f897143129f863a449fcee">A message from Oxford East's next <acronym title="Member of Parliament">MP</acronym></a>! </p><div style="text-align: center;"><img alt=Steve title=Steve src=images/sites/82.165.40.25-43ff2c8d19b758.93819568/static/2.jpeg border=0 width=620 height=334 class=pageimage></div><hr class=clearance><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> A big thank you- and a big ask! </h3><p class=datefollowsh><acronym title=Wednesday>Wed</acronym> 5th <acronym title=April>Apr</acronym> 2006 </p><p class=news>Dear friend,</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000010.html>Read &quot;A big thank you- and a big ask!&quot; in full (499 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> Goddard Responds to Labour Budget </h3><p class=datefollowsh><acronym title=Monday>Mon</acronym> 27th <acronym title=March>Mar</acronym> 2006 </p><p class=news>Oxford East's PPC from 2001 &amp; 2005 today added his voice to criticism of New Labour's latest budget.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000009.html>Read &quot;Goddard Responds to Labour Budget&quot; in full (221 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> Labour once more fails our pensioners </h3><p class=datefollowsh><acronym title=Monday>Mon</acronym> 20th <acronym title=March>Mar</acronym> 2006 </p><p class=news>After years of neglect and inaction - including the period when Oxford East's New Labour <acronym title="Member of Parliament">MP</acronym> was in charge of our pensions system - it has become clear that the government is continuing to fail our pensioners.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000008.html>Read &quot;Labour once more fails our pensioners&quot; in full (259 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> Labour's Funding Problems Show Virtues Of Grassroots Support </h3><p class=datefollowsh><acronym title=Friday>Fri</acronym> 17th <acronym title=March>Mar</acronym> 2006 </p><p class=news>As the Labour party reeled today under fresh allegations of party funding irregularities, Steve Goddard has emphasised Oxford East Lib Dems' focus on members' donations, and the vital role grassroots support plays to our local success.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000007.html>Read &quot;Labour's Funding Problems Show Virtues Of Grassroots Support&quot; in full (220 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> A Sign of Things to Come? </h3><p class=datefollowsh><acronym title=Thursday>Thu</acronym> 16th <acronym title=March>Mar</acronym> 2006 </p><p class=news>After last night's votes in the House of Commons, where the Labour government managed to get its controversial education bill through only thanks to Tory support, Steve Goddard has claimed that the Labour-Tory alliance may be 'a sign of things to come'.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000006.html>Read &quot;A Sign of Things to Come?&quot; in full (247 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> Steve Brands Labour's Recycling Plans &quot;Rubbish&quot; </h3><p class=datefollowsh><acronym title=Wednesday>Wed</acronym> 15th <acronym title=March>Mar</acronym> 2006 </p><p class=news>Steve Goddard today emphasised that the Liberal Democrats were the only party to take environmental policy seriously, and pledged to lead the fight against Labour's local and national negligence.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000005.html>Read &quot;Steve Brands Labour's Recycling Plans &quot;Rubbish&quot;&quot; in full (215 words)</a>. </p></td></tr></table><table class=medium width=100% cellspacing=0 cellpadding=4 border=0><tr><td valign=top><h3> &quot;ID Cards Will Divide British Communities&quot; - Steve </h3><p class=datefollowsh><acronym title=Tuesday>Tue</acronym> 14th <acronym title=March>Mar</acronym> 2006 </p><p class=news>As Labour <acronym title="Members of Parliament">MPs</acronym> again tried to force ID cards through parliament last night, Steve Goddard has repeated his criticism of the plans. &quot;The ID card scheme is an example of the very worst of Labour. It is expensive, intrusive and designed to please the newspapers' headline-writers, not actually provide new security,&quot; Steve said.</p></td></tr><tr><td class=link colspan=1><p class=hyperlink><a href=news/000004.html>Read &quot;&quot;ID Cards Will Divide British Communities&quot; - Steve&quot; in full (257 words)</a>. </p></td></tr></table><p class=hyperlink><a href=news/ >Archive of earlier news stories</a>. </p><address> Printed and hosted by Prater Raines Partners, 82b Sandgate High Street, Folkestone CT20 3BX. <br> Published and promoted on behalf of Steve Goddard <br> The views expressed are those of Steve Goddard, not of the service provider. </address></td><td class=panel id=rhs width=210 align=center valign=top><form action=user/register.html method=get><table class=rhsbox width=200 bgcolor=#cccccc border=1 cellspacing=0 cellpadding=2><tr><th colspan=2 scope=col align=center bgcolor=#999999> Get Free Updates By <span style="white-space: nowrap;">E-Mail</span></th></tr><tr><td><table class=subscription width=100% border=0 cellspacing=0 cellpadding=0><tr><td><label for=subscribe_name>Name:</label></td><td><input class=rhstext type=text id=subscribe_name name=name></td></tr><tr><td><label for=subscribe_email>E-mail:</label></td><td><input class=rhstext type=text id=subscribe_email name=email></td></tr><tr><td colspan=2 align=center style="text-align: center;"><input class=pollbutton type=submit value=Register.></td></tr></table></td></tr></table></form><table class=rhsbox width=200 bgcolor=#cccccc border=1 cellspacing=0 cellpadding=2><tr><th scope=col align=center bgcolor=#999999>Liberal Democrats : All News Feed</th></tr><tr><td><p class=boxedheadline><a href="http://www.libdems.org.uk/news/story.html?id=12515&navPage=news.html">Election results round-up</a><br><acronym title=Thursday>Thu</acronym> 3rd <acronym title=May>May</acronym> 2007 </p><p class=boxedheadline><a href="http://www.libdems.org.uk/news/story.html?id=12499&navPage=news.html">Blair-Brown score 4 out of 10</a><br><acronym title=Monday>Mon</acronym> 30th <acronym title=April>Apr</acronym> 2007 </p><p class=boxedheadline><a href="http://www.libdems.org.uk/news/story.html?id=12461&navPage=news.html">WATCH: How Liberal Democrats are cutting crime</a><br><acronym title=Tuesday>Tue</acronym> 24th <acronym title=April>Apr</acronym> 2007 </p><p class=boxedheadline><a href="http://www.libdems.org.uk/campaigns/campaign.html?id=5314&navPage=campaigns.html">ACT: Why Council Tax must go</a><br><acronym title=Thursday>Thu</acronym> 9th <acronym title=October>Oct</acronym> 2003 </p><p class=boxedheadline><a href="http://www.libdems.org.uk/news/story.html?id=12502&navPage=news.html">Campbell: 7/7 public inquiry needed after revelations</a><br><acronym title=Monday>Mon</acronym> 30th <acronym title=April>Apr</acronym> 2007 </p><p class=boxedheadline><a href=http://www.libdems.org.uk/news>More Liberal Democrats : All News Feed</a>... </p></td></tr></table><table class=rhsbox width=200 bgcolor=#cccccc border=1 cellspacing=0 cellpadding=2><tr><th scope=col align=center bgcolor=#999999>Oxford East General Election Result</th></tr><tr><td><p class=pollresult>Turnout: 41790 (58%)</p><div class=pollpercentmax>36.9%</div><div class=pollbar style="width: 48px; background-color: rgb(226, 61, 61); border-style: solid; border-width: 1px; border-color: rgb(0, 0, 0);">&nbsp;</div><div class=pollanswermax>Labour: 15405 (&minus;12.5%)</div><div class=pollpercent>34.6%</div><div class=pollbar style="width: 45px; background-color: rgb(255, 190, 40); border-style: solid; border-width: 1px; border-color: rgb(0, 0, 0);">&nbsp;</div><div class=pollanswer>Liberal Democrat: 14442 (+11.2%)</div><div class=pollpercent>16.7%</div><div class=pollbar style="width: 22px; background-color: rgb(74, 115, 239); border-style: solid; border-width: 1px; border-color: rgb(0, 0, 0);">&nbsp;</div><div class=pollanswer>Conservative: 6992 (&minus;2%)</div><p class=pollresult><a href=results/1128.html>View the results in detail</a>. </p></td></tr></table></td></tr></table></body>",nonspam

