</style><link href=./style/aiai.css rel=stylesheet type=text/css></head><body bgcolor=ffffff><table width=100% border=0><tr><td><div align=center><img src=./style/indexlogo.gif width=446 height=14 border=0></div><br></td></tr><tr><td><table width=100% border=0><tr><td><div align=center><span class=smallfont><a href=./index.html>Home</a> | <a href=./technology.html>Technology</a> |<a href=./research.html> Research</a> |<a href=./achievements.html> Achievements</a> |<a href=./projects.html> Projects</a> | <a href=./courses.html>Courses</a>|<a href=./people.html> People</a> | <a href=./workingwithaiai.html>Working With AIAI</a> | <a href=./events.html>Events</a> | <a href=./contact.html>Contact</a><br><img src=./style/line.jpg width=741 height=2 class=linepaddingtop></span></div></td></tr><tr><td><div align=center></div><br></td></tr><tr><td><table width=100% border=0><tr><td valign=top><img src=./style/head.jpg width=400 height=363><!--            <img src="./style/artwork/collage-2.jpg" width="400" height="363"> --></td><td><strong>AIAI</strong> is a technology transfer organisation that promotes the application of Artificial Intelligence research for the benefit of commercial, industrial, and government clients. AIAI has considerable experience of working with small innovative companies, and with research groups in larger corporations. <p>AIAI specialises in Intelligent Systems - systems making use of the knowledge of experts, or systems that learn.<br><br> The <a href=./technology.html> AI technologies</a> AIAI transfers to commerce and industry are: </p><ul><li type=square>case-based reasoning: a technique for utilising past experiences and existing corporate resources such as databases to guide diagnosis and fault finding;</li><li type=square>genetic algorithms: an adaptive search technique with very broad applicability in scheduling, optimization, and model adaptation;</li><li type=square>planning and workflow: the modelling, task setting, planning, execution, monitoring and coordination of activities;</li><li type=square>intelligent systems: the methodology of building knowledge-based systems.</li></ul><p><a href=/i3ai/ >Innovative applications</a> are created using these technologies. </p><p>AIAI is part of the <a href=http://www.inf.ed.ac.uk>School of Informatics</a> at the <a href=http://www.ed.ac.uk>University of Edinburgh</a>. We offer a wide range of <a href=http://www.inf.ed.ac.uk/undergraduate/ >undergraduate</a> and <a href=http://www.inf.ed.ac.uk/postgraduate/ >postgraduate</a> degrees in Artificial Intelligence, Cognitive Science, Computational Linguistics, Computer Science and Software Engineering. </p></td></tr></table></td></tr><tr><td><table width=100% border=0><tr><td width=64%><div align=left> <table width=90% border=0><tr><td width=7%><a href=./index.html><img src=./style/logobottom.gif alt="Back to Home page" width=60 height=35 border=0 align=absbottom></a></td><td width=93% class=verysmallfont><a href=./contact.html class=verysmallfont>Artificial Intelligence Applications Institute</a><br><a href=http://www.inf.ed.ac.uk class=verysmallfont> School of Informatics</a>, <a href=http://www.ed.ac.uk> The University of Edinburgh</a></td></tr></table></div></td><td width=36%><div align=right><table width=89% border=0 align=left><tr valign=bottom><td height=27 valign=bottom class=verysmallfont><div align=right><a href=sitemap.html>Site Map</a><br><!--<a href="http://www.regina-fernandes.co.uk">Site designed by Regina Fernandes</a><br> --><div align=right> Updated: Tue Sep 13 20:47:01 2005 </td></tr></table><a href=http://www.ed.ac.uk><img src=./style/eduniv_crest.gif alt="To the Edinburgh University website" width=28 height=28 border=0 align=bottom></a></div></td></tr></table></td></tr></table></td></tr></table></body>",nonspam

