  "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd"><html xmlns=http://www.w3.org/1999/xhtml><head><meta content="text/html; charset=utf-8" http-equiv=content-type><title>Artco</title><meta content=artco name=description><meta content=artco name=keywords><script src=/assets/js/pir.js type=text/javascript></script><script src=/assets/js/cssQuery-p.js type=text/javascript></script><link href=/assets/styles/artco-style.css type=text/css rel=stylesheet></head><body id=home><div id=container><div id=holder><div id=header><a href=/ id=logo><img src=/assets/images/artco-logo.gif alt="ArtCo logo" width=128 height=81></a><h1 class=acHideVis>ArtCo Contemporary Fine Arts</h1><div id=navigation><ul><li id=navLIhomepage><a href=/ class=selected>Homepage</a></li><li id=navLIartists><a href=http://www.artco.co.uk/artists>artists</a></li><li id=navLImodernmasters><a href=http://www.artco.co.uk/masters>Modern Masters</a></li><li id=navLIexhibitions><a href=http://www.artco.co.uk/exhibitions>exhibitions</a></li><li id=navLIservices><a href=http://www.artco.co.uk/services>services</a></li><li id=navLIcontact><a href=http://www.artco.co.uk/contact>contact</a></li><li id=navLIbasket><a href=http://www.artco.co.uk/basket>Basket</a></li><li id=navLIweddingartplan><a href=http://www.artco.co.uk/Wedding>Wedding Art Plan</a></li><li id=navLIcurrent><a href=http://www.artco.co.uk/Current>Current </a></li></ul></div><form action=http://www.artco.co.uk/search accept-charset=utf-8 method=get id=sitesearch enctype=multipart/form-data><fieldset><legend class=acHideVis>Search Site</legend><label class=acHideVis for=search>Search</label><input type=text name=keywords id=search><em><a href=/search>advanced search</a></em><input type=submit id=btnSearch value=Search></fieldset></form><div id=basket></div></div> <!--  END #header  --><div id=content><div class=wrap1a><div class=wrap2a><div class=wrap3a><div id=artistinfo class=clearfix><h2>Home Page </h2><div id=intro><p>Artco is a privately run gallery in Leeds, exhibiting and selling quality original contemporary art.</p><p>Our aim is to bring exciting, innovative artwork to a wide audience in a friendly and relaxed gallery space. Whether you are looking for a contemporary painting by an emerging artist or piece of work by an internationally renowned master, our gallery staff will help and advise you to make the right purchase.</p><p>Having been established for over 25 years, we have gained a solid reputation as a serious venue and have customers throughout the U.K.</p><p><em>“A small, privately run commercial gallery, Artco is gaining a reputation as an intriguing venue...” The Guardian May 2006</em></p><img src=/assets/images/gallery.jpg id=galleryphotos></div></div></div></div></div><div><div id=introbodywrapper><div class=wrap1><div class=wrap2><div class=wrap3><div id=introbody class="clearfix restcontent"><div class=section id=are-you><h1><a name=are-you>Are you.......</a></h1><div class=section id=looking-to-buy-art><h2><a name=looking-to-buy-art>Looking to Buy Art</a></h2><p>If you are a first time art buyer and are not exactly sure what you are looking for, see our <a class=reference href=/artists>Artists Page</a> to browse through the different styles of work currently available.</p><p>If you are a collector and know what you are looking for, click on our advanced <a class=reference href="/search?keywords=">search</a> option to take you quickly to pieces that match your requirements.</p><p>We also handle work by internationally reknowned artists such as Marc Chagall, Wassily Kandinsky and Joan Miro. See our Modern <a class=reference href=/masters>Masters</a> Page and <a class=reference href=/exhibitions>Exhibitions</a> Page.</p><p>ALL WORK ON OUR WEBSITE IS AVAILABLE TO BUY ONLINE and DELIVERY IS FREE</p><p>If you would prefer to talk to us before buying a piece of art, our <a class=reference href=/artists>gallery</a> is open 6 days a week (Mon – Fri 9-5, Sat 10-3). You can find our location on the map at the bottom of the page. Alternatively, work can be purchased over the telephone (0113 2620056) after viewing the collection on this site.</p></div><div class=section id=buying-art-as-a-gift><h2><a name=buying-art-as-a-gift>Buying Art as a Gift</a></h2><p>If you are buying art for someone else or if you wish to set up a managed wedding list, <a class=reference href=/services>click here</a> to find out more about Artco Gift Vouchers and Wedding Lists.</p></div><div class=section id=looking-for-art-for-your-business><h2><a name=looking-for-art-for-your-business>Looking for Art for your Business</a></h2><p>If you are looking for art for your offices, showhouse or hotel interior, <a class=reference href=/services>click here</a> to find out more about our corporate art consultancy. Or if you are a designer sourcing original art for an interior design scheme please <a class=reference href=/contact>contact us</a> .</p></div><div class=section id=an-artist><h2><a name=an-artist>An Artist</a></h2><p>Click <a class=reference href=/new_artists>here</a> to find out how to submit work to Artco</p></div></div></div></div></div></div></div><div id=homepageartists><h2>Sample Artworks</h2><div><div class="homepageartworkinfo clearfix"><div class=homepageartwork><div class=wrap1d><div class=wrap2d><div class=wrap3d><a href=/artists/447/478><img src="/system/artwork/478/mainImage?size=160x140"></a></div></div></div></div><h3><a href=/artists/478> Commission 17</a></h3><h4><a href=/artists/447> Commissioned Artwork</a></h4></div></div><div><div class="homepageartworkinfo clearfix"><div class=homepageartwork><div class=wrap1d><div class=wrap2d><div class=wrap3d><a href=/artists/419/504><img src="/system/artwork/504/mainImage?size=160x140"></a></div></div></div></div><h3><a href=/artists/504> Untitled</a></h3><h4><a href=/artists/419> Miro</a></h4></div></div><div><div class="homepageartworkinfo clearfix"><div class=homepageartwork><div class=wrap1d><div class=wrap2d><div class=wrap3d><a href=/artists/307/309><img src="/system/artwork/309/thumbnail?size=160x140"></a></div></div></div></div><h3><a href=/artists/309> Aqua Buds</a></h3><h4><a href=/artists/307> Charlotte Latham</a></h4></div></div></div></div></div><div id=footer><p id=copyright>&copy; ArtCo Ltd - no.1 Meanwood Close, Leeds, West Yorkshire, LS7 2JF - 0113 262 0056 - email: <a href=mailto:info@artco.co.uk>info@artco.co.uk</a></p></div> <!--  END #footer  --></div> <!--  END #holder  --></div> <!--  END #container  --><div id=bottom class=clearfix><script src="http://maps.google.com/maps?file=api&v=2&key=ABQIAAAAakyHA9o0cph5gRpfLe5m3xR5UHFWmUvdsznQGEedGVtPHqxueBRUuW0lF1ugIm4OSZRvuIJ86B5Jog" type=text/javascript></script><script type=text/javascript>
