function loadMap() {
    map = new GMap2(document.getElementById("map"));

    map.setCenter(new GLatLng( 53.81712384763175, -1.547771394252777), 10);

    // Types: G_NORMAL_MAP or G_SATELLITE_MAP or G_HYBRID_MAP
    map.setMapType(G_NORMAL_MAP);
    map.addControl(new GSmallMapControl());
    // add maps controls

    icon0 = new GIcon();
    icon0.image = "/assets/images/icon.png";
    icon0.shadow = "http://www.google.com/mapfiles/shadow50.png";
    icon0.iconSize = new GSize(40, 34);
    icon0.shadowSize = new GSize(67, 34);
    icon0.iconAnchor = new GPoint(20, 34);
    icon0.infoWindowAnchor = new GPoint(9, 2);
    icon0.infoShadowAnchor = new GPoint(28, 25);
}

function addPoints() {

    newpoints[0] = new Array(-1.5477709574127197, 53.81708742755534, icon0, 'Artco Ltd', '<div id="popup">Artco Ltd, 1 Meanwood Close, LeedsWest Yorkshire, LS7 2JF</div>');

    for(var i = 0; i < newpoints.length; i++) {

        var point = new GPoint(newpoints[i][0],newpoints[i][1]);

        //Add overlay to map
        var popuphtml = newpoints[i][4] ;
        var marker = createMarker(point,newpoints[i][2],popuphtml);
        map.addOverlay(marker);
    }
}

function createMarker(point, icon, popuphtml) {
    var marker = new GMarker(point, icon);
    GEvent.addListener(marker, "click", function() {
        marker.openInfoWindowHtml(popuphtml);
    });
    return marker;
}


