a href=theatre/tn10.htm><img src=img_edi/194_twisted.jpg width=194 height=100 border=0></a></td></tr><tr align=left valign=top><td class=main><a href=clubkulture/cn6.htm>London Indie Club Comes To Birmingham</a><br> &ldquo;Frog&rdquo; is coming to Birmingham. This notorious London indie party which has seen live bands like Bloc Party, The Kooks, Klaxons, The View, Kaiser Chiefs, Jamie T &amp; The Pigeon Detectives.....</td><td class=main><a href=gigscene/gn11.htm>&ldquo;Heaven And Hell&rdquo; Black Sabbath Line-Up Reunite For Tour</a><br> Ronnie James Dio, Tony Iommi, Geezer Butler and Vinny Appice have reunited as Heaven And Hell and are embarking on a major tour of UK Arenas in Novembe</td><td class=main><a href=theatre/tn10.htm>A Twisted Tale At Oval House</a><br> Iron Hoof Productions present the world premiere of &ldquo;Twisted&rdquo; at the Oval House Theatre on Kennington Oval in London. This new play by David Dandridge examines male sexuality, lies &amp; deceit.</td></tr><tr align=left valign=top class=main><td class=main><a href=clubkulture/cn7.htm>Gatecrasher Summer Soundsystem</a><br><br><a href=clubkulture/cn4.htm>Ever Wanted to Choose Your Own Club Line-Up?</a><br></td><td align=left><a href=gigscene/gn9.htm>O2 Wireless Festival Announced</a><br><br><a href=gigscene/gn5.htm>Huddersfield Gets It&rsquo;s Own Camping Festival!</a></td><td align=left><p><a href=theatre/tn2.htm>The Martians Are Invading Sheffield (Again)</a><br><br><a href=theatre/tn13.htm>Compass Theatre Bring Arthur Miller To Sheffield</a></p><p>&nbsp;</p> </td></tr><tr align=left valign=top class=main><td class=main><a href=interviews/index.html><img src=img_nav/mainhdinterviews.gif width=193 height=17 border=0></a></td><td colspan=2 align=left> </td></tr><tr align=center valign=top class=main><td><a href=interviews/103.htm><img src=img_edi/194_D052C1.jpg alt=Dragons width=194 height=100 border=0></a></td><td colspan=2 rowspan=2 align=left><a href=interviews/103.htm>Dragons</a><br> Dragons is a major new band comprising, in the studio at least, of singer Anthony Tombling Jnr and drummer David Francolini. There&rsquo;s not many drummers that you always have to sit up and take notice of but David Francolini is one of those... <a href=interviews/101.htm><br><br> Ricky Gervais</a><br> "I don't know why people search for fame," continues Ricky, the bafflement evident in his voice. "For me, I know it's merely the upshot of what I do. I don't take coke, I don't hang around on the red carpet, I don't come out of China White with a slapper on my arm, and I don't phone the press to say, 'I've got a great story _ my cat's ill!' That sort of behaviour is embarrassing." <br><br> Other interviews include: <a href=interviews/093.htm>Martha Wainwright</a>, <a href=interviews/096.htm>Don Letts</a>, <a href=interviews/095.htm>Gravenhurst</a>,<a href=interviews/098.htm> Cold Cut</a>, <a href=interviews/092.htm>Simon Armitage</a>, <a href=interviews/091.htm>The Young Gods</a>,<a href=interviews/086.htm> Faithless</a>, <a href=interviews/088.htm>Plantlife</a>, <a href=interviews/084.htm>Erol Alkan</a>, <a href=interviews/087.htm>Duke Special</a>, <a href=interviews/083.htm>Moby</a>, <a href=interviews/081.htm>Nithin Sawhney</a>, <a href=interviews/082.htm>Thee Unstrung</a> and <a href=interviews/index.html>many many more.. </a><br></td></tr><tr align=center valign=top class=main><td><a href=interviews/101.htm><img src=img_edi/194_G035C1.jpg alt="Ricky Gervais" width=194 height=100 border=0></a></td></tr></table></td><td width=152 align=right valign=top class=verticalline><table width=150 border=0 cellspacing=0 cellpadding=0><tr><td><a href=competitions/index.html><img src=img_nav/comphdwin.gif alt="go to competitions" width=66 height=17 hspace=0 border=0 class=advert></a></td></tr><tr><td><a href=javascript:jump2url() onmouseover="displayStatusMsg();return document.returnValue"><img src=img_nav/win1.jpg name=bannerADrotator style="filter:revealTrans(duration=2,transitio