.<br>Active Solutions are a specialist Fujitsu-Siemens reseller and Microsoft Certified Partner&nbsp;who can&nbsp;handle all your networking needs. We offer a one stop solution, so if you're thinking of moving to Windows Server 2003 or just need desktop computer&nbsp; give us a call. We sell Primergy Servers, Scenic Desktop PCs, Lifebook notebooks and the Pocket Loox series of PDAs.<br>Fujitsu-Siemens are the leading European IT company, offering&nbsp; quality, reliability and endurance of their IT products and services. Serving the needs of large corporations, small and medium enterprises and private users. With a portfolio of exceptional depth, extending from handhelds through desktops to enterprise-class infrastructure solutions.Active Solutions along with Fujitsu-Seimens and Microsoft&nbsp;aim to deliver lasting value to their customers.</font></span><!--@md20050810 added div below<p align="right">--><div align=right><table id=_ctl0__ctl2__ctl0_Sorter><tr><td><select name=_ctl0:_ctl2:_ctl0:Sorter_sc onchange="javascript:__doPostBack('_ctl0$_ctl2$_ctl0$Sorter','')"><option value=Default selected=selected>Default Order</option><option value="Date Created">Date Added</option><option value=Title>Product Title</option><option value=ViewCount>Popularity</option></select></td><td><select name=_ctl0:_ctl2:_ctl0:Sorter_so onchange="javascript:__doPostBack('_ctl0$_ctl2$_ctl0$Sorter','')"><option value=desc selected=selected>Descending</option><option value=asc>Ascending</option></select></td></tr></table></div><table id=_ctl0__ctl2__ctl0_ContentList cellpadding=0 cellspacing=0 border=0 width=100%><tr><td><table width=100% cellspacing=3 border=0 cellpadding=4 class=ListTable><tr><td class=ListItem><span class=ListTitle>Fujitsu Siemens Amilo Series Laptop</span></td></tr><tr><td class=ListItem2><table width=100% cellspacing=0 cellpadding=2 border=0><tr align=left><td><a class=itemImageLink href=/337.aspx target title><img src="333.jpeg?Width=125" align=middle border=0 class