ancies" width=192 height=99 border=0></a></td></tr></table></div><div class=style16 id=Layer10><p align=justify class=style17><strong><span class=style18>Company Net</span><span class=style19> Experts in Microsoft</span></strong><br><br> Welcome to Company Net. We are a leading internet application development company with a customer list that includes some of the UK's top organisations and brands such as Coca-Cola Enterprises, Grampian Country Food Group, Scottish Enterprise and The Miller Group.</p><p align=justify class=style17>Since our <span lang=en-gb xml:lang=en-gb>foundation</span> in 1996 we have worked on high profile projects around the UK and have delivered global solutions to customers in the US and Europe. Our customer list covers many sectors ranging from well recognised brands to dynamic and innovative medium sized enterprises.</p></div><div id=Layer11><div align=right><img src=images/master-header3.gif width=595 height=201></div></div><div id=Layer12><img src=images/master-image3.jpg width=192 height=224></div><div id=Layer15><img src=images/mini-welcome-pack.gif width=192 height=220 border=0></div><div class=style13 id=Layer18>&copy; Company Net Ltd 2006, all rights reserved. <br> Company Net Ltd : Research Park North : Riccarton : Edinburgh : EH14 4AP : Scotland : UK </div><div id=Layer20><table width=577 border=0 align=right cellpadding=4 cellspacing=2><tr><td width=59>&nbsp;</td><td width=48>&nbsp;</td><td width=77>&nbsp;</td><td width=214><div align=center><span class=style11><a href=newsletter.aspx>Sign up for our newsletter</a></span></div></td><td width=127><div align=left><span class=Side_Nav_Txt><a href=events.aspx>Company Net Events</a></span></div></td></tr></table></div><div id=Layer27><script type=text/javascript src=js/swfobject.js></script><div id=casestudies><strong>Please upgrade your Flash Player.</strong><p>This interactive area of the website requires the Adobe Flash player to run.<br>You also need Javascript enabled.</p></div><