</script><div class=container><div id=topbar><img src=/images/logo.gif alt="Construction marketing logo" class=logo></div><div class=bar><ul id=nav><li><a href=/ >Home</a></li><li><a href=/about-us/ >About Us</a></li><li class=drop><a href=/construction-marketing/ >Construction Marketing</a><ul><li><a href=/construction-marketing/reaching-clients/ >Reaching Clients</a></li><li><a href=/construction-marketing/industry-events/ >Industry Events</a></li><li><a href=/construction-marketing/members-articles/ >Members Articles</a></li><li><a href=/construction-marketing/case-studies/ >Case Studies</a></li><li><a href=/construction-marketing/links/ >Links</a></li></ul></li><!--<li><a href="/join-cmg/">Join CMG</a></li>--><li id=last><a href=/contact-us/ >Contact Us</a></li></ul></div><table class=container1><tr><td class=left><ul id=nav1><li><div class=holder><a href=/full-service/ >Full Service</a></div></li><li><div class=holder><a href=/graphic-design/ >Graphic Design</a></div></li><li><div class=holder><a href=/web-design/ >Web Design</a></div></li><li><div class=holder><a href=/internet-marketing/ >Internet Marketing</a></div></li><li><div class=holder><a href=/pr/ >PR</a></div></li><li><div class=holder><a href=/events-and-exhibitions/ >Events &amp; Exhibitions</a></div></li><li><div class=holder><a href=/telemarketing/ >Telemarketing</a></div></li><li><div class=holder><a href=/sales-training/ >Sales Training</a></div></li><li><div class=holder><a href=/promotional-gifts/ >Promotional Gifts</a></div></li><li><div class=holder><a href=/corporate-hospitality/ >Corporate Hospitality</a></div></li><li><div class=holder><a href=/onsite-sales/ >Onsite Sales</a></div></li><li><div class=holder><a href=/direct-mail/ >Direct Mail</a></div></li><li><div class=holder><a href=/list-purchase/ >List Purchase</a></div></li><li><div class=holder><a href=/sales-leads/ >Sales Leads</a></div></li><!--<li><div class="holder"><a href="/specialist-marketing-needs/">Specialist Marketing Needs</a></div></li>--><li><div class=holder><a href=/marketing-consultancy/ >Marketing Consultancy</a></div></li><li><div class=holder><a href=/market-research/ >Market Research</a></div></li><li><div class=holder>&nbsp;</div></li></ul> </td><td class=right></div> <h1>Make Contacts, Win Contracts</h1><p>In the increasingly competitive construction industry, you need to make the most of your marketing budget. We can help by putting you in touch with a wide range of sales and marketing professionals.</p><p>It's easy:</p><p><img src=/images/cmgbullet.gif alt align=absmiddle> Select a marketing discipline on the left<br><img src=/images/cmgbullet.gif alt align=absmiddle> Make an enquiry to receive up to 5 quotes<br></p><p>See how our members can help you make contacts and win contracts!</p><div style="height: 4px;"></div><h3>How do you find your clients? How will clients find you?</h3><table class=boxhome><tr><td class=tl width=11><img src=/images/blank.gif alt></td><td width=47%>&nbsp;</td><td class=tr width=11><img src=/images/blank.gif alt></td><td width=11 style="background: #FFF">&nbsp;</td><td class=tl width=11><img src=/images/blank.gif alt></td><td width=47%>&nbsp;</td><td class=tr width=11><img src=/images/blank.gif alt></td></tr><tr><td width=11></td><td class=title><img src=/images/phone.gif alt=Phone></td><td width=11></td><td width=11 style="background: #FFF"></td><td width=11></td><td class=title><img src=/images/post.gif alt=Post></td><td width=11></td></tr><tr><td width=11></td><td><p>Cold calling isn&rsquo;t everyone&rsquo;s idea of fun. Do you need a professional to do it for you? Or to train your staff?</p></td><td width=11></td><td width=11 style="background: #FFF"></td><td width=11></td><td><p>A professionally written sales letter will grab the reader&rsquo;s attention and persuade them that you are worth talking to further.</p></td><td width=11></td></tr><tr><td width=11></td><td class=more align=right><a href=/construction-marketing/reaching-client