h=11></td></tr><tr><td class=bl width=11><img src=/images/blank.gif alt></td><td>&nbsp;</td><td class=br width=11><img src=/images/blank.gif alt></td><td width=11 style="background: #FFF">&nbsp;</td><td class=bl width=11><img src=/images/blank.gif alt></td><td>&nbsp;</td><td class=br width=11><img src=/images/blank.gif alt></td></tr></table><table class=boxhome><tr><td class=tl width=11><img src=/images/blank.gif alt></td><td width=96%>&nbsp;</td><td class=tr width=11><img src=/images/blank.gif alt></td></tr><tr><td width=11></td><td class=title><img src=/images/trademagazines.gif alt="Trade Magazines/Journals"></td><td width=11></td></tr><tr><td width=11></td><td><p>Do your ads catch the eye?&nbsp; Do they accurately communicate the nature of your business?</p></td><td width=11></td></tr><tr><td width=11></td><td class=more align=right><a href=/construction-marketing/reaching-clients/trade-magazines/ >Click here to find out more >></td><td width=11></td></tr><tr><td class=bl width=11><img src=/images/blank.gif alt></td><td>&nbsp;</td><td class=br width=11><img src=/images/blank.gif alt></td></tr></table><table class=boxhome><tr><td class=tl width=11><img src=/images/blank.gif alt></td><td width=96%>&nbsp;</td><td class=tr width=11><img src=/images/blank.gif alt></td></tr><tr><td width=11></td><td class=title><img src=/images/marketing.gif alt="Marketing Strategy"></td><td width=11></td></tr><tr><td width=11></td><td><p>Do you have a solid marketing plan? You can save money by making the most of your investment.</p></td><td width=11></td></tr><tr><td width=11></td><td class=more align=right><a href=/construction-marketing/reaching-clients/marketing-strategy/ >Click here to find out more >></td><td width=11></td></tr><tr><td class=bl width=11><img src=/images/blank.gif alt></td><td>&nbsp;</td><td class=br width=11><img src=/images/blank.gif alt></td></tr></table><table class=boxhome><tr><td class=tl width=11><img src=/images/blank.gif alt></td><td width=96%>&nbsp;</t