--></style><meta name=language content=English><meta name=description content="The Garvin Honey Company specialises in selling this completely natural, unadulterated food direct
 to the consumer"><meta name=keywords content="honey, garvin, oxford, mail order, healthy, natural"></head><body><div id=container class=container><div id=header class=topbox><noscript><p><a class=mm_no_js_link href=menumachine/garvins1/navigation.html>Site Navigation</a></p></noscript><script type=text/javascript><!--
var mmfolder=/*URL*/"menumachine/",zidx=1000;
//--></script><script type=text/javascript src=menumachine/menumachine2.js></script><script type=text/javascript src=menumachine/garvins1/menuspecs.js></script></div><div id=middle class=midbox><h1>The Garvin Honey Company</h1><p><img class=imageL src=images/beekeeping.jpg alt="Delicious, high quality honey in jars and tubs" height=300 width=205></p><p class=specialtext><br> Honey has been around for thousands of years.</p><p><br> It is one of the few completely natural, unadulterated foods available to the consumer. It is a healthy, energy-giving, natural food and there are as many flavours as there are flowers. </p><p><br> The Garvin Honey Company has been selling honey direct to the consumer for over forty years and continues to offer a wide range of delicious, good quality honeys in jars and large tubs delivered direct to your door. </p><p><br> If you like honey and consume a lot have a look at the description of the various types then choose one to suit your taste and order from a range of sizes in glass jars or plastic tubs. It will be delivered to you usually within days or, if you wish, we can send it as a gift to a friend.<br><br> A Price List and Order form are available to download at the bottom of the ‘About Garvins‘ page. Print it off and send in or call us on the phone.<br><br><br></p></div><div id=footer class=botbox><a title="The Garvin Honey Company Homepage" href=index.html>Home</a> l <a title="Garvin Honey Company History" href=who.html>About Garvins</a> l <a title="Types of Honey" href=what.html>Honey Types</a> l Online Shop l <a title="Enquire About Honey Supplies" href=comments.html>Contact Us</a> l Links<br> The Garvin Honey Company, Orchard Mill, 2 Coach Way, Benson, Oxford. OX10 6SU<br> Telephone: 01491 838581   Mobile: 07968 184212</div><a class=vis title="visualeze design, london se10" href=http://www.visualeze.net><span class=vis>website designed by visualeze, london</span></a></div></body>",nonspam

