class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Home</h2><div class=txt><p><strong> The Wilbury School of Natural Therapy</strong></p><p><img src=UserFiles/Image/massage1.jpg alt=massage1.jpg width=280 height=210 align=right>Since its foundation in 1982, with the aim of providing a high standard of tuition at reasonable fees, the Wilbury School has grown from strength to strength. </p><p> Our courses are all part-time, professional courses and allow students to progress at their own pace, with plenty of friendly help and support. </p><p> All tutors are fully qualified and maintain the school&#39;s standard of excellence. Course content and qualifying standards comply with the relevant examining bodies/associations. </p><p><strong> We Care</strong></p><p> The Wilbury School has developed an outstanding reputation for thorough training in a friendly and caring environment. Our principal concern is not solely exam results, but also to encourage and support our students on a journey of self discovery. </p><p> An important part of the Wilbury School training is our on-going programme of lectures, workshops and talks for students. These range from advice on insurance, licensing and accounting, professionalism, ethics and client skills, to areas of personal development and self-care, and are designed to complement the basic tuition and support students in their preparation for setting up a practice. They are generally given by outside lecturers with specialist areas of expertise and are repeated regularly. </p><p><strong> Further Information</strong></p><p> The minimum course period is six months and students should be residents of the UK. </p><p> We do not offer correspondence courses and if you are outside the UK please do not request course material unless you are considering a long stay visit to England. </p><p> You will find all the relevant information on our courses contained in this site. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

