class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Injury Prevention Massage</h2><div class=txt><strong>Injury Prevention (&#39;No Hands&#39;) Massage (IGPP)</strong><br><em>with Kitty Fletcher, LT Phys, MIGPP, BTHA, CTHA, THLA</em><br><div align=right> | <a href=#dates>Course Dates</a> | </div><p><img src=UserFiles/Image//InjuryPrevention2.jpg alt=InjuryPrevention2.jpg width=210 height=295 align=right> Two-day highly practical course for massage practitioners that addresses the issue of hand, wrist and arm injuries resulting from therapists&#39; use of their hands as their main working tool. </p><p> &bull; Also addresses the risks of back strain and injury associated with improper posture from working in either traditional ways or through uneducated attempts to work without the use of hands. </p><p> &bull; This advanced massage training encompasses the best and most important aspects of several massage disciplines, such as Tai-Chi, Lomi Lomi, Yoga and western massage disciplines. </p><p> &bull; Increases energy and focus, helping maintain a longer career and happier clients. </p><p> An essential course for anyone qualified in massage and highly recommended to prevent repetitive strain injury. </p><p> Course fee: &pound;170 </p><p> Pre-requisites: Applicants must be qualified in Massage. </p><p class=Sub_Title><br><a name=dates title=dates></a> Course Dates </p><p> 2007 dates </p><p> April 25, 26 (Weds/Thurs) </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

