class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Aromatherapy</h2><div class=txt><strong>Holistic Aromatherapy Diploma Course (ITEC)</strong><br><em>with Kitty Fletcher, LT Phys, MIGPP, BTHA, CTHA, THLA</em><br><div align=right> | <a href=#intro>Introduction</a> | <a href=#dates>Course Dates</a> |<br></div><p><img src=UserFiles/Image/aromatherapy1.jpg alt=aromatherapy1.jpg width=210 height=318 align=right> This enjoyable and fascinating course creates a new dimension for all massage practitioners, with an in-depth study of 40 essential oils, their usage and therapeutic application. </p><p> &bull; Held once a year over 11 days (usually two days once a month). </p><p> &bull; Provides sound knowledge of Aromatherapy on all levels </p><p> &bull; Teaches the science of oil blending, methods of extraction, properties, physiological and psychological effects of essential oils on all systems of the body, plus of course aromatherapy massage on body, face and scalp (40 case studies required). </p><p> &bull; Also covers use, selection, care and storage of oils and ancillary products - such as creams, milks, masque scrubs; essential oil application through compresses, baths, vaporisers and inhalers; anatomy and physiology in relation to essential oils (e.g. the olfactory tract, skin); different skin types; integral biology (how the body responds to the environment); client care, contra-indications, case-histories and record-keeping. </p><p><strong>Course fee:</strong> &pound;880 (Registration fee &pound;200) </p><p><strong>Exam fee:</strong> &pound;80 </p><p><strong>Pre-requisites:</strong> Applicants must also be qualified in holistic massage. It is possible to do the massage course alongside the aromatherapy course - please click on &#39;Holistic Massage&#39; for details.<br><br></p><p class=Sub_Title><a name=intro title=intro></a>Introduction </p><p> Massage using selective essential oils can be profound and long-lasting, intensifying the effects of body massage.<br> The attractive perfumes of essential oils have a measurable influence on the brain and are capable of adjusting a person&#39;s mood - those with a sedative effect, for example, are sandalwood and marjoram; stimulating effects can be achieved with orange blossom and Ylang Ylang, while others have anti-bacterial properties. These highly concentrated oils, which are exracted from plants by various methods, have to be blended in a base oil to be used for massage. The aromatherapist&#39;s skill is in selecting the most appropriate oils and blending them to give maximum benefit to their client.<br><br></p><p class=Sub_Title><a name=dates title=dates></a>Course Dates </p><p> 2007 dates - The course takes place over the following weekends: </p><p> June 2/3<br> July 14/15;<br> August 11/12<br> September 15/16<br> October 13/14. Pct 27. </p><p><br><br></p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

