class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Links</h2><div class=txt><p><a href=http://www.bay-house.co.uk/ target=_blank>Bay House Aromatics</a> <br> One of the most comprehensive suppliers of aromatherapy products on the Internet. </p><p><a href=http://www.embodyforyou.com/ target=_blank>Embody</a> - International Guild of Professional Practioners<br> An on-line directory of Complementary Health and Beauty Salons, Clinics, Spas, Health Centres and Individual Therapists in the UK and Ireland. The UK&#39;s largest multidisciplinary Association for Professional Therapists. </p><p><a href=http://www.dykeroadclinic.co.uk/ target=_blank>Dyke Road Clinic</a> <br> The Dyke Road Natural Health Clinic has a complementary health team with vast knowledge and expertise. Many of the practitioners are expert in paediatric as well as adult healthcare. </p><p><a href=http://www.itecworld.co.uk/ target=_blank>International Therapy Examination Council (ITEC)</a> <br> The international examination board which offers a variety of qualifications worldwide with qualifications covering: Beauty Therapy, Complementary Therapy and Sports Therapy. </p><p><a href=http://www.thaimassageuk.com/ target=_blank>Sussex Thai Massage School</a> <br> Traditional Thai Massage to increases vitality, flexibility &amp; tranquillity. A combination of massage, acupressure &amp; applied yoga. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>