class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Short Courses</h2><div class=txt><p><span class=Sub_Title>More short courses to come in the second half of 2007.</span></p><p> If you would like more details of any of these courses, or wish to book, please contact the Wilbury school: 01273 552766. </p><hr><p><strong> Wed, Thurs April 25, 26, 9.30am - 5.30pm.</strong> &pound;170<br><span class=Title> LOOK - NO HANDS! INJURY PREVENTION MASSAGE</span><br><em> Kitty Fletcher, LT Phys, MIGPP, BTHA.</em></p><p> Learn a fabulous new massage technique combining the best from East and West that will: protect your wrists and back from repetitive strain injury; increase your range of massage techniques; strengthen your legs and give you a workout while you massage your clients. This course will earn you 10 CPD points. Adapted from the very best aspects of T&sup1;ai-chi, Lomi Lomi, Yoga and Western massage disciplines.(For qualified massage practitioners)<br><br></p><hr><p><strong> Friday, June 1, 9.30 - 5.30.</strong> &pound;60.<br><span class=Title> Freeing the Body </span><span class=Title>2.THE EMOTIONAL LINK</span><br><em> Deryn Bell. B Sc, DO, ND, PGCE</em><br></p><p> This one-day course uses massage and stretching techniques to improve mental and physical well-being. We will see that everything in the body - including muscles, ligaments and connective tissue is inter-connected with mind and emotions. In particular, there is an important link between the membranes covering the brain (meninges) with the thoracic diaphragm and with the pelvic diaphragm. Lack of free-flowing movement in the body may result in inability to absorb nutrients and to dispel toxins. Be prepared to learn some enlightening facts.(For qualified massage practitioners)<br><br></p><hr><p><strong> Thursday June 28, 9.30 am - 5.30pm.</strong> &pound;60<br><span class=Title> MASSAGE FOR CLIENTS WITH CANCER</span><br><em> Mary Atkinson, BA (Hons), PGCE, ITEC.</em></p><p> Increasingly, people with cancer are realising the benefits of receiving regular massage to aid relaxation and help cope with the physical and emotional demands of the illness. This day course has been designed by Mary Atkinson, a complementary therapist working with people with cancer, and is intended for qualified (or near-qualified) massage therapists with an interest in providing massage for people with cancer. This has proved to be a great day for all massage therapists.<br><br></p><hr></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

