class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Indian Head Massage</h2><div class=txt><strong> Indian Head Massage (IGPP)</strong><br><em>with Geraldine Davies, IGPP, RMANM, LCC</em><br><div align=right> | <a href=#dates>Course Dates</a> | </div><p><img src=UserFiles/Image/HeadMassage02.jpg alt=HeadMassage02.jpg width=210 height=261 align=right> This wonderfully relaxing technique can be used to treat clients in a chair and focuses on head, neck, upper back and shoulders - areas vulnerable to stress and tension. </p><p> &bull; Short post-grad course, incorporating various massage strokes and acupressure points. </p><p> &bull; Incorporates A&amp;P revision of upper body, the mechanics and effects of stress, relaxation techniques and work on chakra (energy points) balancing. </p><p> Course fee: &pound;280 (includes exam fee) </p><p> Pre-requisites: Applicants must be qualified in some form of bodywork that has included Anatomy &amp; Physiology. </p><p class=Sub_Title><br><a name=dates title=dates></a>Course Dates </p><p> 2007 dates </p><p> March 6, 7, 8, (Tues, Wed, Thurs) </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

