/dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Holistic Massage</h2><div class=txt><p><strong> Holistic Massage Diploma Course (ITEC)</strong><br><em> with Vicki Bryceson, MCGP, LT Phys</em></p><p><img src=UserFiles/Image/massagePortrait1.jpg alt=massagePortrait1.jpg width=210 height=280 align=right>&bull; Popular, part-time modular course, held five times a year. Includes practical tuition, lectures and practice sessions. One of the most flexible courses around, in terms of tuition hours and payment. Starting point for the most other courses.<br></p><p> &bull; Holistic Massage begins with six intensive, full days, followed by weekly Thursday evening practice sessions and monthly Wednesday evening lectures, plus home-study, home practice and case studies.<br></p><p> &bull; Includes tuition in Anatomy &amp; Physiology, Professionalism, Business Studies, Client Care, Ethics and all aspects relevant to becoming a Practitioner.<br></p><p> &bull; Completion: at least eight months (usually 10-12 months).<br></p><p> &bull; When qualified: full insurance to practice at home or in a Clinic or Centre anywhere in the UK and in many countries abroad. </p><p> Pre-requisites: none. </p></div><div class=clear>&nbsp;</div><!--<div id="subList"><div class="l" id="s1">
