me=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Sports Massage</h2><div class=txt><p><strong>Sports Massage Diploma Course (ITEC)</strong><br><em> Jo Scrimshaw, RPP, ThLA, Raworth Dip</em></p><p><span class=Sub_Title><img src=UserFiles/Image/sportsmassage.jpg alt=sportsmassage.jpg width=210 height=318 align=right> Why do this course?</span></p><p> Sports Massage Therapy is a form of massage involving the manipulation of soft tissue to correct problems and imbalances, enhance performance and aid recovery from injury. </p><p> This unique Sports Massage course provides massage therapists with skills for treating common injuries - particularly clients in sports and athletics - in a relatively short time. The course is enjoyable and rewarding, both in terms of effectiveness and increasing client base. </p><p> The course is fully accredited by ITEC and is open to anyone qualified in massage, anatomy &amp; physiology to ITEC level (eg NVQ Level III) who has been in practice for at least six months. Exams leading to the Diploma in Sports Massage are held at the school three times a year. </p><p> The course has 3 elements - theory, practical and case studies (five clients, three treatments each) and is split into 5 weekends and 1 Patients/Review day. </p><p> &nbsp; </p><p><span class=Sub_Title> Skills you will learn</span></p><p> &bull; Functional Assessment </p><p> &bull; Stretching techniques </p><p> &bull; PNF - Proprioceptive Neuromuscular Facilitation </p><p> &bull; Soft tissue release techniques </p><p> &bull; Muscle energy techniques </p><p> &bull; Trigger Point Therapy </p><p> &bull; Myofascial release (connective tissue manipulation) </p></div><div class=clear>&nbsp;</div><!--<div id="subList"><div class="l" id="s1">
