class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>ITEC</h2><div class=txt><p><strong><img src=UserFiles/Image/ITEClogo.gif alt=ITEClogo.gif width=96 height=106 align=right> International Therapy Examination Council (ITEC)</strong><br> is an examining body in physical therapies, founded in 1943 and operating internationally. </p><p> Its qualifications are recognised by employers and licensing authorities in the U.K. and many other countries. </p><p> Students awarded an ITEC Diploma are able to join Embody, membership of which provides the necessary insurance cover. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

