class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Talks & Workshops</h2><div class=txt><p> An important part of the Wilbury School training is our on-going programme of lectures, workshops and talks for students, and these are open to all body workers </p><p> Subjects range from other complementary therapies such as cranial osteopathy to areas of personal development and self-care. </p><p> They are designed to support students in their preparation for setting up a practice and are given by outside lecturers with specialist areas of expertise. </p><p> Subjects are usually changed every six months </p><p align=right> | <a href=#april>April</a> | <a href=#may>May</a> | <a href=#june>June</a> | </p><p><a name=april title=april></a><span class=Sub_Title>APRIL</span></p><hr><p><strong> Wednesday, April 11, 7 - 9pm.</strong> &pound;8.<br><span class=Title> AYURVEDA NUTRITION FOR HEALTH OF BODY, MIND &amp; EMOTIONS</span> <br><em> Rebecca Kriese, BA (Hons), Ayu, MAPA</em></p><p> The Ayurvedic core subjects of food and nutrition are based on universal principles that are both ancient and profound, yet also practical and applicable today. This lecture will provide an introduction to these Ayurvedic principles so that you can apply them beneficially in your own practice and support clients to create powerful transformation in their health and well being. Rebecca Kriese trained as an Ayurvedic practitioner both in the UK and in India, and practices with her husband, Sascha, in Brighton. </p><p><br><strong>Three Friday evenings, April 20th, May 4 and May 11, 6 - 7pm.</strong> &pound;18 for three sessions.<br><span class=Title> CHI GUNG MINI SERIES FOR MASSAGE STUDENTS</span><br><strong> Simon Robins</strong></p><p> In these sessions, each student will enjoy an in-depth correction of posture to relieve body and mind of unwanted patterns. This will be an introduction to chi gung to maintain your reserves of energy and health as well as learning how to apply these techniques in your practice. </p><p><br><strong>Saturday, April 21, 9.30am - 4.30pm</strong><br><span class=Title> NEW! WILBURY SCHOOL OPEN DAY</span><br><em> Various tutors</em></p><p> Come along with a friend and visit the school, meet the tutors and sample some of the therapies we teach here: Holistic Massage, Sports Massage, Reflexology, Aromatherapy, Deep Tissue Massage, Indian Head Massage and Thai Massage. Informative, fun and FREE.<br> (If any Wilbury students would like to take part in demo&#39;s, please contact the office NOW) </p><p><strong><br> Sunday, April 22, 9.30am - 5pm.</strong> &pound;65<br><span class=Title> EMERGENCY FIRST AID COURSE</span><br> for practitioners.<br><em> Jo Scrimshaw, MIGPP, Dip PT, ITEC Tutor</em></p><p> This one day course, tailored for therapists, covers all aspects of emergency First Aid, including resuscitation, in line with the ITEC syllabus. Essential for all bodyworkers (Repeated 4 times yearly) </p><p><strong><br> Tuesday, April 24, 7 - 9pm.</strong><br> &pound;10 to Wilbury students. &pound;15 to others.<br><span class=Title> NEW: &lsquo;LAST TUESDAY&#39; ADVANCED MASSAGE SERIES</span><br><em> Meghan Mari and Rachel Fairweather</em>.<br><span class=Title> 4. Treating Frozen Shoulder and other shoulder injuries</span></p><p> This workshop will give you an understanding of how this difficult condition can be addressed through a range of dynamic advanced<br> massage techniques.<br><br></p><p><a name=may title=may></a><span class=Sub_Title>MAY</span></p><hr><p><strong>Wednesday, May 9, 7 - 9pm.</strong> &pound;10<br><span class=Title> AROMATHERAPY INTRODUCTORY WORKSHOP</span> <br><em> Kitty Fletcher, LT Phys, MIGPP, BTHA.</em></p><p> Aromatherapy oils add a new dimension to<br> massage. Try for yourself some basic oils and learn a little about their properties and uses with an experienced tutor and practitioner. You will be able to make a blend to take home during this taster evening. NB Enrol on the Practitoner course this evening and earn a &pound;25 discount. </p><p><br><strong> Wednesday, May 23, 7 - 9pm.</strong> &pound;8.<br><span class=Title> ORTHO-BIONOMY - CORRECT LIFE STUDY</span><br><strong>CANCELLED</strong>. </p><p><strong><br> Tuesday, May 29, 7 - 9pm</strong><br> &pound;10 to Wilbury students. &pound;15 to others.<br><span class=Title> NEW: &lsquo;LAST TUESDAY&#39; ADVANCED MASSAGE SERIES</span><br><em> Meghan Mari and Rachel Fairweather.</em><br><span class=Title> 5) The fascination of fascia and myofascial release.</span></p><p> This lecture will explore the magical world of the body, a connective tissue network (fascia) that is believed to be a source of both physical and emotional pain. Understanding the role of fascia can give us new insights into common and complex conditions such as chronic back pain.<br><br></p><p class=Sub_Title><a name=june title=june></a> JUNE </p><hr><p><strong>Tuesday, June 26, 7 - 9pm.</strong><br> &pound;10 to Wilbury students. &pound;15 to other students.<span class=Title><br> 6)TRIGGER POINT THERAPY and other techniques for low back pain.</span></p><p> Lower back pain is the leading cause of disability and pain in the UK. This hands-on workshop will introduce you to treating chronic pain, including trigger point therapy, hydrotherapy and advanced stretching. </p><p><br><strong>Wednesday, June 27, 7 - 9pm.</strong> &pound;8 <br><span class=Title> POLARITY FOR NECK &amp; SHOULDER PAIN</span><br><em>Jo Scrimshaw, MIGPP, Dip PT, ITEC Tutor</em></p><p> Polarity is an energy-based holistic therapy. The treatments involve manipulation, working with the body&#39;s own energy flow and chakras, and exercises to promote healing. This evening workshop will show you the basic holds in Polarity and give you a chance to try out techniques to help relieve stress in neck and shoulders. </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

