class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Deep Tissue Massage</h2><div class=txt><strong>Deep Tissue Massage (IGPP)</strong><br><em>with Kitty Fletcher, LT Phys, MIGPP, BTHA, CTHA, THLA</em><br><div align=right> | <a href=#dates>Course Dates</a> | </div><p><img src=UserFiles/Image/massagePortrait4.jpg alt=massagePortrait4.jpg width=210 height=280 align=right> Unique massage that works on the physical, emotional and often spiritual levels. Designed to release pain from muscular tension and stress, relieve held-in tension and restore comfort and harmony to the whole being. </p><p> Comprises a range of techniques including acupressure massage, polarity and breath work using thumbs, fingers, knuckles and elbows. Work includes re-alignment of muscle fibres and fascia, working deep around scapula, hips and in the ribs. On a subtle level, the technique follows certain subtle energy channels (meridians), literally pushing out long-held trauma </p><p> &bull; Ideal post-grad course to add new techniques to range of skills without the trouble of exams. </p><p> &bull; Experienced tutor in a safe, supportive environment (therapists have stresses, too!) </p><p> &bull; Held over three full days, plus a follow-up day the following month. </p><p> &bull; Certificated </p><p> Course fee: &pound;280 for four days. (9:30 - 5:30) </p><p> Pre-requisites: Applicants must be trained in massage, anatomy &amp; physiology. </p><p> NB this course carries 20 CPD points if you are insured with Embody.<br><br></p><p class=Sub_Title><a name=dates title=dates></a>Course Dates </p><p> 2007 dates - Course Num: DTM-134 </p><p> May 15, 16, 17 (Tues, Weds, Thurs), and July 11 (Weds). </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

