class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>News</h2><div class=txt><p class=Title> OPEN DAY </p><hr><p> The Wilbury school is holding an Open Day on Saturday, April 21, where you can meet the tutors and sample some of the therapies taught there (free). </p><p> This will be a great introduction to anyone, no matter what their age or occupation, who is thinking of changing to something more fulfilling and holistic. </p><p> &nbsp; </p><p><span class=Title>THE WILBURY SCHOOL IS 25</span></p><hr><p> The Wilbury school of Natural Therapy is celebrating its 25th Anniversary this year. </p><p> From humble beginnings, in a room at the Wilbury Clinic, Hove, the school has trained hundreds of people in holistic massage, reflexology and other<br> therapies over the years. </p><p> The school attracts people who are looking for more fulfilling careers and want a good standard of tuition. </p><p> The Wilbury&#39;s professional training courses now include aromatherapy, sports massage and Thai massage diploma courses in addition to holistic massage and reflexology. Students, once qualified as practitioners, are offered ongoing support with a range of advanced training courses such as Deep Tissue Massage, Hot Stone Fusion and Indian Head Massage. </p><p> The Wilbury school also has a programme of evening lectures on complementary therapies and self-development, which is open to all. </p><p> Lindy Gillam, who has owned and run the school since 2000, says that the main reason for the school&#39;s success is that, although it has evolved and diversified since its early days, the core training - holistic massage - has retained its essence and purity. Pass rates in the practical exams are 100%. </p><p> &nbsp; </p><p><span class=Title>COURSES STARTING THIS MONTH:</span></p><hr><p><strong>Holistic Massage Diploma:</strong> April 14. Last chance to book! </p><p><strong>Reflexology Diploma:</strong> April 27. </p><p><strong>Injury Prevention (no-hands) Massage</strong> (for people qualified in massage): April 25, 26. </p><p class=Sub_Title> EVENING TALKS: </p><p><strong>Ayurveda:</strong> April 11 (7-9pm). </p><p><strong>Chi-Gung</strong> mini series starts Friday evening: April 20. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

