a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Anatomy & Physiology (ITEC)</h2><div class=txt><p><em>with Kitty Fletcher, LT Phys, MIGPP, BTHA, CTHA, THLA, Dip PT, ITEC</em></p><p><img src=UserFiles/Image//massagePortrait8.jpg alt=massagePortrait8.jpg width=210 height=280 align=right>A thorough understanding of the human body, how it works and what can go wrong with it is an essential requirement of all body workers. This fascinating subject is challenging, and very rewarding. </p><p> &bull; This is a flexible part-time course comprising of eight excellent monthly lectures (held on the first Wednesday evening of every month). </p><p> &bull; It includes a home-study project, and monthly assignments. </p><p> &bull; There are four Introductory A&amp;P Lectures per year when new applicants can join the course. </p><p> &bull; A&amp;P is an integral part of the Holistic Massage course. </p><p> &bull; A&amp;P can be taken in advance of, or in conjunction with, Reflexology, Thai Massage or Kinesiology. </p><ul></ul><p><strong>Course fee:</strong> &pound;390 (exams excluded) </p><p><strong>Exam Fee:</strong> &pound;60 </p><p><strong>Pre-requisites:</strong> none. </p></div><div class=clear>&nbsp;</div><!--<div id="subList"><div class="l" id="sL">
