class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>ITEC Unit 22</h2><div class=txt><p><strong>Professionalism &amp; Business Awareness (ITEC Unit 22)</strong></p><p><img src=UserFiles/Image//ITEClogo.gif alt=ITEClogo.gif width=96 height=106 align=right>&#39;ITEC Unit 22&#39; (Professionalism &amp; Business Awareness) is now compulsory for all bodyworkers undertaking an ITEC diploma in holistic therapy - e.g. Massage or Reflexology. Itis also very useful for all practitioners. </p><p> If you have not covered the syllabus on a previous course, to ITEC&#39;s satisfaction, you will be required to do so at the Wilbury School. If you think that you have completed sufficient study hours in the past, ITEC will require a copy of your previous course&#39;s syllabus and the relevant qualification - in which case, please send the information to the Wilbury School asap. </p><p> In order to cover the Unit 22 syllabus, the Wilbury School is supplying the following package: </p><p> &bull; Practice Management Day </p><p> &bull; Book &#39;Succeeding in Business&#39; </p><p> &bull; Mock exam </p><p> &bull; ITEC written exams (inc. invigilation, notes and administration) </p><p> Total Cost &pound;160.00 </p><p> Full payment is required in advance, please. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

