class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Advanced Reflexology</h2><div class=txt><strong>Advanced Reflexology</strong><br><em> Kristine Walker, BA, ATC, MAR</em><div align=right> | <a href=#tutor>Course Tutor</a> | <a href=#dates>Course Dates</a> |<br></div><p><img src=UserFiles/Image/reflexology2.jpg alt=reflexology2.jpg width=210 height=287 align=right> A three-day course for advanced students and qualified reflexologists. </p><p><span class=Sub_Title>Day 1 - Traditional and Modern Techniques</span><br> We will explore and experience some of today&#39;s most effective reflexology methods - Rwo Shr, VRT and trauma treatment and compare them with Dr. Fitzgerald&#39;s original Zone Therapy. We can also try various pressures and techniques on each other for effectiveness and comfort, and decide on what occasions these should be applied. </p><p><span class=Sub_Title> Day 2 - Hand Reflexology</span><br> In case you missed it the first time around we will revise a basic hand reflexology treatment and then move on to more advanced techniques to combine with foot reflexology. A diagnostic method will be learnt as well as very useful first aid for common ailments, pain relief and negative emotions such as fear and worry. </p><p><span class=Sub_Title> Day 3 - Facial Reflexology and the Special Senses</span><br> We will first of all work the 10 zones through the occiput, then use the Dien&#39; Cham&#39; Vietnamese method of facial reflexology using finger pressure and cotton wool buds, followed by special treatment for the senses, paticularly the eyes and ear. </p><p> CPD points - 5 for each day<br> Kristine Walker/Wilbury School Advanced Certificate for 3 days attendance </p><p> These days can be booked individually. Please bring talc and foot cream.<br> Notes will be provided. </p><p> &nbsp; </p><p class=Sub_Title><a name=tutor title=tutor></a>Course Tutor </p><p> Kristine Walker, BA, ATC, MAR, trained at the Wilbury School in 1988, gaining Wilbury school and ITEC Reflexology Certificates. </p><p> After teaching there for 3 years she set up her own School of Reflexology and now teaches post-graduate reflexology students. </p><p> She lectures internationally on Hand and Head Reflexology and specialises in Gentle Birth Method and Eyesight Management Reflexology in Brighton. </p><p> Kristine was research co-ordinator for the Association of Reflexologists for 3 years, and an Honorary Member in 2003. </p><p> &nbsp; </p><p class=Sub_Title><a name=dates title=dates></a>Course dates </p><p> 2007 dates </p><p> March 10 &amp; 11, (Saturday/Sunday), plus March 31 (Saturday) </p><p> Time 10am to 4.30pm </p><p> Cost &pound;75 per day (&pound;200 for 3 days) </p><p> &nbsp; </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

