l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h2>Thai Massage</h2><div class=txt><p><strong>Thai Massage Practitioner Course (IGPP)</strong><br><em> Christine Townley ITEC, MIFR, IEB, ITM</em></p><p><img src=UserFiles/Image//ThaiMassage1.jpg alt=ThaiMassage1.jpg width=210 height=280 align=right> Traditional Thai massage is a unique form of bodywork dating back to ancient times over 2,500 years ago. It was originally practised in temples in Thailand by Buddhist monks as a means of invigorating the mind and body. </p><p> Thai massage also known as Thai Yoga Massage combines soothing massage techniques, thumb pressure similar to acupressure and applied yoga stretches. This dynamic and powerful therapeutic northern style Thai Massage is now becoming increasingly popular world-wide for relieving stress and stress related disorders. </p><p> Many benefits include gentle muscle stretching, increasing flexibility, deep relaxation, improving posture, joint mobility and energy levels. Thai massage has a vast array of techniques and practitioners work in a meditative state and use their hands, feet, legs, knees and elbows to free the tension held within the body. The client remains fully clothed. This massage is one of the most beneficial therapies for treating physical and psychological problems, maintaining health and well-being. </p></div><div class=clear>&nbsp;</div><!--<div id="subList"><div class="l" id="s1">
