l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_32">Reflexology</a></h3><h2>Introduction</h2><div class=txt><p><strong>What is Reflexology?</strong></p><p> Reflexology is a holistic treatment which involves pressing and massaging areas of the feet and hands which are said to correspond to various body systems and organs. The process of Reflexology is said to help relieve tensions, to bring about a state of &#39;energy balance&#39; and to create a feeling of relaxation and well-being, rather like a full body massage. </p><p> &nbsp; </p><p><strong> What type of course is the Wilbury school&#39;s Reflexology course?</strong></p><p> This is a part-time professional course, held over seven full days (usually one day a week, which may not be consecutive) leading to an ITEC Diploma. (Please see enclosed flyer for current dates). The venue is the school&#39;s light, spacious premises at the Dyke Road Clinic of Natural Medicine, Brighton. </p><p> The Wilbury school was established in 1982 and has an excellent reputation for thorough tuition, high standards, good student support and a high pass rate in the ITEC examinations - most students pass with Credit. </p><p> &nbsp; </p><p><strong> NB</strong> Six compulsory, supervised and guided practice sessions (2 - 3 hours per session) are included in the course fee. Times are arranged to meet students&#39; needs </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

