l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_32">Reflexology</a></h3><h2>Course Overview</h2><div class=txt><p><strong>Reflexology Course Overview:</strong></p><p> &nbsp; </p><p><strong> What form does tuition take?</strong></p><p> Instruction and demonstration by the course tutor, followed by students practising on one another (guided and supervised). </p><p> &nbsp; </p><p><strong> What else will be expected of me on the course?</strong></p><p> You will be required to study course notes, complete set homework, practise on &#39;willing bodies&#39; and complete a minimum of 40 case studies (ie 10 people treated 4 times each). These will be monitored by the course tutor and marked by an external examiner. </p><p> &nbsp; </p><p><strong> What examinations will I have to take to qualify as a Reflexologist?</strong></p><p> Examinations will comprise: </p><p> &bull;A Mock examination Multiple Choice paper. </p><p> &bull;A Wilbury assessment by the course tutor. </p><p> &bull;Written examinations (Multiple Choice). </p><p> &bull;A practical and verbal assessment by an external (ITEC) examiner. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

