l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_32">Reflexology</a></h3><h2>Syllabus Outline</h2><div class=txt><p><strong>Reflexology Syllabus</strong></p><p> &bull; Anatomy &amp; physiology: study (or revision*) of all body systems, including skeletal, muscular, respiratory, digestive, genito-urinary, neurological, endocrine, cardio-vascular, lymphatic, and the skin. Also, conditions and diseases associated with these systems (pathology). </p><p> NB * students who have not yet qualified in A&amp;P will be required to complete a part-time Diploma course at the Wilbury school, alongside the Reflexology course. </p><p> &bull; Detailed study of the structure of feet, ankles and lower legs, including bones, muscles, nerves, arteries and veins. In addition, detailed structure of hands, wrists and forearms. </p><p> &bull; Disorders and conditions of the feet, hands and nails. How to &#39;read&#39; feet. </p><p> &bull; Various reflexology techniques. </p><p> &bull; The &#39;hows&#39; , &#39;whys&#39; and the history of reflexology. </p><p> &bull; Client care and possible reactions to treatment, contra-indications, when and how to refer clients. Advice on lifestyle and other complementary therapies. Listening skills. </p><p> &bull; The effects of stress and other environmental factors on the body and mind. </p><p> &bull; &#39;Core&#39; ITEC subjects, such as professionalism, ethics, first aid, hygiene and safety, business studies and laws affecting practitioners. </p><p> (If you are already qualified in Holistic Massage, you will not have to repeat this module). </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

