l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_32">Reflexology</a></h3><h2>Fees & Dates</h2><div class=txt><p class=Sub_Title> Fees &amp; Registration </p><p> &pound;590 plus any recommended books. </p><p> ITEC exam fees are &pound;80 extra. </p><p> The course registration fee is &pound;100, followed by a final payment of &pound;490 by the start date. The six compulsory practice sessions (supervised and guided) are included in the price, and dates are arranged during the course. </p><p> Please feel free to email us for more details. </p><p> &nbsp; </p><p class=Sub_Title> Course Dates </p><p><strong> 2007 - Course Num Rfx-133:</strong></p><p> Eight Fridays:<br> April 27;<br> May 4, 11, 25;<br> June 8, 29;<br> July 13, 27. </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

