/dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_27">Holistic Massage</a></h3><h2>Introduction</h2><div class=txt><p><img src=UserFiles/Image//massagePortrait2.jpg alt=massagePortrait2.jpg width=210 height=280 align=right>The Holistic Massage course is a professional, part-time course, held five times a year, and forms the starting point for most other Wilbury school courses. It includes practical tuition, lectures and practice sessions and is one of the most flexible courses around. </p><p> The course is split into three stages, each of approximately three months duration. </p><p> Stage 1 begins with six full days practical tuition, followed by five Thursday evening guided practice sessions and 2-3 Wednesday evening Anatomy &amp; Physiology lectures, plus a First Aid course. </p><p> Stage 2 comprises three days Advanced Tuition plus more practice sessions and lectures - including the remaining 5-6 Wednesday evening Anatomy &amp; Physiology lectures - and a Practice Management day. 20 Case Studies must be completed by the exam date. </p><p> Stage 3 is the exam module, comprising a residential revision weekend, evening revision sessions plus mock and final exams (both practical and multiple choice). NB Some home-study and practice is required during the course. Reference notes are given at the end of every session. p&gt; </p><p> Continuous practical assessment and friendly support is offered by the tutor and her assistant tutors. Groups are no larger than 14. The course is open to men and women of all ages and from all walks of life. No previous experience or qualifications are required. Once qualified as a Massage Practitioner, you will be able able to set up your own practice at home or to join a clinic or health centre - and begin a new way of life. </p><p> Our venue is the Dyke Road Natural Health Clinic, where there is a friendly, relaxed and holistic atmosphere. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

