/dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_27">Holistic Massage</a></h3><h2>Registration & Dates</h2><div class=txt>A Registration fee of &pound;200 is required to reserve a place. The balance of Stage I should be paid before the start date, but arrangements can be made in advance, to pay by instalments (see Fees and Payments). <p> We prefer to meet students before enrolling. Please phone for an appointment. </p><p> If you have any queries or require any other information, or if you would like to receive a demonstration massage (&pound;25) please phone Brighton (01273) 552766 </p><p><span class=Sub_Title>Course Dates</span><br><strong> Spring/Summer 2007</strong></p><p> These dates are for the starting, practical tuition modules only. </p><p> &bull; 128 Stage 1: February 10, 11, 13, 14, 15 &amp; 24<br> &bull; 128 Stage 2: May 18, 19, 20 </p><p> &bull; 131 Stage 1: April 14, 15, 17, 18, 19 &amp; 28<br> &bull; 131 Stage 2: July 20, 21, 22 </p><p> &bull; 136 Stage 1: June 9, 10, 12, 13, 14 &amp; 23<br> &bull; 136 Stage 2: September 28, 29, 30 </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

