/dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_27">Holistic Massage</a></h3><h2>Fees & Payment</h2><div class=txt><p><strong>Payment</strong><br> The courses at the Wilbury school are very competitively priced, and include the cost of all modules of the course right up, and including to the exams. </p><p> The Holistic Massage course is divided into three stages, with each stage priced seperately and payable in advance of starting. However we make every effort to assist students in their payments and the terms can be arranged to spread the costs by Standing Order over 9 months. </p><p><strong>Course fee:</strong> &pound;1,450 payable in 3 stages (Registration fee &pound;200). </p><p> All modules are compulsory unless a relevant prior-learning qualification has been attained. If a student chooses not to attend any element they are still liable for the full balance by the end of their course. </p><table border=0 cellspacing=2 cellpadding=2><tbody><tr class=heading><td valign=top><p><strong><span style="color: #465f89">STAGE 1</span></strong></p></td><td width=50 valign=top>&nbsp;</td></tr><tr><td valign=top><p> Basic Course over five days </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Extra tuition day </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Follow-up practice sessions x 5: guided and supervised - held weekly on Thursday eves </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top>Anatomy &amp; Physiology Introductory lecture</td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Anatomy &amp; Physiology lectures with monthly assignments (Monthly x 8 - as scheduled) </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> St. John&#39;s Ambulance First Aid course </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Receive Tutor Massage x 2 </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Begin Home Study Project (Anatomy &amp; Physiology) </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Textbooks (A&amp;P, Business) inc </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Home Practice massage: at least 20 hours </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p><strong><span style="color: #465f89">Total Price for Stage 1</span></strong></p></td><td class=price align=right valign=top><p><strong><span style="color: #465f89">&pound;690</span></strong></p></td></tr><tr><td valign=top>&nbsp;</td><td>&nbsp;</td></tr><tr class=heading><td valign=top><p><strong><span style="color: #465f89">STAGE 2</span></strong></p></td><td>&nbsp;</td></tr><tr><td valign=top><p> 3 Days Advanced tuition (including Applied Anatomy) </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Begin Home Study Project (Holistic Massage) </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top>Remaining Anatomy &amp; Physiology lectures (Monthly - as scheduled) with monthly assignments </td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top>Follow-up practice sessions x 3: guided and supervised - held weekly on Thursday eves </td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Attendance at 3 lectures of student&#39;s choice. </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p> Practice Management day </p></td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top>Completion of at least 20 case studies( 5 people x 4 full treatments of 90 mins. ) </td><td class=price align=right valign=top><p> &nbsp; </p></td></tr><tr><td valign=top><p><strong><span style="color: #465f89">Total Price for Stage 2</span></strong></p></td><td class=price align=right valign=top><p><strong><span style="color: #465f89">&pound;420</span></strong></p></td></tr><tr><td valign=top>&nbsp;</td><td>&nbsp;</td></tr><tr class=heading><td valign=top><p><strong><span style="color: #465f89">STAGE 3 - EXAMS</span></strong></p></td><td>&nbsp;</td></tr><tr><td valign=top><p> ITEC Mock written exams </p></td><td class=price align=right valign=top>&nbsp;</td></tr><tr><td valign=top><p> Massage Revision Weekend (at Marsh Farm - residential) </p></td><td class=price align=right valign=top>&nbsp;</td></tr><tr><td valign=top><p> A&amp;P revision evenings x 4 (weekly) </p></td><td class=price align=right valign=top>&nbsp;</td></tr><tr><td valign=top>Wilbury school Practical Assessment<br> ITEC Written Papers<br> ITEC Practical Examination</td><td class=price align=right valign=top>&nbsp;</td></tr><tr><td valign=top><p> White clothing </p></td><td class=price align=right valign=top>&nbsp;</td></tr><tr><td valign=top><strong><span style="color: #465f89">Total Price for Stage 3</span></strong></td><td class=price align=right valign=top><p><strong><span style="color: #465f89">&pound;340</span></strong></p></td></tr><tr><td valign=to