/dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_27">Holistic Massage</a></h3><h2>Syllabus Outline</h2><div class=txt><p> Study of the following elements is compulsory: </p><p> &bull; The twelve systems of the body, how they function, and the conditions and diseases associated with them, i.e: skeletal, muscular, skin, respiratory, urinary, lymphatic, cardio-vascular, neurological, endocrine, histology, digestive and reproductive. </p><p> &bull; The history, theory and philosophy of body massage and its definition, purpose and benefits. &bull; Psychological and physiological effects of massage, including all classical massage movements and their functions, benefits and contra-indications. </p><p> &bull; Client care and hygiene, professionalism and ethics. First Aid procedures and safety in the workplace. After-care advice. </p><p> &bull; How to take consultations and write up Case Histories. Referral procedures. </p><p> &bull; A knowledge of other natural therapies such as homoeopathy, reflexology, osteopathy. </p><p> &bull; The Holistic approach - treating the whole person - and our link with the environment. </p><p> &bull; The Acts and laws affecting practitioners, such as the Health and Safety at Work Act and the Companies Act. </p><p> &bull; Setting up your own practice: business studies basic book-keeping, accounting and self-Assessment. </p><p> &bull; Marketing and advertising your new business. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

