me=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_34">Sports Massage</a></h3><h2>Programme</h2><div class=txt><p><strong>SPM Programme</strong></p><p> The Sports Massage programme is made up of 5 weekends and a Patients Day: </p><p><strong> Weekend 1:</strong><br><span class=Sub_Title>Applied Anatomy &amp; Physiology</span> (Bettina Karsten)<br> An in-depth knowledge of Anatomy &amp; Physiology - especially the body systems and structures most affected by exercise - is essential to all Sports Massage Therapists. This weekend builds on the work studied in the ITEC A&amp;P completed with Swedish Massage. There will also be some cardio-vascular tests for fun. </p><p> On weekends 2 - 5 (with Jo Scrimshaw) you will work with a variety of Sports Massage Techniques, Exercise Theory, Massage Theory, Injuries, Body Structure and Pathology. Each weekend includes a demonstration of bodywork and a chance for all students to practise the new<br> techniques. </p><p><strong> Weekend 2:</strong><br> Techniques for sports massage<br> Massage mediums (Oils, Creams, Talcs etc)<br> Sports massage consultations and record-keeping<br> Client comfort and modesty<br> Palpation skills<br> Pre &amp; post event techniques.<br> Contraindications to massage.<br> Demonstration and practice sessions on Legs. </p><p><strong> Weekend 3:<br></strong>Body structure and evaluation of soft tissue stress.<br> Injuries to body tissue<br> Cryo and thermo therapy<br> Common sports injuries<br> The healing process<br> Demonstration and practice sessions on Backs. </p><p><strong> Weekend 4</strong><br> Exercise theory<br> Injury prevention<br> Principles of training and overtraining<br> Review aspects of massage theory<br> Importance of Nutrition in Sports<br> Demonstration and practice sessions on Arms. </p><p><strong> Weekend 5</strong><br> Stretch benefits, techniques and assessment.<br> Pathology<br> Demonstration and practice sessions on feet and ankles. </p><p><strong> Patients Day</strong><br> On this last day students will practice their newly acquired skills on a patient. There will also be an opportunity for students to review any aspects of the work before the final exams. </p><p> Supervised practice sessions can be arranged during the course to suit the group. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

