me=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_34">Sports Massage</a></h3><h2>Fees & Dates</h2><div class=txt><p class=Sub_Title> Registration &amp; Fees </p><p><strong> Enrolment</strong><br> Please phone Lindy Gillam (01273 552766) to make an appointment to see the school and to bring copies of your relevant diplomas. You will be asked to complete a registration form and to pay the registration fee. A registration form can be posted to you by request. </p><p><strong> Fees</strong><br> Course fees: &pound;825, plus textbook<br> (Registration fee/deposit &pound;200)<br> ITEC exam fee &pound;80 </p><p> The full fee is to be paid by the start of the course; an arrangement can be made to pay by instalments.SPM </p><p> &nbsp; </p><p class=Sub_Title> Course Dates </p><p><strong>2007 dates - Course Number 137:</strong><br> Held over five intensive weekends </p><p> June 16/17<br> June 30/July 1<br> August 18/19<br> September 1/2<br> October 6/7 </p><p> &nbsp; </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

