me=thai-massage">Thai Massage</a></dt><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_34">Sports Massage</a></h3><h2>Tutors</h2><div class=txt><p><strong>SPM Tutors</strong></p><p><span class=Sub_Title>Jo Scrimshaw</span><br> RPP, ThLA, Raworth Dip </p><p> Jo Scrimshaw is a Sports Massage Therapist and Polarity Practitioner.<br> Jo originally trained in Swedish Massage at the Raworth school of Massage, before qualifying in Sports Massage and Polarity Therapy. </p><p> Jo worked for several years with Kingston Rugby Football Club and Manor Athletic Football Club in addition to treating Prince Naseem, members of the Gladiators TV show and the Devonport Guncrew (at the Royal Tournament), </p><p> Jo now spends her time between her own clinic in Surrey and teaching Sports Massage, Polarity Therapy and Anatomy &amp; Physiology for colleges in Surrey and Sussex - including the Wilbury school. </p><p> &nbsp; </p><p><span class=Sub_Title>Bettina Karsten</span><br> M.Sc. Sports Science </p><p> Bettina Karsten is a senior lecturer in Sports Physiology and exercise rehabilitation at the University of Greenwich. She is particularly interested in rehabilitating athletes and is working on research projects with the University of Brussels. </p><p> After completing her degree in Sports Sciences at the University of Hanover, Germany, she worked as a therapist for over 6 years, treating athletes and people with chronic injuries. She is currently working on a PhD in exercise rehabilitation linking sports bio-mechanics with sports physiology. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

