</script></div><!-- End_Module_432 --></div></td></tr></table></td><td class=CTR06>&nbsp;</td></tr></table><table width=100% cellpadding=0 cellspacing=0 style="margin-bottom: 6px;"><tr><td class=CTR07>.</td><td class=CTR08>.</td><td class=CTR09>.</td></tr></table></td><td id=dnn_ContentPane class=ContentCenter valign=top><a name=347></a><table width=100% cellpadding=0 cellspacing=0><tr><td class=CTR01a>&nbsp;</td><td class=CTR02a valign=top><table width=100% cellpadding=0 cellspacing=0><tr><td class=CTRActions></td><td valign=bottom class=CTRTitle><span id=dnn_ctr347_dnnTITLE_lblTitle class=Head>Welcome to Alison Evans Bridalwear</span></td></tr></table></td></tr><tr><td class=CTR04a>&nbsp;</td><td id=dnn_ctr347_ContentPane class=CTRContenta align=left><!-- Start_Module_347 --><div id=dnn_ctr347_ModuleContent><div id=dnn_ctr347_HtmlModule_lblContent class=Normal><p><img height=225 alt="Alison Evans Home" hspace=16 src=/Portals/0/Common/Home_picture.jpg width=125 align=left vspace=4 border=0>For the dress of your dreams...</p><p>At <a href=/ >Alison Evans Bridalwear</a>, Alison and her staff know that choosing your <a href="/Default.aspx?tabid=59">wedding dress</a> is one of the most exciting and enjoyable parts of your wedding preparations. But it can also be one of the most difficult - with so many styles and so many dresses to choose from.</p><p>Located in <a href="/Default.aspx?tabid=55">Swadlincote in the East Midlands</a>, we have spent the last 19 years helping brides to choose the dress of their dreams, because as well as carrying one of the widest selections of <a href="/Default.aspx?tabid=59">wedding dresses</a>, <a href="/Default.aspx?tabid=60">bridal shoes</a> and <a href="/Default.aspx?tabid=60">wedding accessories</a> in the area, we also offer friendly, professional advice.</p><p>As premier stockists of designers such as Atelier Diagonal, <a href=/Dresses/AlfredAngelo/tabid/62/Default.aspx>Alfred Angelo</a>, <a href=/Dresses/BonnyBridal/tabid/64/Default.aspx>Bonny Bridal</a>, <a href=/Dresses/DZage/tabid/65/Default.aspx>D'Zage</a>, <a href=/Dresses/ForeverYours/tabid/66/Default.aspx>Forever Yours</a>, <a href="/Default.aspx?tabid=99">Justin Alexander</a>, <a href=/Dresses/MargaretLee/tabid/67/Default.aspx>Margaret Lee</a>, <a href=/Dresses/StPatrick/tabid/68/Default.aspx>St. Patrick</a> and White One we have <a href="/Default.aspx?tabid=59">wedding dresses</a> to suit all tastes and budgets. All complemented by accessories and shoes from prestigious brands such as <a href="/Default.aspx?tabid=78">Else</a>, <a href=/Accessories/MeadowsShoes/tabid/79/Default.aspx>Meadows</a>, <a href=/Accessories/MiaTiaras/tabid/80/Default.aspx>Mia</a>, <a href=/Accessories/PinkbyParadox/tabid/81/Default.aspx>Pink by Paradox</a>, <a href=/Accessories/RainbowClub/tabid/82/Default.aspx>Rainbow Club</a> and <a href=/Accessories/RichardDesigns/tabid/93/Default.aspx>Richard Designs</a>.</p><p>Click on the <a href="/Default.aspx?tabid=53">link</a> on the left, or call us now on (01283) 214553 to arrange an <a href="/Default.aspx?tabid=53">appointment</a>.</p><p>Most major credit cards accepted. </p></div><!-- End_Module_347 --></div></td></tr></table><a name=365></a><span id=dnn_ctr365_ContentPane align=left><!-- Start_Module_365 --><div id=dnn_ctr365_ModuleContent><div id=dnn_ctr365_HtmlModule_lblContent class=Normal><p align=center><em><font size=4></font></em></p><p align=center><em><a href=http://www.alisonevansbridalwear.co.uk/ ><font size=4>Alison Evans Bridalwear</font></a></em><br><a href="http://www.alisonevansbridalwear.co.uk/Default.aspx?tabid=55" target=_blank>37 New Street, Church Gresley,<br>Swadlincote, Derbyshire, DE11 9PS<br>ENGLAND</a></p><p align=center>Tel: (01283) 214553</p><p align=center><a href=javascript:addToFavorites()><img height=26 alt=Favourites src=http://www.alisonevansbridalwear.co.uk/Portals/0/Common/Star.gif width=26 border=0></a><br>Bookmark <a href=javascript:addToFavorites()>this</a> page<br></p><br>