l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_35">Thai Massage</a></h3><h2>Course Tutor</h2><div class=txt><p><strong>Christine Townley</strong><br> ITEC, MIFR, IEB, ITM </p><p> Christine is the founder and director of the Sussex Thai Massage School and was one of the first to introduce Thai Massage to the UK in 1992. She is a qualified teacher having completed 7307 Stage II and has been teaching since 1998. </p><p> She is also qualified in Holistic Massage Anatomy and Physiology and Reflexology with the International Federation of Reflexologists. </p><p> Christine has produced a comprehsensive Step by Step DVD with over 3 hours of massage and easy to follow voice over. She has written many articles on Thai Massage including magazines Positive Health, Yoga Magazine,Today&#39;s Therapist and Massage World. </p><p> Courses are accredited with Embody (formerly International Guild of Professional Practitioners) and affiliated to the Institute Complementary Medicine. </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

