  </script><script type=text/javascript src=js/plugins.js> </script><style type=text/css>@import "templates/default.css";</style><style type=text/css>@import "templates/plugins.css";</style><link rel=stylesheet href=templates/customstyles.css type=text/css></head><body><div class=hide><a href=#content>Skip Navigation</a></div><div id=head><div id=head><div><a href="index.php?p="><img src=files/img/WilburyHeader4.jpg alt></a></div></div><div class=clear>&nbsp;</div><div id=navcontainer><ul id=navlist><li class=l1><a href="?p=p_9&sName=home">Home</a></li><li class=l2><a href="?p=p_25&sName=news">News</a></li><li class=l3><a href="?p=p_38&sName=itec">ITEC</a></li><li class=l4><a href="?p=p_8&sName=links">Links</a></li><li class=l5><a href="?p=p_26&sName=downloads">Downloads</a></li><li class=lL><a href="?p=p_5&sName=contact">Contact</a></li></ul></div></div><div class=clear>&nbsp;</div><div id=body><div id=column><dl id=menu1><dt class=l1><a href="?p=p_27&sName=holistic-massage">Holistic Massage</a></dt><dt class=l2><a href="?p=p_32&sName=reflexology">Reflexology</a></dt><dt class=l3><a href="?p=p_18&sName=anatomy-&-physiology-itec">Anatomy & Physiology (ITEC)</a></dt><dt class=l4><a href="?p=p_20&sName=aromatherapy">Aromatherapy</a></dt><dt class=l5><a href="?p=p_28&sName=deep-tissue-massage">Deep Tissue Massage</a></dt><dt class=l6><a href="?p=p_29&sName=indian-head-massage">Indian Head Massage</a></dt><dt class=l7><a href="?p=p_30&sName=injury-prevention-massage">Injury Prevention Massage</a></dt><dt class=l8><a href="?p=p_31&sName=itec-unit-22">ITEC Unit 22</a></dt><dt class=l9><a href="?p=p_33&sName=advanced-reflexology">Advanced Reflexology</a></dt><dt class=l10><a href="?p=p_34&sName=sports-massage">Sports Massage</a></dt><dt class=l11><a href="?p=p_35&sName=thai-massage">Thai Massage</a></dt><dd class=l11><a href="?p=p_48&sName=course-tutor">Course Tutor</a></dd><dd class=l11 id=selected><a href="?p=p_49&sName=courses-&-dates">Courses & Dates</a></dd><dt class=l12><a href="?p=p_22&sName=short-courses">Short Courses</a></dt><dt class=l13><a href="?p=p_24&sName=talks-&-workshops">Talks & Workshops</a></dt><dt class=lL><a href="?p=p_7&sName=wilbury-trained-practitioners">Wilbury Trained Practitioners</a></dt></dl><div class=bL></div></div><div id=content><div class=bT><object type=application/x-shockwave-flash data=files/wilbury2e.swf width=500 height=45 bgcolor><param name=movie value=files/wilbury2e.swf></object></div><div class=slogan>New Sports Massage course starts Saturday 16th June - Enrolling now!</div><div id=pageShow><h3><a href="?p=p_35">Thai Massage</a></h3><h2>Courses & Dates</h2><div class=txt><p class=Sub_Title> Introductory Courses </p><p> You will learn how to massage the feet, legs and back with various techniques including gentle muscle stretching similar to yoga, thumb pressure similar to acupressure and rythmic palm pressure for relaxation. </p><p> These Practical Hands On Courses are designed to give you a comprehensive flavour of Thai Massage. They are suitable for a beginner or qualified practitioner wishing to add to their present skills. </p><p> You will practice and receive a short massage routine to practise on friends and family. </p><p> Course fee: &pound;70 </p><p> or &pound; 60 if paid 6 weeks before the course commences. </p><p> &nbsp; </p><p><span class=Sub_Title> Practitioners Diploma Course</span></p><p> The course consists of 72 hours of comprehensive training and is accredited with Embody. It is open to everyone whether a complete beginneror qualified practitioner. </p><p> The course is mainly practical and demonstrations will be followed by supervised practice. Emphasis is placed on use of the practitioner&#39;s bodyweight, correct positioning/movement and to work in a sympatheticstyle with awareness of their client&#39;s reaction.<br> Image </p><p> The course content has been developed from traditional techniques of the Institute of Thai Massage Level I and II. </p><p> Class sizes are small to enable students to benefit from individual attention.. </p><p> Home study and practice will be required including 30 case studies. It will be necessary to complete an Anatomy and Physiology course and this can be studied alongside your Thai Massage Course at the Wilbury School. If you have already completed this, please let us have a copy of your certificate. </p><p> Course fee: &pound;750 + Examination fee<br> &pound; 200 deposit reserves a place<br> Early booking fee &pound;700 if paid by 1st June. </p><p> After successful completion of the Diploma Course and Anatomy &amp; Physiology students will be fully qualified Thai Massage Practitioners and be able to obtain insurance and become a member of Embody (formerly International Guild of Professional Practitioners). </p><p> &nbsp; </p><p><span class=Title> Course Dates</span></p><p><strong> 2007 dates - Course Num 139:<br> Practitioner Course dates</strong></p><p> Thursdays, Fridays &amp; Saturdays </p><p> July 6, 7, 8<br> August 3, 4, 5<br> August 24, 25, 26<br> Exam date: March 22, 2008 </p></div><div class=clear>&nbsp;</div><!----></div></div><div class=clear>&nbsp;</div><div id=back><a href="javascript:history.back( );">&laquo; go back</a>|<a href="javascript:window.print( );" id=print>print</a></div></div><div id=foot><p>&nbsp;</p><h1><a href=http://www.digitalmedialab.co.uk target=-blank>design & hosting by digitalmedialab</a></h1></div></body>",nonspam

