</script><noscript><div><img src="http://serv2.avitop.com/aviation/hitlist.asp?id=2527" height=1 width=1 alt></div></noscript><a name=top></a><h1>David Williams<br>flying homepage </h1><p class=frontpageintro> One of my hobbies is flying light aircraft. I got my <acronym title="Private Pilot's Licence">PPL</acronym> in the summer of 2001, and this site describes various trips I've done and other aviation-related stuff. </p><div class=imagecenter><a href=http://www.dmjwilliams.co.uk/gbsep.htm><img src=images/echopapa/gbsep_takeoff_blur.jpg alt="Taking off from Redhill in G-BSEP"></a></div><div class=frontpagesectioncontainer><div class=frontpagesection><a href=gbsep_share.htm><h3>Cessna 172 share for sale</h2></a><p> My share in <span class=aircraftreg>G-BSEP</span>, a 1959 square-tail Cessna 172, is for sale. Click <a href=gbsep_share.htm>here</a> for details. </p></div><div class=frontpagesection><h3>Flying trips</h3><p>Here's a selection of write-ups of some flying trips I've done...</p><p><a href=http://www.dmjwilliams.co.uk/ireland.htm>Ireland Trip</a>,<br><a href=http://www.dmjwilliams.co.uk/letouquet.htm>Le Touquet Trip</a>,<br><a href=http://www.dmjwilliams.co.uk/lasham.htm>Gliding at Lasham</a><br><a href=http://www.dmjwilliams.co.uk/flyerforumflyin.htm>Flyer Forum fly-ins</a><br><a href=http://www.dmjwilliams.co.uk/minireports.htm>Mini flight reports</a><br></p></div><div class=frontpagesection><h3>Aircraft I've flown</h3><p> I currently own a share in a Robin HR100/210, and also a share in a classic 1959 Cessna 172 based at Redhill. Here's a description of both aircraft, together with a description of a Piper PA28 that I used to fly... </p><p><a href=http://www.dmjwilliams.co.uk/gbapy.htm>Robin HR100/210 <span class=aircraftreg>G-BAPY</span></a> <span class=highlight>New!</span><br><a href=http://www.dmjwilliams.co.uk/gbsep.htm>Cessna 172 <span class=aircraftreg>G-BSEP</span></a><br><a href=http://www.dmjwilliams.co.uk/btim.htm>PA28 <span class=aircraftreg>G-BTIM</span></a><br></p></div><div class=frontpagesection><h3>Other flying stuff</h3><p>Other bits n' bobs to do with flying...</p><p><a href=http://www.dmjwilliams.co.uk/gbapy-calendar.htm>Booking calendar for <span class=aircraftreg>G-BAPY</span></a> <span class=highlight>New!</span><br><a href=http://www.dmjwilliams.co.uk/gbsep-calendar.htm>Booking calendar for <span class=aircraftreg>G-BSEP</span></a><br><a href=http://www.dmjwilliams.co.uk/logbook.htm>My Logbook</a><br><a href=http://www.dmjwilliams.co.uk/airfields.htm>Airfields I've visited</a><br><a href=http://www.dmjwilliams.co.uk/flying-costs.htm>My flying costs</a><br><a href=http://www.dmjwilliams.co.uk/gallery.htm>Picture gallery</a><br></p></div><div class=frontpagesection><h3><a href=http://www.dmjwilliams.co.uk/links.htm>Links</a></h3><p>A selection of links taken from my Favourites list.</p></div></div> <!-- frontpagesectioncontainer --><!--
