</script></head><body><div id=frame><div id=left><img src=images/1pixel.gif alt="carpet cleaning" height=500 width=60></div><div id=content><div class=flash><object data=carpetclean.swf type=application/x-shockwave-flash width=600 height=143><param name=movie value=carpetclean.swf></object></div><div class=clear><img src=images/1pixel.gif class=clear alt width=10 height=145></div><div class=navbar><ul><li class=selected><a href=index.htm>home</a></li><li><a href=cleaning_services.htm>services</a></li><li><a href=cleaning_tips.htm>cleaning tips</a></li><li><a href=contact.htm>contact</a></li><li class=end><a href=form.php>quote</a></li></ul></div><div class=text-main><h1>Upholstery &amp; Carpet Cleaning in Devon.</h1><h2>Introduction</h2><p class=tp-adj> We provide a complete professional cleaning service for all your requirements.<br> Based in Devon, we are a family run business, this allows us to give you the best competitive prices whilst still maintaining our quality standards. All work is carried out by owner's them self's, our customer's know they can trust us every time to look after their home. </p><h3>Why choose Us?</h3><p class=tp-adj> We tailor our cleaning service to meet your needs. Whether you require a carpet cleaner for a large restaurant or a lounge carpet, the exceptional level of customer service and attention to detail remains the same.</p><p class=tp-adj>Using the latest cleaning method's and machine's we are able to cover every type of cleaning job within your home and always make sure that we use the right system for the problem. </p><p><span class=tp-adj>We also stock a unique range of aftercare products and services which you can purchase to keep your home looking clean, simply ask us for details. </span><br><span class=link1><a href=contact.htm class=black>Read more >></a> </span></p><h2>Area's Covered in Devon </h2><p class=tp-adj> Serving South Devon including the following areas-</p><p class=tp-adj>Torbay - Plymouth - Exeter - Newton Abbot - Torquay</p><p class=tp-adj>We offer a full range of domestic and commercial upholstery and carpet cleaning services. </p><p><span class=tp-adj>Fully insured and fully trained, we look forward to meeting you.</span><br><span class=link1><a href=form.php class=black>For an online quote&gt;&gt;</a></span> </p></div><div class=navbar><ul><li class=selected><a href=index.htm>home</a></li><li><a href=cleaning_services.htm>services</a></li><li><a href=cleaning_tips.htm>cleaning tips</a></li><li><a href=contact.htm>contact</a></li><li class=end><a href=form.php>quote</a></li></ul></div><div class=clear><img src=images/1pixel.gif class=clear alt width=10 height=10></div><hr size=1 width=90% align=center><div class=bottom><p>Area's Covered Also Include -<br><br> Newton Abbot - Kingskerswell - Chudleigh - Kingsteignton - Salcombe -<br> - Tavistock - Dartmouth - Bude - Exmouth - Teignmouth - Paignton -<br> - Bovey Tracey - Ivybridge - Modbury - Okehampton - Brixham - Tiverton -<br> - Bere Alston - Chudleigh - Woolacombe - Crediton - Honiton - Budleigh Salterton -<br><br> &copy; - Upholstery &amp; <a href=http://www.fresherclean.co.uk/ >Carpet Cleaning</a> in Devon </p></div><div align=center class=grey><a href=http://www.sheffieldcleaning.com>Carpet Cleaning Sheffield </a> <a href=http://www.ncca.co.uk/associate_members.htm>NCCA Associate Member </a> <a href=http://www.carpetcleaningking.co.uk/ >Carpet Cleaning Guildford</a><br> <a href=http://www.elbowcarpetcare.co.uk/ >Carpet Cleaning Fleet-Church Crookham </a> </div></div></div><div class=sidebar><h3>Quick Links...</h3><p class=link1><a href=carpet_cleaning_devon.htm>Carpet Cleaning</a></p><p class=link1><a href=upholstery_cleaning_devon.htm>Sofa Cleaning</a></p><p class=link1><a href=carpet_cleaning_faq.htm>Cleaning FAQ</a></p><p class=link1><a href=carpet_cleaning_offer.htm>Free Warranty Offer?</a> </p></div></body>",nonspam

