</script></head><body onload="MM_preloadImages('images/Specs.gif','images/Tour.gif','images/quote.gif','images/contact.gif')"><table width=900 border=0 cellspacing=0 cellpadding=0><tr><td height=212 colspan=4><table id=Table_03 width=900 height=212 border=0 cellpadding=0 cellspacing=0><tr><td rowspan=5><img src=images/GO_top_01.gif alt width=55 height=212></td><td width=482 height=27><table width=482 height=27 border=0 cellpadding=0 cellspacing=0><tr><td width=97 height=27><img src=images/home.gif alt="PCB Home" width=97 height=27></td><td width=115 height=27><a title="PCB Manufacturers" onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('Specs','','images/Specs.gif',1)" href=pcb-manufacturing-spec.html><img src=images/Specs_off.gif alt="PCB Manufacturers: Specifications" name=Specs border=0 width=115 height=27></a></td><td width=60 height=27><a title="Prototype PCB Design" onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('tour','','images/Tour.gif',1)" href=pcb-assembly-tour.htm><img src=images/Tour_off.gif alt="Prototype PCB Design: Tour" name=tour border=0 width=60 height=27></a></td><td width=120 height=27><a title="Request PCB Price" onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('request','','images/quote.gif',1)" href=pcb-quote.html><img src=images/quote_off.gif alt="Request PCB Price" name=request border=0 width=120 height=27></a></td><td width=90 height=27><a title="Contact Us" onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('contact','','images/contact.gif',1)" href=contact_us.html><img src=images/contact_off.gif alt="Contact Us" name=contact border=0 width=90 height=27></a></td></tr></table></td><td rowspan=2><a title="printed circuit boards" href=index.htm><img src=images/GO_top_03.gif alt="Specialists in printed circuit boards: Garner Osborne Circuits" border=0 width=308 height=71></a></td><td rowspan=5><img src=images/GO_top_04.gif alt width=55 height=212></td></tr><tr><td><img src=images/GO_top_05.gif alt width=482 height=44></td></tr><tr><td colspan=2 background=images/GO_top_06.gif width=790 height=30 style="padding-left:35px; font-face:arial; font-size:13px; color:#ffffff; font-weight:bold;">&nbsp;</td></tr><tr><td colspan=2><img src=images/GO_top_07.gif alt="Specialists in printed circuits" width=790 height=100></td></tr><tr><td colspan=2><img src=images/GO_top_08.gif alt width=790 height=11></td></tr></table></td></tr><tr><td width=55 align=right><img src=images/left_cheat.jpg width=2 height=100%></td><td width=272 valign=top bgcolor=#FFFFFF><table id=Table_2 width=272 height=120 border=0 cellpadding=0 cellspacing=0><tr><td height=32 colspan=3><img src=images/tour_box_01.gif alt width=198 height=32></td><td><img src=images/tour_box_02.gif alt="PCB's Tour" width=74 height=32></td></tr><tr><td width=28 height=70 rowspan=2 bgcolor=#FFFFFF>&nbsp;</td><td rowspan=2 valign=middle background=images/tour_box_04.gif width=11></td><td width=159 rowspan=2 bgcolor=#EBF3FB><span class=Tour>TAKE OUR TOUR </span><br><br><span class=body_blue>Find out more about Garner Osborne's </span><span class=style2><a href=pcb-assembly-tour.htm>Printed Circuit Board Process </a></span><span class=body_blue>.</span><br></td><td width=74 height=70 valign=top><img src=images/tour_box_06.gif alt width=74 height=70></td></tr><tr><td valign=bottom bgcolor=#EBF3FB><img src=images/box_stretch.gif width=74 height=40></td></tr><tr><td><img src=images/tour_box_07.gif alt width=28 height=18></td><td colspan=2><img src=images/tour_box_08.gif alt width=170 height=18></td><td><img src=images/tour_box_09.gif alt width=74 height=18></td></tr></table><!--2nd Box--><div style=padding-left:28px;><table border=0 cellpadding=0 cellspacing=0 style width=200><tr><td style="border:solid 1px;background-color:#EBF3FB;border-color:#95aabc;padding-top:17px;padding-bottom:17px;padding-right:10px;padding-left:10px" class=body_blue><span class=Tour>CONTACT US</span><br><br> Tel: 01635 582626<br> Fax: 01635 551330<br> Email: <a href=mailto:sales@garnerosborne.co.uk>sales@garnerosborne.co.uk</a><p>FOR ALL YOUR PCB REQUIREMENTS</td></tr><tr><td><img src=images/boxShadow.gif width=202 height=7></td></tr></table></div><!--/2nd Box--></td><td width=518 valign=top><table width=518 cellpadding=14 cellspacing=0 class=Table_border><tr><td bgcolor=#FAFAFA><br><h1>Printed Circuit Boards: </h1><br><h2>PCB Manufacture</h2></td></tr><tr><td bgcolor=#FAFAFA class=Table_cell_border><p style="margin-top: 0;">Garner Osborne has established a reputation second to none as the market leader in PCB manufacture. We offer a great deal of expertise, along with a vision of how printed circuit boards should be supplied in a forever changing market place.<br> As a result, we can supply to our customer a high quality printed circuit board, of different types of rigid printed circuits, up to 16 layers. Manufacturing in house for a diverse range of applications, with the option of procuring volume printed circuit boards, sourced overseas through tried and tested manufacturing partnerships.<br> Our company is situated in the heart of Newbury and we have a dedicated and loyal workforce of approximately 50 staff.</p><p style="margin-bottom: 0;">Find out about our PCB <a href=thermal-pcb.html>Thermal Management System</a> for high power and densely packed printed circuit boards.<br><br></p></td></tr><tr><td bgcolor=#EFF0F0><p style="margin-bottom: 0;">&nbsp;</p><h3 style="margin-top: 0">Quality PCBs</h3>Established in 1990, Garner Osborne has built a reputation for manufacturing high quality PCBs at a competitive price, with reliable delivery performance.<br></p><p style="margin-top: 0; margin-bottom: 0;">Our standard turnaround time for PCB manufacture is 10 working days &ndash; however, we can turnaround a printed circuit board order within 24 hours when customers require this service. All enquiries are welcome &ndash; you can <a href=pcb-quote.html>request a fast PCB quote</a>, or <a href="mailto:sales@garnerosborne.co.uk?subject=Please send a copy of your brochure">e-mail us</a> to request a copy of our brochure.<br><br><br><br></p></td></tr></table></td><td width=55 align=left><img src=images/right_cheat.jpg width=2 height=100%></td></tr><tr><td width=55 align=right><img src=images/left_cheat.jpg width=2 height=100%></td><td colspan=2><table width=790 border=0 cellspacing=0 cellpadding=0><tr><td height=5 bgcolor=#185DB1><img src=images/shim.png width=1 height=1></td></tr><tr><td height=1 bgcolor=#FFFFFF><img src=images/shim.png width=1 height=1></td></tr><tr><td height=34 align=center valign=middle bgcolor=#B0D2FC class=Bottom><a class=Bottom href=index.htm>Home: PCB Manufacture</a> &nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp; <a class=Bottom href=pcb-manufacturing-spec.html>Specifications: PCB Manufacturers</a>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;<a class=Bottom href=pcb-assembly-tour.htm>Tour: Prototype PCB Design</a>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;<a class=Bottom href=pcb-quote.html>Request a Fast PCB Quote</a>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp; <a class=Bottom href=contact_us.html>Contact Us</a> <img src=images/shim.png width=1 height=1>&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;<a class=Bottom href=resources.htm>Web Resources</a></td></tr></table></td><td width=55 align=left><img src=images/right_cheat.jpg width=2 height=100%></td></tr></table></body>",nonspam

