1px; TEXT-INDENT: 0px" align=center><font size=+2><b>All rooms en-suite</b></font></p><p style="MARGIN: 1px 0px; WORD-SPACING: 1px; TEXT-INDENT: 0px" align=center><font size=+2><b>Non Smoking</b></font></p><p style="MARGIN: 1px 0px; WORD-SPACING: 1px; TEXT-INDENT: 0px" align=center>&nbsp;</p><p style="MARGIN: 1px 0px; WORD-SPACING: 1px; TEXT-INDENT: 0px" align=center><b><font size=+1><img src=images/aa-4d-devon.jpg alt="B&B accommodation" width=71 height=114></font></b></p><p style="MARGIN: 1px 0px; WORD-SPACING: 1px; TEXT-INDENT: 0px" align=center>&nbsp;</p><p style="MARGIN: 1px 0px; WORD-SPACING: 1px; TEXT-INDENT: 0px" align=center><b><font size=+1><a href=accommodation.htm>Click here for more information about our <br> Kingsbridge B&amp;B Bed and Breakfast accommodation </a></font></b></p><p>&nbsp;</p></div></td></tr></table><table width=680 border=0 align=center cellpadding=0 cellspacing=0><tr><td colspan=3 bgcolor=#FFFFFF><p align=center><b><font color=#6699FF>You will find that our accommodation is well placed for exploring all of the following places </font></b></p><blockquote><p><b><font size=+1>Salcombe </font></b>is one of the most beautiful sailing and fishing centres in the world, with safe, clean sandy beaches and coves. Magnificent scenic coastline is surrounded by tranquil countryside.</p><p><b><font size=+1>Kingsbridge</font> </b>Historic market town standing at the head of Kingsbridge estuary where unspoilt creeks are habitat for an abundance of wildlife. Browse through the friendly local shops and the markets on the Quay.</p><p><b><font size=+1>Dartmouth</font></b> Leisurely cruises on the River Dart , Britannia Naval College and Dartmouth Castle. Marina and harbour busy with boats.</p></blockquote><blockquote><p><b><font size=+1>Dartmoor</font></b> Granite tors and drystone walls. Ancient crosses and stone cirles. Wild expanses of moorland coloured with yellow gorse and purple heather, where ponies graze.</p><p><b><font size=+1>South Hams</font></b><font size=+1>.</font> Colourful patchwork of breathtaking countryside with historic towns and pretty villages. Delicious locally produced quality food. Gentle climate. Beautiful gardens.</p><p>&nbsp;</p></blockquote> </td></tr><tr><td width=217 bgcolor=#FFFFFF><p align=left style="word-spacing: 1; text-indent: 0; margin-left: 0; margin-right: 0; margin-top: 1; margin-bottom: 1"><img src=images/south-devon-2.jpg alt="Ideal for Datmouth in South Devon" width=217 height=170></p></td><td width=251 bgcolor=#FFFFFF><p align=CENTER style="word-spacing: 1; text-indent: 0; margin-left: 0; margin-right: 0; margin-top: 1; margin-bottom: 1"><i><font size=+2>Anthea Pope<br></font></i><font size=+2><i>Highwell House,<br></i></font><i><font size=+2>Churchstow, Kingsbridge, <br> South Devon, TQ7 3QP</font></i></p><p align=CENTER style="word-spacing: 1; text-indent: 0; margin-left: 0; margin-right: 0; margin-top: 1; margin-bottom: 1"><i><font size=+2>Tel: 01548 852131</font></i></p></td><td width=212 bgcolor=#FFFFFF><div align=right><img src=images/south-devon.jpg alt="Ideal for Dartmoor and Salcombe" width=211 height=167></div></td></tr></table><div align=center><br><a href="mailto:highwellhouse@hotmail.com?subject=Enquiry%20from%20website"><b><font size=+1>email:highwellhouse@hotmail.com</font></b></a></div><p>&nbsp;</p><p align=center><a href=devon-l.htm>Devon Links Page</a></p><p>&nbsp;</p><p>&nbsp;</p><p align=center><a href=http://www.kateprice.co.uk target=_blank>web mistress Kate Price </a></p><p>&nbsp;</p><p>&nbsp;</p><!-- www.hitslink.com web tools statistics hit counter code --><script language=javascript type=text/javascript>
