images/new_releases_bg.gif border=0 width=186 height=111></div><div id=shape1 style="position:absolute; overflow:hidden; left:22px; top:1123px; width:751px; height:14px; z-index:11; background-color:#9DA7BD">&nbsp;</div><div id=text1 style="position:absolute; overflow:hidden; left:251px; top:220px; width:514px; height:164px; z-index:12"><div class=wpmd><div><font color=#253B6D><b>Welcome to the Home of Rugby in Lewes.</b></font></div><div><font color=#253B6D><b><br></b></font></div><div><font color=#253B6D>Lewes RFC runs several teams at various competative levels, including the senior mens sides, the womens, girls and junior Teams. </font></div><div><font color=#253B6D><br></font></div><div><font color=#253B6D>Every Club wants new members - the 'spirit of rugby' is not just a sentiment it can be a way of life! - play a good hard game with your mates and find out! Rugby Union is the finest Team game in the world, but we need players, and whatever your age, sex, shape, size or skill, you will be most welcome at our friendly Club.</font></div></div></div><div id=text2 style="position:absolute; overflow:hidden; left:36px; top:445px; width:159px; height:137px; z-index:13"><div class=wpmd><div><font class=ws9 color=#666699><b>NEWS</b></font></div><div><font class=ws9 color=#666699><b><br></b></font></div><div><font class=ws9 color=#666699><br></font></div></div></div><div id=image10 style="position:absolute; overflow:hidden; left:274px; top:396px; width:461px; height:190px; z-index:14"><img src=images/LRFCsmall.jpg border=0 width=461 height=190 alt="Stanley Turner Ground"></div><div id=marquee1 style="position:absolute; overflow:hidden; left:35px; top:471px; width:157px; height:90px; z-index:15"><marquee width=157 height=90 direction=Up scrolldelay=250><div class=wpmd><div align=center><font class=ws9 color=#FF0000><b>ANNUAL DINNER DANCE</b></font></div><div align=center><font class=ws9 color=#FF0000><b> </b></font></div><div align=center><font class=ws9 color=#FF0000><b>SATURDAY 28 APRIL 2007</b></font></div><div align=center><font class=ws9 color=#FF0000><b>PELHAM HOUSE&nbsp;&nbsp;&nbsp; ST ANDREWS LANE&nbsp;&nbsp;&nbsp; LEWES</b></font></div><div align=center><font class=ws9 color=#FF0000><b><br></b></font></div><div align=center><font class=ws9 color=#666699><b><br></b></font></div><div align=center><b><a href=social.html target=_self class=style2>SOCIAL PAGES UPDATED</a></b></div><div><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699>Training has started, come along to the ground on Tuesday &amp; Thursday evenings at 7:30pm..</font></div><div align=center><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699>Look forward to seeing you!!</font></div><div align=center><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699>PLACES IN ALL TEAMS ARE UP FOR GRABS... </font><font class=ws9 color=#666699><b>SO IF YOU THINK YOUR GOOD ENOUGH... LETS FIND OUT</b></font><font class=ws9 color=#666699>!!</font></div><div align=center><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699><b><br></b></font></div><div align=center><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699><br></font></div><div align=center><font class=ws9 color=#666699><br></font></div><div><font class=ws9 color=#666699><br></font></div><div><font class=ws9 color=#666699><br></font></div><div><font class=ws9 color=#666699><b><br></b></font></div></div></marquee></div><div id=text6 style="position:absolute; overflow:hidden; left:26px; top:159px; width:167px; height:276px; z-index:16"><div class=wpmd><div><font class=ws9 color=#666699><b>What's NEW?</b></font></div><div><font class=ws9 color=#666699><b><br></b></font></div><div><font class=ws9 color=#666699><b>IMPORTANT!!</b></font></div><div><font class=ws9 color=#666699><b><br></b></font></div><div><font class=w