</style></head><body bgcolor=#ffffff text=#6f7a9e link=#34ff76 vlink=#bbff48 marginheight=0 marginwidth=0 topmargin=0 leftmargin=0><table border=0 cellpadding=0 cellspacing=0 width=100%><tr valign=top><!-- left column with menu --><td width=140 valign=top background=images/leftbg.gif><a name=top><img src=images/topleft.gif width=159 height=225 alt="Williamson and Company - accountants (7370 bytes)"></a><br><a href=index.htm><img src=images/home.gif width=131 height=34 alt=Paqua border=0></a><a href=accountancy.htm><img src=images/account.gif width=131 height=34 alt=Accountancy border=0></a><br><a href=taxation.htm><img src=images/taxation.gif width=131 height=34 alt=Taxation border=0></a><br><a href=wills.htm><img src=images/wills.gif width=131 height=34 alt=Wills border=0></a><br><a href=cform.htm><img src=images/cform.gif width=131 height=34 alt="Company Formation" border=0></a><br><a href=partnership.htm><img src=images/partnership.gif width=131 height=34 alt="Limited Liability Partnerships" border=0></a><br><a href=tform.htm><img src=images/tform.gif width=131 height=34 alt="Trust Formation" border=0></a><br><a href=softw.htm><img src=images/softw.gif width=131 height=34 alt="Software Training" border=0></a><br><a href=news.htm><img src=images/news.gif width=131 height=34 alt=Articles border=0></a><br><a href=http://www.forensic.org.uk><img src=images/forens.gif width=131 height=34 alt="Forensic Accountancy" border=0></a><br><img src=images/bottom.gif width=131 height=63 alt="Williamson and Company - accountants (3508 bytes)"><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</td><!-- right column with top strip in a separate table, followed by text --><td valign=top><!-- table with top strip--><table width=100% border=0 cellpadding=0 cellspacing=0><tr><td background=images/top.gif><img src=images/top.gif width=14 height=92 border=0 alt="Williamson and Company - accountants"></td></tr></table><!-- text begins HERE--><p>&nbsp;</p><!--table for right column text--><table width=500 border=0 align=center><tr><td><p class=center><b>Williamson & Company Head Office</b><br><font class=small>The Links, 52 Molesey Close, Hersham, Surrey, KT12 4PX<br> Tel: 01932 223692 - Fax: 01932 709951<br> email: <a href=mailto:info@willsonsult.co.uk>info@willconsult.co.uk</a></font></p><hr width=250 size=3><p class=large>About Williamson & Company......</p><p>Williamson & Company is an independent firm of highly experienced professional finance managers and accountants. We provide a unique alternative to the expense of employing a full time professional finance manager, when really what you need is the flexibility to buy the expertise you need to support your business when you need it.</p><p>As your business continues to develop we can ensure that your account and financial systems are up to the job, provide the means to meet your demand for Management Information and give you the strategic and financial management support you need in order to concentrate on other business issues. </p><p>We are a proactive firm offering a wide range of services which can benefit businesses of all shapes and sizes: audit, accountancy, taxation, payroll, training, company formation and millennium compliance, i.e. complete financial management for your business. </p><p>In addition we specialise in the provision of forensic accountancy and expert witness services for the legal profession.</p><p>You choose the level of support that you need and we provide the skilled and experienced staff necessary to give you the highest quality resource.</p><p><b>Find out more about the benefits Williamson & Company will bring to your company and <a href=mailto:info@willconsult.co.uk>e-mail us now.</a> An initial consultation is free of charge.</b></p><p>&nbsp;</p><p class=center>For information on other types of accountancy <br>services please visit our sister company's website:<br><b><a href=http://www.accountancyonline.org.uk/ >Accountancy Online</a> - online accountancy services</b></p><p>&nbsp;</p><hr width=270 size=3><p class=center><b>Other Offices</b></p><p class=center><b>Williamson & Company City Office </b><br> Docklands Business Centre<br> 10-16 Tiller Road, London E14 8PX<br> Tel: 020 7870 0300 * Fax:020 7515 9509</p><p class=center><b> Williamson & Company Crawley Office</b><br> 4 Greyhound Slip, Worth, Crawley<br> West Sussex RH10 7FP<br> Tel: 01293 885 833 * Fax:01293 885 839</p><p class=center><b> Williamson & Company Prague Office</b><br> Suite 301, Palac Kovo, Jankovcova 2<br> 170 88 Praha 7, Czech Republic<br> Tel: +420 (2) 3449 3566* Fax: +420 (2) 3449 3007 </p><!-- end of table for right hand column text--></td></tr></table></td></tr><tr><td width=140 valign=top background=images/leftbg.gif><p class=center><a href=#top><img src=images/backtotop.gif border=0 width=122 height=22 alt="back to the top"></a></td><td><hr width=400 size=3><p class=center><font class=small>Web Site designed for screen resolution of 800x600 by <a href="mailto:zlata.heller@virgin.net?subject=Williamson & Co Website">Heller Consulting.</a><br> For more information on our services please visit our <a href=http://www.heller-consulting.co.uk/ >web site.</a><br> Best viewed with IE5 or higher.</font></p><p>&nbsp;</p><p>&nbsp;</p></td></tr></table></body>",nonspam

