       </script><noscript><div id=flash-bg></div></noscript><!-- Flash Detect script END --></div><div id=home-intro><h1>Safer recruitment protecting the vulnerable</h1><div><div><div>Welcome to the <acronym title="Criminal Records Bureau">CRB</acronym> website - providing you with information about the CRB and its services.</div><div>&nbsp;</div><div>The CRB&rsquo;s aim is to help organisations in the public, private and voluntary sectors by identifying candidates who may be unsuitable to work with children or other vulnerable members of society.</div></div></div></div><div id=home-quote><blockquote>&#8220;The role of the Criminal Records Bureau is to reduce the risk of abuse by ensuring that those who are unsuitable are not able to work with children and vulnerable adults&#8221;<br><strong>The Home Secretary</strong></blockquote></div></div><div class=divider></div><!-- End top content panel --><div id=call-to-action><!-- Start lower content panel --><div id=news-headlines><h2>Latest News</h2> <ul><li><a href="Default.aspx?page=4735">CRB receives an innovation award</a><br> 02.05.07<br></li><li><a href="Default.aspx?page=4734">Independent Barring Board Chair Appointed</a><br> 30.04.07<br></li><li><a href="Default.aspx?page=4733">CRB Equality and Diversity Scheme</a><br> 30.04.07<br></li><li><a href="Default.aspx?page=1351" class=small-grey>View full news listing ></a></li></ul></div><div id=crb-checks><div id=crb-checks-intro><h2><a href="Default.aspx?page=282">CRB Checks</a></h2><p>If you are thinking of applying, or have been asked to apply, <a href="Default.aspx?page=381">for a CRB check click here</a>.</p></div><div id=crb-checks-customers><div id=crb-checks-new><h2><a href="Default.aspx?page=382">New customers</a></h2><h3>Obtaining a check</h3><p>If your organisation wants to start using CRB checks why not use an Umbrella Body.</p><p class=btn><a href="Default.aspx?page=349">Search our database</a><span class=breadcrumb-divider>.</span></p></div><div id=crb-c