width=131 height=25 border=0 alt=Actions name=Image23></a><br><a href=testimonials/index.htm onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('Image24','','pics/sl_testi2.gif',1)"><img src=pics/sl_testi.gif width=131 height=25 border=0 alt=Testimonials name=Image24><br></a><a href=contact/index.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('Image25','','pics/sl_contact2.gif',1);MM_showMenu(window.mm_menu_0611152951_0,130,0,null,'Image25')"><img src=pics/sl_contact.gif width=131 height=25 border=0 alt=Contact name=Image25></a><br><a href=news/index.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('Image26','','pics/sl_news2.gif',1)"><img src=pics/sl_news.gif width=131 height=25 border=0 alt=News name=Image26></a><br><a href=sitemap/index.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('Image27','','pics/sl_sitemap2.gif',1)"><img src=pics/sl_sitemap.gif width=131 height=25 border=0 alt=Sitemap name=Image27></a></td><td width=410 valign=top><br><!-- title here --><table cellpadding=0 cellspacing=1 border=0 bgcolor=#82205c><tr><td><table cellpadding=0 cellspacing=5 border=0 bgcolor=#f1e9ef><tr><td style="padding: 6px 0 6px 0 "><p><strong>Free Consultations</strong></p><p>PERMITS2WORK is holding <strong>free consultation sessions</strong> for individuals in or leaving higher and further education. If you are unsure what your immigration status will be when you have finished your studies then we can help. </p><a href="http://www.permits2work.co.uk/news/detail.asp?news=Free+Student+Workshops">Click here for more information</a><p></p></td></tr></table></td></tr></table><br><h1>UK Work Permits <img src=work_permit.jpg width=400 height=7></h1><p>Well established as the market leader for providing UK Work Permits, Highly Skilled Migrant Programme [HSMP] and all other aspects of UK Immigration advice and services, PERMITS2WORK are experts in our field and deal with the Home Office on a daily basis<p> We work across the top 500 UK employers, securing UK Work Permits so that they have permission to employ that key member of staff on a permanent basis.<p> The Home Office has a range of schemes and programmes available for UK Employers and Individuals, offering several different routes to come and legally be employed in the UK, including work permits.<p><table cellpadding=0 cellspacing=1 border=0 bgcolor=#82205c><tr><td><table cellpadding=0 cellspacing=5 border=0 bgcolor=#f1e9ef><tr><td valign=top><img src=../pics/open_quotes.gif width=13 height=18 alt></td><td style="padding: 6px 0 6px 0 "><p>I couldn't recommend them highly enough for efficiency and for high level of service.</p></td><td valign=bottom><img src=../pics/close_quotes.gif width=13 height=18 alt></td></tr></table></td></tr></table><br><div align=right><strong>Brian Hutchinson</strong>, Managing Director<br> London, April 2006 </div><br> From newly qualified Graduates to Board Level Directors, we have years of experience in making successful work permit applications for skilled individuals to work in the UK. <br>We identify with exactly how valuable key individuals can be to a Company and the difference they can make; we understand that is too important to leave to chance.<p><strong>UK Immigration and the issues that surround it are often complex. We have a team of qualified and trained Work Permit Consultants who have the experience and knowledge needed to guide you to the right solution.</strong> <p> Even experienced HR Managers can experience difficulty in making a work permit application; keeping up to date with UK Immigration law and how it can be applied to their specific case. <p> You should seek professional advice at an early stage to make sure that costly mistakes are avoided. We have a high success rate for the cases we take on working on a <strong>NO-WIN NO-FEE basis.</strong> <p><strong>Take a look at our <a href=../testimonials/index.htm>testimonials </a>from just a few of our satisfied clients<p> </strong><p><h1>Work Permits for Individuals <img src=work_permit.jpg width=400 height=7></h1> If you are an INDIVIDUAL and have a valid visa to stay in the UK, you may have been granted a <a href=../students/index.asp>Student visa,</a> Working Holidaymaker visa, <a href=../individuals/segs.asp>Science and Engineering Graduate Scheme</a> (SEGS) or be a dependant of your partner who is settled in the UK; we will advise you on whether this application can be made successfully and whether you can switch status whilst in the UK.<p><table cellpadding=0 cellspacing=1 border=0 bgcolor=#82205c><tr><td><table cellpadding=0 cellspacing=5 border=0 bgcolor=#f1e9ef><tr><td valign=top><img src=../pics/open_quotes.gif width=13 height=18 alt></td><td style="padding: 6px 0 6px 0 "><p>I won my case at the AIT Asylum and Immigration Tribunal and I can now carry on with my studies. I am very pleased with their (PERMITS2WORK) efforts, cooperation and hard work. </p></td><td valign=bottom><img src=../pics/close_quotes.gif width=13 height=18 alt></td></tr></table></td></tr></table><br><div align=right><strong>Successful applicant</strong><br> March 2007 </div><br> If you are not based in the UK, yet have an offer of employment from a UK Employer, we can still act on your behalf, managing the work permit application with your employer and ensuring that you stand the best chance for success. Please <a href=../contact/index.asp>contact us </a> for a <a href=../assessments/individuals.asp>FREE ASSESMENT</a>.<p><h1>Work Permits for Employers <img src=work_permit.jpg width=400 height=7></h1> For those EMPLOYERS who need permission to employ that key member of staff, we provide full advice and guidance throughout the whole work permit process, completing all of the relevant paperwork and advocating to the Home Office on your behalf.<p><table cellpadding=0 cellspacing=1 border=0 bgcolor=#82205c><tr><td><table cellpadding=0 cellspacing=5 border=0 bgcolor=#f1e9ef><tr><td valign=top><img src=../pics/open_quotes.gif width=13 height=18 alt></td><td style="padding: 6px 0 6px 0 "><p>Over the two years that I have been using the services of PERMITS2WORK I have found them to be consistently efficient friendly and accessible, from their high level of service I would estimate that they are experts in the area which they operate in and, as such highly recommended.</p></td><td valign=bottom><img src=../pics/close_quotes.gif width=13 height=18 alt></td></tr></table></td></tr></table><br><div align=right><strong>L. Thompson,</strong>Managing Director<br> March 2007 </div><br> The position does not have to be recognised shortage occupation to qualify for a UK Work Permit, yet you do need to demonstrate that it requires skills and/or qualifications to meet the scheme. Please <a href=../contact/index.asp>contact us </a> for a <a href=../assessments/employers.asp>FREE ASSESSMENT</a>.<p><img src=work_permit.jpg width=400 height=7><strong>PERMITS2WORK</strong> will take care of you whether you are an individual who needs a UK work permit, a manager who needs help to manage the work permit case or a Human Resource team that does not know where to begin, 83% of our clients are referrals from satisfied<b> clients delighted with the high level of service we offer.</p><p>For more information on our UK Work Permits please <a href=../contact/index.asp>contact us </a>.</b><p align=center><b>PERMITS2WORK is registered with the <a href=http://www.oisc.gov.uk/ >Office of the Immigration Standards Commissioner</a> at the highest level.</b></p></td><td width=202 valign=top><br><!--contact box start--><table width=202 cellpadding=0 cellspacing=0 border=0 align=right><tr><td valign=middle colspan=3 background=pics/purp_top.gif class=whitetext height=36> &nbsp; Contact Us</td></tr><tr><td background=pics/pixel_purp.gif><img src=pics/pixel.gif width=1 height=1></td><td width=200><table width=100% cellpadding=5 cellspacing=0 border=0 class=contactdetails><tr><td valign=middle class=large colspan=2>Head Office</td></tr><tr><td valign=middle class=details>Tel: 01793 836 010<br><p><span class=small>outside UK</span><br> +44(0) 1793 836 010</p></td><td valign=middle align=right><img src=pics/icon_tel.gif width=44 height=44 border=0 alt></td></tr><tr><td valign=middle class=details>Fax: 01793 832 790</td><td valign=middle align=right><img src=pics/icon_fax.gif width=44 height=44 border=0 alt></td></tr><tr><td valign=middle class=large colspan=2>London Office</td></tr><tr><td valign=middle class=details>Tel: 0844 800 8037<br><p><span class=small>outside UK</span><br> +44(0) 207 637 4676</p></td><td valign=middle align=right><img src=pics/icon_tel.gif width=44 height=44 border=0 alt></td></tr><tr><td valign=middle class=details>Fax: 020 7990 8422</td><td valign=middle align=right><img src=pics/icon_fax.gif width=44 height=44 border=0 alt></td></tr><tr><td valign=middle colspan=2 class=large>Email</td></tr><tr><td valign=middle class=details colspan=2><a href=mailto:enquiries@permits2work.com>enquiries@permits2work.com</a></td></tr></table></td><td background=pics/pixel_purp.gif><img src=pics/pixel.gif width=1 height=1 border=0 alt></td></tr><tr><td valign=top colspan=3><img src=pics/purp_bott2.gif width=202 height=14 border=0 alt></td></tr></table><!--contact box ends--><!--news box starts--><br clear=all><p><table width=202 cellpadding=0 cellspacing=0 border=0><tr><td valign=middle colspan=3 background=pics/purp_top.gif class=whitetext height=36> &nbsp; Latest News</td></tr><tr><td background=pics/pixel_purp.gif><img src=pics/pixel.gif width=1 height=1></td><td width=200><table width=100% cellpadding=5 cellspacing=0 border=0><tr><td valign=middle class=newstext><strong>Introduction of language and citizenship knowledge testing for settlement</strong><br><br>From Monday 2 April 2007 anyone applying to permanently settle in the UK will need to provide evidence of Knowledge of the English Language and of Life in the UK (as those applying for British Citizenship are already obliged to do). <p align=right><a href="news/detail.asp?news=Introduction+of+language+and+citizenship+knowledge+testing+for+settlement">MORE</a> &gt; &nbsp; </td></tr></table></td><td background=pics/pixel_purp.gif><img src=pics/pixel.gif width=1 height=1 border=0 alt></td></tr><tr><td valign=top colspan=3><img src=pics/purp_bott.gif width=202 height=30 border=0 alt></td></tr></table><!--news box ends--></td></tr></table></td></tr><tr><td valign=top><table width=780 cellpadding=0 cellspacing=0 border=0><tr><td valign=top width=33% class=contactboxsml align=center><br><!--individuals box starts--><a href=assessments/individuals.asp>FREE ASSESSMENTS FOR <br>WORK PERMITS</a><br><table width=225 cellpadding=0 cellspacing=0 border=0><tr><td valign=middle background=pics/bg_individ.gif class=whitetext width=225 height=60> &nbsp; For Individuals<br>&nbsp;</td></tr><tr><td width=225><table width=100% cellpadding=5 cellspacing=0 border=0><tr><td valign=middle class=contactboxsmllite background=pics/bg_individ2.gif align=right><img align=left src=pics/pixel.gif width=1 height=83>Click here to complete<br> the following form<br>online.<br><a href=assessments/individuals.asp><img src=pics/pixel.gif width=50 height=25 border=0 alt="free work permit assessments - for individuals"></a></td></tr></table></td></tr></table><!--individuals box ends--></td><td valign=top width=33% class=contactboxsml align=center><br><!--employers box starts--><a href=assessments/employers.asp>FREE WORK PERMIT<br>ASSESSMENTS</a><br><table width=225 cellpadding=0 cellspacing=0 border=0><tr><td valign=middle background=pics/bg_emp.gif class=whitetext width=225 height=60> &nbsp; For Employers<br>&nbsp;</td></tr><tr><td width=225><table width=100% cellpadding=5 cellspacing=0 border=0><tr><td valign=middle class=contactboxsmllite background=pics/bg_emp2.gif align=right><img align=left src=pics/pixel.gif width=1 height=83>Click here to complete<br> the following form<br>online.<br><a href=assessments/employers.asp><img src=pics/pixel.gif width=50 height=25 border=0 alt="free work permit assessments - for employers"></a></td></tr></table></td></tr></table><!--employers box ends--></td><td valign=top width=33% class=contactboxsml align=center><br><!-- hsmp box starts--><a href=assessments/hsmp.asp>HIGHLY SKILLED MIGRANT<br>PROGRAMME (HSMP) ASSESSMENTS</a><br><table width=225 cellpadding=0 cellspacing=0 border=0><tr><td valign=middle background=pics/bg_hsmp.gif class=whitetext width=225 height=60> &nbsp; HSMP<br>&nbsp;</td></tr><tr><td width=225><table width=100% cellpadding=5 cellspacing=0 border=0><tr><td valign=middle class=contactboxsmllite background=pics/bg_hsmp2.gif align=right><img align=left src=pics/pixel.gif width=1 height=83>Click here to complete<br> the following form<br>online.<br><a href=assessments/hsmp.asp><img src=pics/pixel.gif width=50 height=25 border=0 alt="highly skilled migrant programme assessments"></a></td></tr></table></td></tr></table><!-- hsmp box ends--></td></tr></table></td></tr><tr><td align=center class=footerlinks><a href=permits/index.htm>Permits 2 Work</a> | <a href=individuals/index.asp>Individuals</a> | <a href=employers/index.asp>Employers</a> | <a href=permit/extensions.htm>Permit Extensions</a> | <a href=immigration/status.asp>Immigration</a> | <a href=professions/accountants.htm>Professions</a> | <a href=hsmp/index.htm>HSMP</a> | <a href=actions/preparation.htm>Actions</a> | <a href=testimonials/index.htm>Testimonials</a><br><a href=contact/index.asp>Contact</a> | <a href=news/index.asp>News</a> | <a href=sitemap/index.asp>Site Map</a><br>&nbsp;</td></tr></table></td></tr></table><!-- Google Analytics Code Starts --><script src=http://www.google-analytics.com/urchin.js type=text/javascript>
