oducts" width=113 height=40 border=0 id=Image14 onmouseover="MM_swapImage('Image14','','images/btnNewProducts2.gif',1)" onmouseout=MM_swapImgRestore()></a></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=180 align=center valign=top background=images/left1.jpg bgcolor=#464646 style="background-position: top left; background-repeat: no-repeat;"><br><br><table width=140 border=0 align=center cellpadding=0 cellspacing=0><tr><td width=140 height=25><a href=http://www.phmotorcycles.co.uk/ onmouseover="MM_swapImage('Image1','','images/btnHome2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnHome2.gif alt=Home name=Image1 width=140 height=25 border=0 id=Image1></a></td></tr><tr><td width=140 height=24><a href=about-us.html onmouseover="MM_swapImage('Image2','','images/btnAboutUs2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnAboutUs.gif alt="About Us" name=Image2 width=140 height=24 border=0 id=Image2></a></td></tr><tr><td width=140 height=24><a href=news-events.html onmouseover="MM_swapImage('Image3','','images/btnNewsEvents2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnNewsEvents.gif alt="News & Events" name=Image3 width=140 height=24 border=0 id=Image3></a></td></tr><tr><td width=140 height=24><a href=training.html onmouseover="MM_swapImage('Image4','','images/btnTraining2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnTraining.gif alt=Training name=Image4 width=140 height=24 border=0 id=Image4></a></td></tr><tr><td width=140 height=24><a href=finance.html onmouseover="MM_swapImage('Image51','','images/btnFinance2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnFinance.gif alt=Finance name=Image51 width=140 height=24 border=0 id=Image51></a></td></tr><tr><td width=140 height=24><a href=insurance.html onmouseover="MM_swapImage('Image5','','images/btnInsurance2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnInsurance.gif alt=Insurance name=Image5 width=140 height=24 border=0 id=Image5></a></td></tr><tr><td width=140 height=24><a href=workshop.html onmouseover="MM_swapImage('Image6','','images/btnWorkshop2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnWorkshop.gif alt=Workshop name=Image6 width=140 height=24 border=0 id=Image6></a></td></tr><tr><td width=140 height=24><a href=useful-links.html onmouseover="MM_swapImage('Image7','','images/btnUsefulLinks2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnUsefulLinks.gif alt="Useful Links" name=Image7 width=140 height=24 border=0 id=Image7></a></td></tr><tr><td width=140 height=24><a href=contact-us.html onmouseover="MM_swapImage('Image8','','images/btnContactUs2.gif',1)" onmouseout=MM_swapImgRestore()><img src=images/btnContactUs.gif alt="Contact Us" name=Image8 width=140 height=24 border=0 id=Image8></a></td></tr></table> </td><td valign=top background=images/background.jpg style="background-position: top left; background-repeat: no-repeat;"><table width=100% height=500 border=0 cellpadding=0 cellspacing=0><tr><td height=20>&nbsp;</td><td height=20>&nbsp;</td></tr><tr><td width=20 valign=bottom><img src=images/corner.gif alt width=20 height=20></td><td valign=top><p align=center><span class=title>Welcome to P&amp;H Motorcycles<br> 01293 413300 </span></p><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=190 align=left valign=top><p><img src=images/crawley.jpg alt="Crawley Showroom" width=180 height=109 border=1><br> Our Crawley Showroom </p><p><img src=images/ducati.jpg alt="Ducati Display" width=180 height=109 border=1><br> Crawley Again! </p><p><img src=images/paul-sean-award.jpg alt="Dealer of the Year Award" width=180 height=141 border=1><br> MCN Dealer of the Year Award</p><p><img src=images/new-bike-ad.gif alt="Special Offer" width=180 height=156 border=1> </p></td><td align=left valign=top><p><strong>Welcome to P&amp;H Motorcycle dealers, proud winners of MCN's 'Dealer of The Year Award for More than one outlet' 2005.</strong></p><p>As you take a look through our site you'll learn about the motorbikes, accessories, parts, clothing and services we offer, and what P&amp;H Motorcycles is all about. Established over 20 years ago, P&amp;H motorcycle dealers have been steadily growing ever since. During this time we have developed a large and loyal customer base and we're proud to be able to say that a vast majority of these customers come back time after time for motorbikes, motorcycle parts, accessories and advice.</p><p>In fact when you visit us, you'll see for yourself just how friendly and welcoming we are, and this is why quite a few of our customers are now friends who frequently pop in to catch up and wonder around aimlessly dreaming about their next bike, what extra clothing they might need or how they can add to their existing motorbike.</p><p>P&amp;H Motorcycles is the South East's largest official Multi-franchise motorcycle dealership for <a href=bikes/suzuki.html>Suzuki motorcycles</a>, <a href=bikes/honda.html>Honda motorcycles</a>, <a href=bikes/kawasaki.html>Kawasaki motorcycles</a>, <a href=bikes/yamaha.html>Yamaha motorcycles, </a><a href=bikes/ducati.html>Ducati motorcycles and Keeway Sym Scooters </a>. We stock both new and used motorbikes and scooters and have a fantastic selection of shiny new 2007 models.</p><p>We have a huge fleet of <a href=demonstrations.html>demonstrators</a> available for you to try out before you make that all important decision, so keep checking the site for updates of the new range, or call us on 01293 413300. As quoted by industry professionals &quot;P&amp;H Motorcycles has one of the best showrooms we've seen and is one of the most professional motorcycle dealers in the country!&quot;</p><p>You won't believe it until you see it, but our <a href=clothing.html>motorcycle clothing department</a> is without a doubt the best you'll find for miles around, with a new Dainese Pro-store. And to make life just that little bit easier for you, we've started to develop our own online shop. When the website is finished you'll be able to order everything from Dainese clothing and protection, to Sidi or Shoei helmets and Oxtar boots, without even leaving the comfort of your chair. Motorcycle accessories and parts will also be available to buy online.</p><p>Many people are not aware that we also have our own on-site <a href=training.html>motorcycle training school</a>. ART Motorcycle Training has been around almost as long as P&amp;H and most of our training customers come to us through recommendations. Having worked closely with 'The MCIA' the training school offers everything from CBT's through to Advanced Training. Whether you're hopping on that motorcycle for the first time or just need a jump start, ART can offer tailor made packages to suit all levels or riding abilities.</p><p>Well this is just an insight into the world of P&amp;H Motorcycle dealers. You'll find out much more about the training school and everything else we offer as you look through the site. We do hope you find the site enjoyable, informative, and packed with a comprehensive range of motorbikes, but should you have any comments, please don't hesitate to email them to us at <a href=mailto:info@phmotorcycles.co.uk>info@phmotorcycles.co.uk</a>, as we are always looking for ways to improve the site.</p><p><strong>P&amp;H Motorcycles - your local motorcycle dealer!</strong><br><br></p></td></tr><tr><td align=left valign=top>&nbsp;</td><td align=left valign=top>&nbsp;</td></tr></table></td></tr></table></td><td width=20 valign=bottom background=images/background-right2.jpg style="background-position: top left; background-repeat: no-repeat;"><img src=images/corner2.gif alt width=20 height=20></td><td width=180 align=center valign=top background=images/background-right3.jpg bgcolor=#CCCCCC style="background-position: top left; background-repeat: no-repeat;"><p><a href=dealer-of-year.html><img src=images/dealer-of-the-year.gif alt="Dear of the Year 2005" width=180 height=116 border=0></a><a href=custom-paint-specials.html><img src=images/paint-specials.gif alt="Custom Paint Specials" width=180 height=110 border=0></a><br><br><a href=bikes/ducati.html onclick="dmclick=1;"><img src=images/new-ducati-models.gif alt="Ducati - New 2007 Models" width=160 height=98 border=0></a><br><br><a href=bikes/kawasaki.html onclick="dmclick=1;"><img src=images/new-kawasaki-models.gif alt="Kawasaki - New 2007 Models" width=160 height=98 border=0></a><br><br><a href=bikes/honda.html onclick="dmclick=1;"><img src=images/new-honda-models.gif alt="Honda - New 2007 Models" width=160 height=98 border=0></a><br><br><a href=bikes/yamaha.html onclick="dmclick=1;"><img src=images/new-suzuki-models.gif alt="Suzuki - New 2007 Models" width=160 height=98 border=0></a><br><br><a href=bikes/yamaha.html onclick="dmclick=1;"><img src=images/new-yamaha-models.gif alt="Yamaha - New 2007 Models" width=160 height=98 border=0></a></p> </td></tr><tr bgcolor=#4764A0><td height=30 align=center valign=middle><a href=sitemap.html class=white>Site Map </a></td><td height=30 colspan=2 align=center valign=middle class=white style="background-position: top left; background-repeat: no-repeat;"><img src=images/copyright.gif alt=Copyright width=196 height=10></td><td height=30 style="background-position: top left; background-repeat: no-repeat;">&nbsp;</td></tr></table><map name=Map><area shape=rect coords=70,41,158,67 href=bikes/yamaha.html alt=Yamaha><area shape=rect coords=164,41,271,68 href=bikes/kawasaki.html alt=Kawasaki><area shape=rect coords=0,70,111,104 href=bikes/honda.html alt=Honda><area shape=rect coords=120,70,238,111 href=bikes/suzuki.html alt=Suzuki><area shape=rect coords=245,72,383,120 href=bikes/ducati.html alt=Ducati></map></body>",nonspam

