</div></div>--><!-- ############# Left Column ########### --><div id=left_container><!-- ############# Left Column Search########### --><div id=navBar_home><div id=navBar_titles><h2>&nbsp;Search this site</h2></div><div id=search><form method=get action=http://www.google.com/custom><input type=text name=q size=10 maxlength=255 value><input type=submit name=btnG value=Go><input type=hidden name=safe value=vss><input type=hidden name=cof value=L:http://www.bfwhospitals.nhs.uk/images/home/bfwhosp.gif;LW:450;LH:66;AH:left;GL:0;GIMP:#FF0000;GFNT:#CCCCCC;LC:#0065c6;ALC:#0065c6;VLC:#0065c6;><input type=hidden name=domains value=www.blackpool-victoria.nhs.uk><input type=hidden name=sitesearch value=www.blackpool-victoria.nhs.uk checked></form></div></div><!-- ############# Left Column Current ########### --><div id=navBar_home><div id=navBar_titles><h2>&nbsp;Health Library </h2></div><div id=navBar_text><p><font face=Arial size=2>Library staff have launched new web pages on the Trust Internet to facilitate wider access to library services and the knowledge base, for all staff working across the Fylde Coast.<br><br> Please <a href=mailto:library.services@bfwhospitals.nhs.uk>email</a> any comments to the library.<br><br><a href=departments/library/index.htm>Visit the new pages here </a></font></p></div></div><div id=navBar_home><div id=navBar_titles><h2>&nbsp;Equality&nbsp;and Diversity <br></h2></div><div id=navBar_text><p><font face=Arial size=2>Details of our scheme can be found <a href=departments/equality/index.htm>here.</a></font></p></div></div><div id=navBar_home><div id=navBar_titles><h2>&nbsp;Travel</h2></div><div id=navBar_text><p><font face=Arial size=2>We have added a new section to our site to designed to help patients and visitors with travelling to and from Blackpool Victoria Hospital.<br><a href=departments/travel/index.htm>Visit the Travel Section</a></font></p></div></div><div id=navBar_home><div id=navBar_titles><h2>&nbsp;Freedom of <br> &nbsp;Information</h2></div><div id=navBar_text><p><img src=foi/images/Logo_English_gif_colour_small%20.gif width=55 height=55><br> Find out about the <strong>Freedom of Information Act</strong> and view our <a href=foi/index.htm>Publication Scheme</a>.</p></div></div></div><!-- ############# Section Navigation Ends ########### --><!-- ############# Latest News ########### --><div id=right_container><div id=headlines><div id=headlines_titles><h2>Trust News</h2></div><div id=headlines_pad><p><a href="../../docs/press_pr/2007/notice of elections for council of governors.pdf">Notice of Election for the Council of Governors of Blackpool, Fylde and Wyre Hospitals NHS Trust</a></p><p><a href="../../docs/press_pr/2007/Press release - FT consultation meetings 3rd Jan 07.pdf">Blackpool Victoria Hospital Unveils Plans to Become Specialist Bowel Screening Unit</a></p><p> <a href="docs/press_pr/2007/Opening of the sim man suite.pdf"> Launch of the Gillian Noblett Sim-man Suite</a></p><p> <a href="docs/press_pr/2007/New Orthopaedic Facilities_Final.pdf"> New Orthopaedic Facilities for Blackpool Victoria Hospital</a></p><p><strong>To view all previous news stories visit the <a href=departments/pr/index.htm>Communications</a> pages</strong></p><p>&nbsp;</p></div></div><br><br><div id=headlines><div id=headlines_titles><h2>Final Public Declaration</h2></div><div id=headlines_pad><p><img src=images/home/healthcare_commission.gif width=144 height=59><br> View the Trusts <a href=docs/hcc/final_declaration07.pdf>final declaration </a> of our performance against the Governments Standards for Better Health core and developmental standards</p></div></div><!-- ############# Right Features ########### --></div><!-- ############# Main Page Content ########### --><div id=content><div class=feature><h3>Welcome to Blackpool, Fylde and Wyre Hospitals NHS Trust</h3><p><br></p><div class=floatright_medium><img src=images/foundation/future.jpg alt="External View of the new Cardiac Centre" width=200 height=159></div><h4>Consultation on becoming an NHS Foundation Trust </h4><p>Blackpool, Fylde and Wyre Hospitals NHS Trust has been consulting the public on its plans to become a 'Foundation Trust'. &nbsp;<a href=foundation_consultation/index.htm>This site</a> explains what that means, the benefits and how you can get involved to help us improve what we do.</p><div style=clear:both><div class=floatright_medium><img src=images/foundation/ballot.gif alt="ballot box" width=200 height=160></div></div><h4>Notice of Election for The Council of Governors </h4><p>Notice is being given that elections will be held for the Council of Governors of Blackpool, Fylde and Wyre Hospitals NHS Trust..<a href=foundation_consultation/role.htm>find out more</a></p><h4>Apply to Become a Member</h4><p>You can apply either: </p><ul><li><a href=http://www.nhs-membership.co.uk/BKP>online</a> or</li><li><a href=foundation_consultation/membership_form.pdf class=pdf_link>by post </a><br></li></ul><div style=clear:both><div class=floatright_medium><img src=images/home/stopsmoking.gif alt="NHS Stop Smoking service telephone 0845 601 2186" width=200 height=122></div></div><h4>We have gone Smoke Free</h4><p>All Trust Premises on the Fylde Coast, including the grounds and car parks, are now smoke free. This is in line with a Government initiative which affects all NHS premises across the country. If you would like help or advice on how to stop smoking please contact the Blackpool, Fylde and Wyre Stop Smoking Service on <strong>0845 601 2186</strong></p><p><a href="docs/about/smoke_free/SRP-1790 - BVH Smoke Free Policy (v2) indd.pdf">Your Guide To Blackpool, Fylde and Wyre Hospitals NHS Trust Smoke Free Policy </a></p><!-- Start of StatCounter Code --><script type=text/javascript language=javascript>
