<![endif]--><div id=aboutme><h1>About Me</h1><p>My name is James Hamilton, I'm a third year <a href=http://en.wikipedia.org/wiki/Computer_Science target=_blank>Computer Science</a> student at <a href=http://www.goldsmiths.ac.uk target=_blank>Goldsmiths College</a>, <a href=http://london.ac.uk target=_blank>University of London</a>. </p><p> I work part-time as a webmaster <a href=http://carshaltonboys.org target=_blank>Carshalton Boys Sports College</a>, a secondary school in <a href=http://en.wikipedia.org/wiki/Surrey>Surrey</a>. <br> I also do freelance web-programming work currently working on <a href=http://functionpix.com>functionpix.com</a>, and previoulsy co-worked on an internal project for <a href=http://en.wikipedia.org/wiki/Saatchi_and_Saatchi target=_blank>Saatchi &amp; Saatchi</a> and developed <a href=http://kalms-associates.com/ target=_blank>Kalms-Associates.com</a> for a local IT support company. The main scripting language I use is PHP, along with MySQL or PostgreSQL for a backend database. I also use Flash, mainly focussing on the ActionScript side of things, Fireworks for web graphics and Vi for text editing on Linux/TextPad for text-editing on Windows. </p><p> I have been interested in computing since I was young starting out with old computers obtained from car-boot sales - my first computer was an <a href=http://en.wikipedia.org/wiki/Amstrad_CPC target=_blank>Amstrad CPC464</a>. </p><p><a href=/CV.html title="James Hamilton CV">Read my CV</a> here and <a href=contact.php title="Contact James Hamilton">Contact Me</a> here </p></div><div id=php><h1>PHP Stuff</h1> Find some useful <a href=http://en.wikipedia.org/wiki/PHP title=PHP target=_blank><acronym title="Hypertext PreProcessor">PHP</acronym></a> <a href=/php/index.php title="php tips, code and ideas">tips, code and ideas here</a>. <strong>Latest:</strong> <a href=/php/shop/ title="PHP Shopping Cart Tutorial Using Sessions">PHP Shopping Cart</a></div><div id=news><h1>News Feeds</h1><a href=http://whoyouknow.co.uk/index.php/news_feeds/ title="news feeds from bbc to slashdot">Read Some News Here</a>. XML Feeds, From BBC to Slashdot. </div><div id=currentprojects><h1>Current Projects</h1><div id=ants><h2>Ants - Computer Science Project</h2> My BSc computer science project - simulating ant behaviour and investigating the uses of this behaviour including shortest path algorithms. <br><a href=/ants/ title="Ants: BSc Computer Science Project">Go to Ants: BSc Computer Science Project</a><p><a name=video_29Food-PheromoneTrailWithDirectionAndSort></a><div><p id=player1 align=center><a href=http://www.macromedia.com/go/getflashplayer>Get the Flash Player</a> to see this player.</p><p style=text-align:center;> Video 1 - A demonstration of the ant simulator with 29 food squares using directed pheromone trails and strength. </p></div><script type=text/javascript>
		var FO = {	movie:"/flvplayer.swf",width:"408",height:"410",majorversion:"7",build:"0",bgcolor:"#FFFFFF",
					flashvars:"file=/ants/videos/29Food-PheromoneTrailsWithDirectionAndSort.flv&showdigits=true&showicons=true&autostart=false&showfsbutton=true&repeat=true" };
		UFO.create(	FO, "player1");
	</script></p></div><div id=datamining><h2>Data Mining</h2> I'm currently taking a <a href=http://en.wikipedia.org/wiki/Data_Mining target=_blank>Data Mining</a> course as part of my degree. Here is some <a href=uni/datamining/index.php title="data mining examples in php">data mining examples in PHP</a>. </div><div id=semantictagging><h2>Semantic Tagging</h2> I am currently working on a <a href=/st/ title=semantic:tagging>semantic tagging</a> solution for <a href=http://functionpix.com target=_blank>functionpix.com</a></div><div id=vle><h2>Virtual Learning - eHomework</h2> Another project I'm working on, at <a href=http://carshaltonboys.org target=_blank>Carshalton Boys Sports College</a> where I am part-time webmaster, is online homework. </div></div><div id=previousprojects style><h1>Previous Projects</h1><div><h2>Java</h2><div><a name=previous_pojects-java-audioplayer></a><h3>Audio Player</h3><a href=uni/java/MediaPlayer/screenshot.gif><img alt="Audio Player Screenshot" src=uni/java/MediaPlayer/tn_screenshot.gif align=bottom></a><br> A Java audio player based on the basic player library from <a href=http://javazoom.net target=_blank>javazoom.net</a>. Features include mp3 playback, play/pause/stop/previous/next/seek/volume controls, m3u playlist management, album art, ID3 tag display/editing, different views. <a href=uni/java/MediaPlayer/dist.zip>Download (zip including jar and libs)</a>, <a href=uni/java/MediaPlayer/src.zip>Source</a>. </div><div><a name=previous_pojects-java-solitaire></a><h3>Solitaire</h3><a href=uni/java/Sol/screenshot.gif><img alt="Solitaire Screenshot" src=uni/java/Sol/tn_screenshot.gif align=bottom></a><br> An implementation based on Microsoft Windows Solitaire. Only allows one card to be moved at a time. This was my first java program (apart from little Hello World type programs) - I decided to write this program while I was in the first year, as it was a second year coursework and the first year java course was pretty dull! I draw the suit symbols using <a href=http://en.wikipedia.org/wiki/The_GIMP target=_blank>The GIMP</a> (Jack, King, Queen don't yet have pictures). <br>I learnt a lot about programming, 2D graphics programming (e.g. at first dragging cards created lots of flickering - until I learnt about <a href=http://en.wikipedia.org/wiki/Double_Buffering target=_blank>Double Buffering</a>!) and Java by writing this game. <br><a href=uni/java/Sol/applet.html target=_blank>Go To Solitaire Applet</a> &nbsp;<a href=uni/java/Sol/src.zip>Download Source</a></div><div><a name=previous_pojects-java-robot></a><h3>Robot</h3> A virtual robot implementation using a UDP based communication protocol. A control program runs on one computer and a robot simulation runs on another. Implements a basic parser to parse commands to send to the robot. <a href=uni/java/Robot/src.zip>Download Source</a>. </div><div><a name=previous_pojects-java-spaceinvaders></a><h3>Space Invaders</h3><a href=uni/java/SpaceInvaders/screenshot.gif><img alt="Space Invaders Screenshot" src=uni/java/SpaceInvaders/tn_screenshot.gif align=bottom></a><br> What to do after I wrote Solitaire? First year Java work? Or maybe create a version of the classic <a href=http://en.wikipedia.org/wiki/Space_Invaders target=_blank>Space Invaders</a>. After writing Solitaire I wrote this simple game. I used the 2D graphics knowledge gained from writing Solitaire and learnt more about programming in Java for example Threads from writing this game. <br><br> The Rules: shoot the aliens, before they reach the bottom or shoot you three times. The aliens speed up as the move closer to the bottom, the bonus space craft occassionaly moves across the top and is worth more points. <br><br> I created the alien and explosion graphics in <a href=http://en.wikipedia.org/wiki/The_GIMP target=_blank>The GIMP</a>. <br><br><a href=uni/java/SpaceInvaders/ target=_blank>Go To SpaceInvaders Applet</a> &nbsp;<a href=uni/java/SpaceInvaders/src.zip>Download Source</a></div><div><a name=previous_pojects-java-breakout></a><h3>Breakout</h3><a href=uni/java/Breakout/screenshot.gif><img alt="Breakout Screenshot" src=uni/java/Breakout/tn_screenshot.gif align=bottom></a><br> You'd think that by the time I'd created Solitaire and Breakout, the first year Java course would've have started to get interesting. Well, it didn't so I made <a href=http://en.wikipedia.org/wiki/Breakout target=_blank>Breakout</a>. There is a bug in the game that I didn't get around to fixing - the ball can go throught the side of the bricks. <br><br> There are several kinds of bricks - some have to be hit twice to destroy them (yellow), some once (blue), some can't be destroyed (orange). <br><br> There are some secret controls that were to be removed when the game was finished: press S to go to the next level (only 2 levels), A to go to the preivous level, M to reverse the mouse direction, - to decrease mouse speed, + to increase mouse speed. <br><br><a href=uni/java/Breakout/dist/ target=_blank>Go To Breakout Applet</a> &nbsp;<a href=uni/java/Breakout/src.zip>Download Source</a></div><div><a name=previous_pojects-java-lettercount></a><h3>Letter Count</h3><a href=uni/java/LetterCount/screenshot.gif><img alt="Letter Count Screenshot" src=uni/java/LetterCount/tn_screenshot.gif align=bottom></a><br> This is an example of one the 2nd term, 1st year assignments. The specification was to create a command line program to load a file and count the letters - pretty boring stuff. So I made a graphical version. It's prettier. <br><br><a href=uni/java/LetterCount/dist/LetterCount.jar>Download Jar</a> &nbsp;<a href=uni/java/LetterCount/src.zip>Download Source</a></div><div><a name=previous_projects-java-diary></a><h3>Diary</h3><a href=uni/java/diary/diary.gif><img alt="Diary Screenshot" src=uni/java/diary/tn_diary.gif align=bottom></a><br> This is the other of the 2nd term, 1st year assignments. The specification was to create a command line diary program. I made a graphical version again. I learnt a lot about Java Swing by doing the application, as well as programming techniques such as the <a href=http://en.wikipedia.org/wiki/Singleton_pattern target=_blank>Singleton Pattern</a>. <br><br><a href=uni/java/diary/Diary.jar>Download Jar</a> &nbsp;<a href=uni/java/diary/src.zip>Download Source</a></div></div><div id=datacompression><h2>Data Compression</h2> I've just completed a <a href=http://whoyouknow.co.uk/uni/datacompression/ >data compression course</a> as part my of BSc Computer Science Degree. <div id=lzw><h3>LZW</h3><a href=/uni/datacompression/lzw.php title="LZW implementation in php"> Checkout my implementation of LZW in php. </a></div></div></div><div id=somewebsites><h1>Some websites that I have developed</h1><div id=current><h2>Current</h2><ul><li><a href=http://www.functionpix.com target=_blank>functionpix.com</a><ul><li>Took over development of this site in August 2006, much of it needed re-writing and there was a lot still to implement</li><li>Main technologies used include <ul><li><a href=http://en.wikipedia.org/wiki/PHP title=PHP target=_blank><acronym title="Hypertext PreProcessor">PHP</acronym></a>, <a href=http://en.wikipedia.org/wiki/MySQL title=MySQL target=_blank>MySQL</a>, <a href=http://en.wikipedia.org/wiki/HTML title=HTML target=_blank><acronym title="HyperText Markup Language">HTML</acronym></a>, <a href=http://en.wikipedia.org/wiki/CSS title=CSS target=_blank><acronym title="Cascading Style Sheets">CSS</acronym></a></li><li><a href=http://en.wikipedia.org/wiki/GD_Graphics_Library title="GD Image Library" target=_blank>GD Image Library</a> for image resizing and effects (B/W etc)</li><li><a href=http://en.wikipedia.org/wiki/RSS title=RSS target=_blank><acronym title="Really Simple Syndication">RSS</acronym></a> and <a href=http://en.wikipedia.org/wiki/XML title=XML target=_blank><acronym title="eXtensible Markup Language">XML</acronym></a> for data interchange</li><li>Integrated and customised Openads adserver</li><li>Flash Uploader for uploading multiple images</li><li>AJAX techniques for forms and UI effects (e.g. registration page, newsletter signup, article voting) using the prototype and script.aculo.us JavaScript libraries</li><li>FCKEditor for article submission</li><li>Currently working on a <a href=/st/ title="semantic tagging" target=_blank>semantic tagging</a> solution for image searching and retrieval</li><li>Statistics of site usage e.g. for contributors scores, views, sales, distribution of profits to contributors</li></ul></li></ul></li><li><a href=http://viewdo.com title=viewdo.com target=_blank>viewdo.com</a><ul><li>I offered my services after finding a security flaw in their download script.</li><li>Have been advising, making suggestions and implementing certain features</li></ul></li><li><a href=http://carshaltonboys.org target=_blank>Carshalton Boys Sports College</a><ul><li>I created this website from scratch using PHP and a PostgreSQL database.</li><li>I also set up and now maintain the Linux RHEL server that it runs on</li><li>I learnt a lot about programming, databases and specifically PHP and PostgreSQL from this site</li></ul></li></ul></div><div id=completed><h2>Completed</h2><ul><li><a href=http://kalms-associates.com target=_blank>Kalms Associates</a><ul><li>Simple web site built with Dreamweaver and Photoshop</li></ul></li></ul></div><div id=old><h3>Some old websites</h3><ul><li>My first real website: <a href=http://quote.whoyouknow.co.uk>The Quote Database</a>. Checkout <a href=http://quote.whoyouknow.co.uk/Bourkes_Big_eBook_of_Quotes.pdf> Bourke's Big Book of Quotes </a> for the story behind whoyouknow.co.uk <ul><li>This helped to start learning PHP and database design/implemenation with MySQL.</li></ul></li></ul></div></div><div id=links><h1>Links</h1><div id=useful><h2>Software</h2><div id=development><h3>Development</h3><div id=web><h4>Web</h4><ul><li><a href=http://capxous.com/ target=_blank>capxous type-ahead (auto-suggestion) javascript library</a> - This is brilliant, look at the their demos. Better than <a href=http://developer.yahoo.com/yui/autocomplete/ target=_blank>Yahoo UI</a> and <a href=http://demo.script.aculo.us/ajax/autocompleter_customized target=_blank>script.aculo.us</a> (The script.aculo.us animation library is cool though). It is based on the javascript <a href=http://prototype.conio.net/ target=_blank>prototype</a> library. Downside - it's not open-source, although it can be used free of charge but must display the 'Powered by...' until a license is purchased at a cost of USD 399. </li><li>Screen video capture and FLV video <ul><li>Capture screen videos with <a href=http://www.zdsoft.com/ target=_blank>ZD Soft Screen Recorder</a> - Free download, 5 minutes capture limit.</li><li>Convert to FLV with <a href="http://www.rivavx.com/index.php?downloads&L=3" target=_blank>Riva FLV Encoder</a> (based on <a href=http://en.wikipedia.org/wiki/FFmpeg target=_blank>FFmpeg</a>) - free.</li><li>Embed in webpage with <a href="http://www.jeroenwijering.com/?item=Flash_Video_Player" target=_blank>FLV Player</a></li></ul></li></ul></div></div><div id=applications><h3>Applications</h3><ul><li><script type=text/javascript><!--
