	</script></div><div class=fpbody><div style="width: 680px; margin: 0 auto; padding: 10px;"><table cellpadding=0 cellspacing=0 border=0 style="width: 100%;"><tr><td valign=top colspan=2><div class=SectionHeadR style="width: 330px;">Latest News</div></td><td width=10></td><td valign=top colspan=2><div class=SectionHeadR style="width: 330px;">Spotlight</div></td></tr><tr><td valign=top><div style="width: 130px;"><a href=/Products/Presto2.shtml><img src=img/Home_Presto.jpg alt="Presto 2" width=127 height=127 hspace=0 vspace=0 border=0 title></a></div></td><td valign=top><div style="width: 200px;"><h3 class=head>Flash creation made easy</h3><p><a href=/products/Presto2.shtml>Presto 2</a> is simply the easiest way to create unique Flash effects for your website or multimedia project. Over 325 effects, many unlike anything you've seen anywhere else so you can really stand out from the crowd!</p></div></td><td></td><td valign=top><div style="width: 130px;"><a href=/Showcase/Comm_SudokuSolitaire.shtml><img src=/img/Home_SudokuSolitaire.jpg alt="Sudoku Solitaire" width=127 height=127 hspace=0 vspace=0 border=0 title></a></div></td><td valign=top><div style="width: 200px;"><h3 class=head>Sudoku Solitaire</h3><p>A variation on the puzzle craze using colours instead of numbers - less like maths and more like fun!</p><p>Available to try and buy direct from Digital Workshop. For full details, see our <a href=/Showcase/Comm_SudokuSolitaire.shtml>Sudoku Solitaire</a> page.</p></div></td></tr></table><table cellpadding=0 cellspacing=0 border=0 style="width: 100%;"><tr><td valign=top><div id=sidenav style="width: 140px; margin: 0 auto;"><div class=title style="margin: 0;">products</div><img src=images/prodicon.png alt="multimedia authoring tools product list" width=134 height=35 hspace=0 vspace=0 title><p class=fpstrap>We specialise in highly cost-effective multimedia authoring tools and web animation software optimised for a wide range of users.</p><ul style="margin-bottom: 0"><li><