</style><script type=text/javascript src=http://www.blogger.com/widgets/3545907050-widgets.js></script></head><body><div class="navbar section" id=navbar><div class="widget Navbar" id=Navbar1> <iframe src="http://www.blogger.com/navbar.g?targetBlogID=11783188&blogName=The+Cats+Tripe&publishMode=PUBLISH_MODE_HOSTED&navbarType=SILVER&layoutType=LAYOUTS&homepageUrl=http%3A%2F%2Fwww.catstripe.co.uk%2F&searchRoot=http%3A%2F%2Fwww.catstripe.co.uk%2Fsearch" height=30px width=100% marginwidth=0 marginheight=0 scrolling=no id=navbar-iframe frameborder=0></iframe> <div id=space-for-ie></div> </div></div><div id=outer-wrapper><div id=header-wrapper><div class="header section" id=header><div class="widget Header" id=Header1><div id=header-inner><div class=titlewrapper><h1 class=title> The Cats Tripe </h1></div><div class=descriptionwrapper><p class=description><span>What's left after the Cat is gone</span></p></div></div></div></div></div><div id=main-wrap1><div id=main-wrap2><div class="main section" id=main><div class="widget Blog" id=Blog1><div class=blog-posts><!-- google_ad_section_start --><h2 class=date-header>Friday, April 27, 2007</h2><div class="post uncustomized-post-template"><a name=6038369426441125626></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/04/ballinamore-advertiser.html>The Ballinamore Advertiser</a></h3><div class=post-header-line-1></div><div class=post-body><p>This is going to read like a cross between a tourist leaflet and a free newspaper... sorry. I made the trip to Ireland.<br><br><a href=http://www.flickr.com/photos/thecatofstripes/97209223/ title="House for Sale"><img src=http://farm1.static.flickr.com/19/97209223_07f0a9eb7b.jpg width=400 alt="From the road"></a><br><br>The purpose of the journey was to place the house with a local estate agent, something we've been planning to do for nearly two years now. Finally achieving that goal is coming close to breaking my heart.<br><br>This dear old house is not in the best of health but it's given us several years of happy holidays and rural isolation in a very beautiful if poor part of the country. Returning after over a year away was like coming home again and although to anyone else the few pieces of furniture and fittings left behind will look like rubbish of the lowest value each scrap represents some effort or memory that will be lost forever when the place is sold. I cried for half an hour before I locked up and came away and will cry again when we make the final visit to complete the sale.<br><br>However, we can't be in two places at once and trying to be in three is insane. Better we part with our old dream and allow someone else to enjoy all that quiet loveliness on the mountain side.<br><br>The house can be viewed by appointment with <a href="http://www.ghproperty.com/index.cfm?fuseaction=propdetails&Prop_RefId=163">Gordon Hughes Estate Agents</a> in Ballinamore. It is listed as a 4 bedroom, 2 reception room country house with mains electricity, telephone connection (although we've never had it enabled) and septic tank in need of complete renovation on approx. 2 acres of land with meadow and mature trees. Water is through a private scheme piped from the mountain and heating is by open fire and an antique range (in need of immediate conservation). Nearest neighbour is approx. half a mile away, the local village with church and shop about 1.5 miles and Ballinamore with supermarkets, pubs and banks about 5 miles. Local activities include mountain walking, fishing, golf and horse riding. Time from Dublin about 2.75 hours by car. Price 150,000 euros ($204,000, &#163;102,000 at today's exchange). You can contact me for further details by leaving a comment to this post and I will get back to you by email.<br><br><a href=http://www.flickr.com/photos/thecatofstripes/474641499/ title=outbuilding><img src=http://farm1.static.flickr.com/222/474641499_31e14aba1b.jpg width=400 alt=slot></a></p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/04/ballinamore-advertiser.html title="permanent link">4/27/2007 04:27:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=6038369426441125626" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=6038369426441125626" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/Co.%20Cavan rel=tag>Co. Cavan</a>, <a href=http://www.catstripe.co.uk/search/label/holiday%20home rel=tag>holiday home</a>, <a href=http://www.catstripe.co.uk/search/label/house%20for%20sale rel=tag>house for sale</a>, <a href=http://www.catstripe.co.uk/search/label/Ireland rel=tag>Ireland</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Sunday, April 22, 2007</h2><div class="post uncustomized-post-template"><a name=8774862321505544023></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/04/kiss-me-quick.html>Kiss me quick</a></h3><div class=post-header-line-1></div><div class=post-body><p>This is a picture of something most of us regard as a little bit special, mystical, magical, historical and rather unusual. <br><br><a href=http://www.flickr.com/photos/thecatofstripes/468343992/ title="Photo Sharing"><img src=http://farm1.static.flickr.com/205/468343992_67646f05f3_o.jpg width=400 alt=parasite></a><br><br><a href=http://www.botanical.com/botanical/mgmh/m/mistle40.html>Mistletoe</a> has long been regarded as something out of the ordinary, beloved of druids, touched by the gods and holding significance in many cultures. Our orchard is swamped with the stuff. Some of the trees are so infested that in the winter they still appear green, as if fully leaved from a distance but the truth is they are covered with this pernicious and ultimately destroying parasite which slow sucks the strength from the branches until there is none left for further growth and the tree dies.<br><br><a href=http://www.flickr.com/photos/65724059@N00/ title="Paul's photos"><img src=http://farm1.static.flickr.com/229/460683007_0f36525ce6.jpg width=400 alt="mistletoe berry"></a><br><br>It starts innocuously enough. A bird wipes a sticky berry from its beak onto rough bark and leaves a primed seed stuck on the branch ready to sink a connection into the living tree. In a year or two great bunches of clear green growth have developed, flowers and berries form and the process is repeated.<br><br>When we first arrived and found the extent of the problem we blithely imagined we'd have a couple of years profit flogging it off at farmers' markets at xmas but it hasn't worked out like that and the decision has been made, no matter what the cost in loss of druidic karma (you what!?!), to operate a zero tolerance policy and remove it as completely as we can to give our poor trees some chance to grow and prosper.<br><br>It's not that easy to remove. Although individual branchlets are brittle and easy to snap off where the mistletoe joins the branch the fusion, presumably managed by the mistletoe, forms a large and fully integrated 'root' that must be sawn through. We have yet to discover if the part left behind is capable of regrowth but we fear it will be. The trees are full sized, grown on their own roots or strong rootstocks to make tall specimens capable of withstanding poor conditions and the depredations of deer and cattle. Because of this getting to the upper branches to clear the infestations is almost impossible. In some cases all we can do is prune out entire branches at a lower level to take the parasite out at the same time.<br><br>A long task ahead and in an area where mistletoe is endemic a never ending one. Anyone needing a sprig for xmas, please come and pick your own.<br><br><a href=http://www.flickr.com/photos/65724059@N00/ title="Paul's photos"><img src=http://farm1.static.flickr.com/220/460683013_66b5c60b1f.jpg width=400 alt="mistletoe berry"></a></p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/04/kiss-me-quick.html title="permanent link">4/22/2007 02:53:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=8774862321505544023" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=8774862321505544023" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/apple%20tree%20pests rel=tag>apple tree pests</a>, <a href=http://www.catstripe.co.uk/search/label/druids rel=tag>druids</a>, <a href=http://www.catstripe.co.uk/search/label/mistletoe rel=tag>mistletoe</a>, <a href=http://www.catstripe.co.uk/search/label/parasite rel=tag>parasite</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Thursday, April 19, 2007</h2><div class="post uncustomized-post-template"><a name=8588424881165830195></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/04/feral.html>Feral</a></h3><div class=post-header-line-1></div><div class=post-body><p>Several times during the last year we have spotted a tabby cat in the yard and roaming among the buildings. Given the quantities of rodents about the place we've been rather pleased to see it - our old cat can really only catch a vole if it runs into his jaws, something we have actually observed, voles are that stupid, but it doesn't happen often - and because the stranger seemed solitary and somewhat aloof, refusing scraps left out last summer we concluded that it was a male. This is no bad thing, feral cats in rural France are pandemic and queens can produce more than one litter in a year. The deleterious effect on wildlife is considerable and besides too many cats lead to starving, disease ridden creatures who perish miserably in the cold winters.<br><br><a href=http://www.flickr.com/photos/65724059@N00/ title="Paul's photos"><img src=http://farm1.static.flickr.com/247/460672454_8a35a11811.jpg width=400 alt="cats' mother"></a><br><br>However, this spring, on an exploration of barns and outbuildings Paul had never visited, we chanced upon a darling nest of kittens.<br><br><a href=http://www.flickr.com/photos/65724059@N00/ title="Paul's photos"><img src=http://farm1.static.flickr.com/216/460672436_319a625201.jpg width=400 alt=kittens></a><br><br>Absolutely adorable and completely alone when we spotted them, we tried not to disturb the beautiful babies but were unable to stop ourselves going back for another look the next day. This time the mother cat was there, our familiar tabby 'boy'. She didn't like the look of us and retired to the rafters of the barn. Next time we went to look the kittens were gone.<br><br>We didn't try to search them out, but left Bagheera's scraps in a bowl near where we had first spotted them. This time the food was found acceptable, feeding four growing kittens leaves little room for feline pride and besides, Bagheera's food is <em>always</em> of the best even if he doesn't find it good enough.<br><br>However, it raises some questions; now we have five cats on the farm we shall have to take steps to stop uncontrolled breeding. There is birth control for cats, medication that can be put in food if the cats are hungry enough to eat it but it's a very hit and miss process. Far better to catch the cats and have them neutered but that will be no easy task either. It's going to be a problem, but I must say I do love to see cats about the place and wish them well.</p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/04/feral.html title="permanent link">4/19/2007 10:02:00 AM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=8588424881165830195" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=8588424881165830195" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/cats%20%20kittens rel=tag>cats kittens</a>, <a href=http://www.catstripe.co.uk/search/label/contraception%20for%20cats rel=tag>contraception for cats</a>, <a href=http://www.catstripe.co.uk/search/label/domestic rel=tag>domestic</a>, <a href=http://www.catstripe.co.uk/search/label/feral rel=tag>feral</a>, <a href=http://www.catstripe.co.uk/search/label/wild rel=tag>wild</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Saturday, April 14, 2007</h2><div class="post uncustomized-post-template"><a name=2292617458468378684></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/04/tree-felling.html>Tree Felling</a></h3><div class=post-header-line-1></div><div class=post-body><p>At the back of the house there was a huge out of control leylandii conifer which cast a tremendous shadow across the back of the garden...we decided it had to go.<br><br><a href=http://www.flickr.com/photos/thecatofstripes/459680617/ title="Photo Sharing"><img src=http://farm1.static.flickr.com/184/459680617_2bd979907d_m.jpg width=180 height=240 alt="Felling a tree"></a><a href=http://www.flickr.com/photos/thecatofstripes/459680619/ title="Photo Sharing"><img src=http://farm1.static.flickr.com/218/459680619_6ebc474820_m.jpg width=180 height=240 alt="Up a tree"></a><br><br>The pictures can't really give a true impression of the size of the tree (but you can see another one here on <a href=http://www.flickr.com/photos/65724059@N00/460566368/ >Paul's stream</a>) or of its closeness to the buildings. There was only about a 25 degree sector where it could be felled without taking the back garden fence, the straining wires for the kitchen chimney stack, the new woodshed, the bakehouse or the main house with it. When Paul went up to clear the lower branches so that we could get a rope around the trunk to help control the direction of fall he discovered the main trunk split in two about half way up and the whole tree leaned backwards from the way we wanted it to fall and towards the house.<br><br>We began to worry a bit as there were only the two of us there and I don't do chainsaws. Paul would have to do the cutting and I would have to the pulling, his task requiring finesse and mine brute strength. Ah. Only one of us is multiskilled in that way!<br><br>Some head scratching later and a plan was formed to take one fork of the trunk first to reduce the weight of the whole to a manageable proportion. We cleaned the bole of ivy and attached a rope to the part furthest away from the house.<br><br>It worked like a dream, Paul made the cuts and with a gentle tug the quite considerable trunk fell exactly where we had intended. So far, so good.<br><br>However, with that bit out of the way the tilt backwards was even more apparent and we began to wonder if removing the first side had made our task even more difficult by unbalancing the load unfavourably. Fifteen metres of solid conifer crashing through the roof of the house would have ruined our holiday rather so a great deal depended on getting the angle of cut correct and the tension on the rope firm enough to offset the weight of the trunk at the critical moment when the final cut was made.<br><br>Paul cleaned off a lot of branches to reduce the burden and then, with me hanging grimly on to the rope, we started the felling. We were so concerned that the thing would just snap before the third cut was made I had to keep tension up during the whole procedure but the rope was slippy and kept tightening around my hands uncomfortably. <br><br>At the tree end Paul was anxiously eyeing his angles for the wedge cut and trimming out small sections to ensure that nothing went wrong. Then he went for the last attack. A straight cut through from the back of the trunk to the top of his wedge cut.<br><br>I hung on for dear life and just as he reached the end of the stroke I thought we'd lost it. The whole tree rocked backwards, dangerously swaying in the direction of the house. Holding on as hard as I could it was only possible to steady it in a upright position. Paul dropped the saw and came running, at some risk to his life as he passed beneath the expected dropping place of the tree and grabbed the rope. A mighty pull and everything was alright again. The tree fell, neatly on top of the previous cut and disaster averted.<br><br>Phew.</p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/04/tree-felling.html title="permanent link">4/14/2007 02:15:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=2292617458468378684" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=2292617458468378684" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/lumberjacks rel=tag>lumberjacks</a>, <a href=http://www.catstripe.co.uk/search/label/tree%20felling rel=tag>tree felling</a>, <a href=http://www.catstripe.co.uk/search/label/woodcraft rel=tag>woodcraft</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Wednesday, April 11, 2007</h2><div class="post uncustomized-post-template"><a name=1051134559601377324></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/04/first-swallow.html>First Swallow</a></h3><div class=post-header-line-1></div><div class=post-body><p>has been spotted in Normandy. We've been there over Easter but a slight issue with connectivity has meant no posts or email until we got back. Today, in fact.<br><br>More to follow soon...</p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/04/first-swallow.html title="permanent link">4/11/2007 03:24:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=1051134559601377324" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=1051134559601377324" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/notice%20of%20absence rel=tag>notice of absence</a>, <a href=http://www.catstripe.co.uk/search/label/out%20of%20office rel=tag>out of office</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Friday, March 30, 2007</h2><div class="post uncustomized-post-template"><a name=7159049857538033771></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/03/now-thats-just-silly.html>Now that's just silly</a></h3><div class=post-header-line-1></div><div class=post-body><p><table width=145><tr><td align=center bgcolor=#FFFFFF style="border: 2px solid #006600;color:#ffffff;padding-top:5px;padding-bottom:5px;"> <p style="font-size:15px;font-family:Georgia,Serif;color:#000000;font-weight: bold;"><br> I am a<br>Snapdragon <a href=http://www.thisgardenisillegal.com/flower-quiz.htm style=font-size:15px;font-family:Georgia,Serif;color:#0000FF;><br> <br><img src=http://thisgardenisillegal.com/quiz/snapdragon.jpg width=140 height=200 border=0><br>What Flower <br>Are You?</a><br><br> </td></tr></table></p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/03/now-thats-just-silly.html title="permanent link">3/30/2007 10:18:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=7159049857538033771" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=7159049857538033771" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><h2 class=date-header>Wednesday, March 28, 2007</h2><div class="post uncustomized-post-template"><a name=1310161049403872050></a><h3 class=post-title><a href=http://www.catstripe.co.uk/2007/03/oh-yes-this-blog-is-about.html>Oh yes, this blog is about</a></h3><div class=post-header-line-1></div><div class=post-body><p>france, gardening, self sufficiency and plants.<br><br><a href=http://www.flickr.com/photos/thecatofstripes/434951175/ title="Mixed young plants"><img src=http://farm1.static.flickr.com/186/434951175_2a7363465f.jpg width=400 alt=youngplants></a><br><br>So I won't dive into a rant about the provision of mental health services in the UK, just note in passing that if anything would drive one mad that would be it.<br><br>And back to the main event!<br><br>The picture above shows the chinese artichokes, the eddoes and some babington leeks. If you can't work out which is which click on the picture and go to the flickr stream which has notes on it. <br><br>The babington leeks are older plants lifted from the allotment last autumn. It's taken them a couple of years to develop this leek shaped character but now it's possible to see why they have the name. I would eat these in the interests of research but think I'll take them with us next time we cross the channel and see if they are as attractive to deer as the real thing.<br><br>We also have several more thongs of horseradish to plant out and jerusalem artichokes potted in the autumn which have not yet shown themselves.<br><br>Tomorrow I must start making lists for packing, starting with the cat and all his paraphernlia. Watch this space for the next thrilling installment!</p><div style="clear: both;"></div></div><div class=post-footer><p class="post-footer-line post-footer-line-1"><span class=post-author> Posted by M </span><span class=post-timestamp> at <a class=timestamp-link href=http://www.catstripe.co.uk/2007/03/oh-yes-this-blog-is-about.html title="permanent link">3/28/2007 05:07:00 PM</a></span><span class=post-comment-link><a class=comment-link href="http://www.blogger.com/comment.g?blogID=11783188&postID=1310161049403872050" onclick>0 comments</a></span><span class="post-backlinks post-comment-link"></span><span class=post-icons><span class="item-control blog-admin pid-609898243"><a href="http://www.blogger.com/post-edit.g?blogID=11783188&postID=1310161049403872050" title="Edit Post"><span class=quick-edit-icon>&#160;</span></a></span></span></p><p class="post-footer-line post-footer-line-2"><span class=post-labels> Labels: <a href=http://www.catstripe.co.uk/search/label/babington%20leek rel=tag>babington leek</a>, <a href=http://www.catstripe.co.uk/search/label/chinese%20artichokes rel=tag>chinese artichokes</a>, <a href=http://www.catstripe.co.uk/search/label/eddoes rel=tag>eddoes</a>, <a href=http://www.catstripe.co.uk/search/label/horse%20radish rel=tag>horse radish</a></span></p><p class="post-footer-line post-footer-line-3"></p></div></div><!-- google_ad_section_end --></div><div class=blog-pager id=blog-pager><span id=blog-pager-older-link><a class=blog-pager-older-link href="http://www.catstripe.co.uk/search?updated-max=2007-03-28T17%3A07%3A00%2B01%3A00&max-results=7" id=Blog1_blog-pager-older-link title="Older Posts">Older Posts</a></span></div><div class=clear></div><div class=blog-feeds><div class=feed-links> Subscribe to: <a class=feed-link href=http://www.catstripe.co.uk/feeds/posts/default target=_blank type=application/atom+xml>Posts (Atom)</a></div></div></div></div></div></div><div id=sidebar-wrap><div id=sidebartop-wrap><div id=sidebartop-wrap2><div class="sidebar section" id=sidebartop><div class="widget HTML" id=HTML4><div class=widget-content><!-- Google CSE Search Box Begins  --><form id=searchbox_017