cafe,royal mile food,eating in edinburgh,eating out edinburgh,coffee,scottish recipes,royal mile cafes,edinburgh castle,hogmanay in Scotland,cafe on the royal mile,edinburghs royal mile,edinburgh festival"><meta name=description content="When eating out in Edinburgh, the Deacons House Cafe is a perfect place 
to stop for a bite to eat on your visit to the famous Royal Mile."><style type=text/css>
