</style></head><body bgcolor=#990000 text=#000000 link=#990000 vlink=#9C0000 alink=#9C0000><br><table width=795 border=0 cellpadding=0 cellspacing=0 align=center><tr><td colspan=10><img src=images/heading_maroon.gif width=633 height=57 name=heading_maroon.jpg align=middle alt="deacons house cafe"></td></tr><tr valign=top background=images/index_centre.jpg><td height=426 class=table colspan=10><table width=40% border=0 cellpadding=20 cellspacing=0><tr><td><div id=scroller><span class=text><p>When eating out in Edinburgh, The Deacon's House Cafe - which is situated on the famous Royal Mile - is a perfect place to stop for morning coffee, lunch, afternoon tea or a cold beer and sandwich.</p><p>An excellent selection of locally made cakes and freshly baked scones is available every day. We aim to use fresh local produce whenever possible and our menu features a range of home made soups, freshly prepared salads and sandwiches (smoked salmon is the favourite!) with an excellent selection of home baking and puddings.</p><p>Our coffee is praised by visitors from all over the world and our very special Deacon Brodies cocoa made with hot chocolate and whisky is probably the best you'll taste during your visit to Scotland!</p><p>We open from Monday to Sunday 9am - early evening. (Later during the Edinburgh Festival).</p></span></div></td></tr></table></td></tr><tr><td><img src=images/home_open_maroon.gif width=77 height=106 alt=key></td><td><a href=the_cafe.htm><img src=images/thecafe_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href=menu.htm><img src=images/menu_shut_maroon.gif width=77 height=106 border=0 alt="food key"></a></td><td><a href=find_us.htm><img src=images/findus_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href=deacon_brodie.htm><img src=images/deaconbrodie_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href=royal_mile.htm><img src=images/royalmile_shut_maroon.gif width=77 height=106 border=0 alt="royal mile key"></a></td><td><a href=contact.htm><img src=images/contact_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href="http://www.deaconshouse.co.uk/guestbook/list.php?page=1&order=desc"><img src=images/guestbook_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href=links.htm><img src=images/links_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td><td><a href=weddings.htm><img src=images/weddings_shut_maroon.gif width=77 height=106 border=0 alt=key></a></td></tr></table></body>",nonspam

