</style></head><body bgcolor=#81bc42 leftmargin=0 topmargin=0 marginwidth=0 marginheight=0 onload="MM_preloadImages('imagery/farm-animal-rescue-gifts-merchandise/calendar_over.gif','imagery/farm-animal-rescue-gifts-merchandise/clothing_over.gif','imagery/farm-animal-rescue-gifts-merchandise/christmas-cards_over.gif','imagery/farm-animal-rescue-gifts-merchandise/shopping-centre_over.gif')"><table width=100% height=100% border=0 cellpadding=0 cellspacing=0><tr><td height=200 colspan=3 align=center> <table width=779 border=0 cellpadding=0 cellspacing=0 bgcolor=#3C7300><tr align=center><td height=15 colspan=2> <h1>Farm Animal Rescue Sanctuary UK&nbsp;&nbsp;farm animal adoption&nbsp;&nbsp;pig adoption&nbsp;&nbsp;sheep adoption&nbsp;&nbsp;ram / ewe adoption&nbsp;&nbsp;bullock adoption&nbsp;&nbsp;adopt an animal UK</h1></td></tr><tr><td width=143 align=center valign=top><a href=http://www.farmanimalrescue.org.uk><img src=imagery/farm-animal-rescue-sanctuary-logo.gif alt="Farm Animal Rescue Sanctuary" width=135 height=129 border=0></a><br><a href=farm-animal-rescue-sanctuary-contact.htm><br><br><img src=imagery/contactus.gif alt="Contact Us" width=67 height=12 border=0></a></td><td align=right valign=top> <object classid=clsid:D27CDB6E-AE6D-11cf-96B8-444553540000 codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width=636 height=185><param name=movie value=imagery/navi/buttons.swf><param name=quality value=high><embed src=imagery/navi/buttons.swf quality=high pluginspage=http://www.macromedia.com/go/getflashplayer type=application/x-shockwave-flash width=636 height=185></object></td></tr></table></td></tr><tr><td align=center valign=top>&nbsp;</td><td width=779 align=center valign=top><table width=779 border=0 cellpadding=0 cellspacing=0 bgcolor=#3C7300><tr><td width=86% valign=top> <table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=112 align=center background=imagery/adoption-bar-background.gif class=animal-adoption-top><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=19&name=Madeleine"><img src=imagery/farm-animal-rescue-sanctuary-animals/madeline-ewe-thumb.jpg alt="Read about Madeleine - Ewe" width=91 height=70 hspace=2 vspace=2 border=0></a></td><td height=82 background=imagery/adoption-bar-background.gif class=animal-adoption-top>Hello! I am Madeleine. Please <a title="Adopt a bullock" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=19&name=Madeleine" class=animal-adoption-link>adopt me</a>, or maybe you can <a href=farm-animal-rescue-sanctuary-adoption.htm class=animal-adoption-link>donate</a> me some pocket money? <a title="Farm Animals for adoption" href=farm-animal-rescue-sanctuary-animals.asp class=animal-adoption-link>Take a look at all my adoption friends.</a></td></tr></table><h2>Welcome to Farm Animal Rescue Sanctuary</h2><p><strong>Animal Adoptions make a great gift!</strong><br> We have a number of great characters available for <a href=farm-animal-rescue-sanctuary-animals.asp class=farmanimal-link>adoption</a>. Read about our newest adoption animal below.<br><br><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=19&name=Madeleine"><img src=imagery/madeline-ewe.jpg alt="Read about Madeleine - Ewe" width=195 height=150 hspace=2 vspace=2 border=0 align=right></a><strong>Madeleine</strong><br> Madeleine and her 3 lambs were found lying in squalor. Madeleine tried her best to look after the 3 lambs even in these wretched conditions. When asked about them the farmer replied that all 4 would be sent to slaughter that afternoon. <a href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=19&name=Madeleine" class=farmanimal-link>Read more about Madeleine</a>.</p><p>&nbsp;</p><div align=center> </div><p><a href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=14&name=Carlos"><img src=imagery/farm-animals-gallery/babe-pig-001.jpg alt="Carlos the Pig - Adopt me today!" width=208 height=162 hspace=3 border=0 align=left></a><strong>Farm Animal Rescue Sanctuary</strong>, based in Warwickshire (Shakespeare country), is a wonderful animal sanctuary, housing more than 750 farm animals. <br><br> You can help Farm Animal Rescue Sanctuary by <a title="Adopt a sheep, adopt a pig, adopt a cow" href=farm-animal-rescue-sanctuary-animals.asp class=farmanimal-link>adopting one of our animals</a> including the <strong>adopt a sheep</strong> scheme, <strong>adopt a pig</strong> scheme and <strong>adopt a cow</strong> scheme.<br><br><br><br><object classid=clsid:D27CDB6E-AE6D-11cf-96B8-444553540000 codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width=128 height=96 align=right><param name=movie value=imagery/carlos-adopt-a-pig.swf><param name=quality value=high><embed src=imagery/carlos-adopt-a-pig.swf width=128 height=96 align=right quality=high pluginspage=http://www.macromedia.com/go/getflashplayer type=application/x-shockwave-flash></object> Some have escaped the horrendous &quot;Live Export Trade&quot;. These animals have suffered a lot and they deserve the peace they now enjoy. Creatures which are too often dismissed as stupid and worthless show remarkable intelligence and gentleness once you've dispelled their fear. <a title="Farm Animal Rescue animals" href=farm-animal-rescue-sanctuary-animals.asp class=farmanimal-link>See the great characters at Farm Animal Rescue Sanctuary</a>.</p><p> <br><strong><a href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=10&name=June"><img src=imagery/farm-animal-rescue-sanctuary-animals/june-ewe-thumb.jpg alt="Read about June - Ewe" width=91 height=70 hspace=2 vspace=2 border=0 align=right></a></strong> However, costs are high and without continued financial support the future of the animals is uncertain. All time is volunteered, no wages to pay, no offices to maintain - every penny goes to our animals to feed, shelter and to provide medical care. <br><br><strong>Farm Animal Rescue Sanctuary's</strong> most important TARGET must be to secure a monthly income. <a title="Make a donation to Farm Animal Rescue" href=farm-animal-rescue-sanctuary-adoption.htm class=farmanimal-link>Make a donation to Farm Animal Rescue Sanctuary</a>. </p><br><br><table width=510 align=center cellpadding=3 cellspacing=0 bordercolor=#FFFFFF><tr><td><h3>Animals for Adoption</h3><br> Why not adopt one of our wonderful Animals? Not only will you receive an information pack, inlcluding photographs, and updates you will also help to secure the future of our sanctuary! Take a look below at the animals that are available for adoption. <br><br> We have <strong>sheep adoption</strong> schemes, <strong>pig adoption</strong> schemes and <strong>cow adoption</strong> schemes.</td></tr></table><table width=510 border=1 align=center cellpadding=3 cellspacing=0 bordercolor=#FFFFFF><tr><td bgcolor=#57a900><a title="Adopt a pig" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=2&name=Babe"><img src=imagery/farm-animal-rescue-sanctuary-animals/babe-pig-thumb.jpg alt="Read about Babe - Pig" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=9&name=Basher"><img src=imagery/farm-animal-rescue-sanctuary-animals/basher-ram-thumb.jpg alt="Read about Basher - Ram" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=8&name=Blossom"><img src=imagery/farm-animal-rescue-sanctuary-animals/blossom-ewe-thumb.jpg alt="Read about Blossom - Ewe" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a pig" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=14&name=Carlos"><img src=imagery/farm-animal-rescue-sanctuary-animals/carlos-pig-thumb.jpg alt="Read about Carlos - Pig" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a bullock" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=4&name=Gromit"><img src=imagery/farm-animal-rescue-sanctuary-animals/gromit-bullock-thumb.jpg alt="Read about Gromit - Bullock" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=10&name=June"><img src=imagery/farm-animal-rescue-sanctuary-animals/june-ewe-thumb.jpg alt="Read about June - Ewe" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=16&name=Pepper"><img src=imagery/farm-animal-rescue-sanctuary-animals/pepper-ram-thumb.jpg alt="Read about Pepper - Ram" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a cow" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=17&name=Rhona"><img src=imagery/farm-animal-rescue-sanctuary-animals/rhona-cow-thumb.jpg alt="Read about Rhona - Cow" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=18&name=Rhubarb"><img src=imagery/farm-animal-rescue-sanctuary-animals/rhubarb-ram-thumb.jpg alt="Read about Rhubarb - Ram" width=91 height=70 hspace=2 vspace=2 border=0></a><a title="Adopt a sheep" href="http://www.farmanimalrescue.org.uk/animal_detail.asp?id=19&name=Madeleine"><img src=imagery/farm-animal-rescue-sanctuary-animals/madeline-ewe-thumb.jpg alt="Read about Madeleine - Ewe" width=91 height=70 hspace=2 vspace=2 border=0></a></td></tr></table><br><p><img src=imagery/farm-animals-gallery/valentine-ram-001.jpg alt width=208 height=162 hspace=5 align=right><h3>Farm Animal Cruelty</h3><p>Whether they be exhausted cull ewes that have been forced to breed beyond any capacity that nature intended, or animals badly injured due to careless and rapid loading of terrified sheep on to ill designed transporters. A lucky few have found their way to Farm Animal Rescue Sanctuary but the unfortunate majority are left to cope. For as the need for profit increases so mans' compassion lessens and the victims continue to suffer.</p><p><strong>Farm Animal Rescue Sanctuary's</strong> costs are very high and we have to rely upon a sympathetic public to fund the sanctuary. Our membership is small but their loyalty is unmatched. Thus we have produced this calendar in the hope that our gentle and very stoic animals will win many new friends who will adopt them and care about them. </p><br> <table width=90% align=center cellpadding=3 cellspacing=0 bordercolor=#FFFFFF><tr><td height=296> <h3>Gifts and Merchandise</h3><table width=100% border=0 cellpadding=3 cellspacing=0 class=box><tr><td width=49%><a href=farm-animal-rescue-sanctuary-merchandise.asp><img src=imagery/farm-animal-rescue-gifts-merchandise/calendar-farm-animal-rescue.jpg alt="Farm Animal Rescue calendars" width=249 height=200 border=0></a></td><td width=51%><a href=farm-animal-rescue-sanctuary-merchandise.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('calendar','','imagery/farm-animal-rescue-gifts-merchandise/calendar_over.gif',1)"><img src=imagery/farm-animal-rescue-gifts-merchandise/calendar.gif name=calendar width=145 height=24 vspace=6 border=0></a><br><a href=farm-animal-rescue-sanctuary-merchandise.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('clothing','','imagery/farm-animal-rescue-gifts-merchandise/clothing_over.gif',1)"><img src=imagery/farm-animal-rescue-gifts-merchandise/clothing.gif name=clothing width=105 height=28 vspace=3 border=0></a><br> <a href=farm-animal-rescue-sanctuary-merchandise.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('xmas','','imagery/farm-animal-rescue-gifts-merchandise/christmas-cards_over.gif',1)"><img src=imagery/farm-animal-rescue-gifts-merchandise/christmas-cards.gif alt=# name=xmas width=191 height=28 vspace=3 border=0></a><br><a href=farm-animal-rescue-sanctuary-merchandise.asp onmouseout=MM_swapImgRestore() onmouseover="MM_swapImage('centre',