k'; return true" onmouseout="window.status='Done'; return true"><img style="float: right; padding-left: 50px;" src=http://www.afcyhf.com/image-1776916-10402692 width=120 height=600 alt="Make Census of your family history" border=0></a><h2>What's New</h2><p>Added some new ones to the <a href="./?page=postcards">postcards page</a>.<br><span style="font-size: 80%;">2007.-0.1- @ 06. 1</span> </p><p>My <a href="http://www.londoncemeteries.co.uk/?c=16">Abney Park photos</a> have appeared on <a href=http://www.darkromance.com/dr-bod/dr-bod-0806/dr-bod-080620-abney_cemetery.html>Dark Romance</a>: it's a must-visit for lovers of all things gothic. <br><span style="font-size: 80%;">2006.-0.8- @ 28. 2</span> </p><p>Added new photographs to <a href="./?c=14&p=55#pic">Kensal Green</a>. <br><span style="font-size: 80%;">2006.-0.2- @ 09. 1</span> </p><p>Added new galleries for <a href="./?c=129">Eastbrookend Cemetery</a> and <a href="./?c=130">Northwood Cemetery</a>. <br><span style="font-size: 80%;">2006.-0.2- @ 09. 1</span> </p><p>Added new galleries for <a href="./?c=126">East Ham Jewish Cemetery</a> and <a href="./?c=127">Rippleside Cemetery</a>, which latter adds the grave of <a href="./?c=127&p=11#pic">Mr Soul</a> to that of <a href="./?c=48&p=4#pic">Mr Body</a> and <a href="./?c=129&p=1#pic">Mr Death</a>. <br><span style="font-size: 80%;">2005.-1.2- @ 09. 1</span> </p><p>Added new gallery for <a href="./?c=128">Romford Cemetery</a>, which would have been very pretty, if the markers that have been laid flat had been made safe instead. <br><span style="font-size: 80%;">2005.-1.2- @ 08. 1</span> </p><br><br><p><a href="./?page=new">What used to be new</a> </p><br><br><script type=text/javascript src="http://ss.webring.com/navbar?f=j;y=londoncems;u=defurl">
