</style></head><body style="margin: 0px;"><div id=top><a href=index.php><img border=0 src=blacktitle.jpg></a><div style="position: absolute; top: 10px; right: 10px;"><a href=./ class=breadcrumbs>Home</a> &gt;&gt; New </div></div><div id=nav><ul style="display: inline; list-style-type: none;"><li class=nav><a href="./?page=list">List all cemeteries</a> </li><li class=nav><a href="./?page=links">Links</a> </li><li class=nav><a href=blog.php>Weblog</a> </li><li class=nav><a href="./?page=postcards">Postcards</a> </li><li class=nav><a href=books.php>Books</a> </li><li class=nav><a href="./?page=faqs">About</a> </li></ul></div><div id=main style="background: #fff; padding: 20px;"><div id=main><p>Added some new ones to the <a href="./?page=postcards">postcards page</a>.<br><span style="font-size: 80%;">2007.-0.1- @ 06. 1</span> </p><p>My <a href="http://www.londoncemeteries.co.uk/?c=16">Abney Park photos</a> have appeared on <a href=http://www.darkromance.com/dr-bod/dr-bod-0806/dr-bod-080620-abney_cemetery.html>Dark Romance</a>: it's a must-visit for lovers of all things gothic. <br><span style="font-size: 80%;">2006.-0.8- @ 28. 2</span> </p><p>Added new photographs to <a href="./?c=14&p=55#pic">Kensal Green</a>. <br><span style="font-size: 80%;">2006.-0.2- @ 09. 1</span> </p><p>Added new galleries for <a href="./?c=129">Eastbrookend Cemetery</a> and <a href="./?c=130">Northwood Cemetery</a>. <br><span style="font-size: 80%;">2006.-0.2- @ 09. 1</span> </p><p>Added new galleries for <a href="./?c=126">East Ham Jewish Cemetery</a> and <a href="./?c=127">Rippleside Cemetery</a>, which latter adds the grave of <a href="./?c=127&p=11#pic">Mr Soul</a> to that of <a href="./?c=48&p=4#pic">Mr Body</a> and <a href="./?c=129&p=1#pic">Mr Death</a>. <br><span style="font-size: 80%;">2005.-1.2- @ 09. 1</span> </p><p>Added new gallery for <a href="./?c=128">Romford Cemetery</a>, which would have been very pretty, if the markers that have been laid flat had been made safe instead. <br><span style="font-size: 80%;">2005.-1.2- @ 08. 1</span> </p><p>Added new gallery for <a href="./?c=140">North Watford Cemetery</a>, which was a fantastic place. <br><span style="font-size: 80%;">2005.-1.2- @ 03. 1</span> </p><p>Added links to Multimap for all the cemeteries, from the <a href="./?page=list">list</a> and individual pages. <br><span style="font-size: 80%;">2005.-1.1- @ 25. 0</span> </p><p>Added a new section for my <a href="./?page=postcards">comic postcards featuring cemeteries</a>. <br><span style="font-size: 80%;">2005.-1.1- @ 23. 2</span> </p><p>Sadly, today I have cancelled the Creative Commons license <a href=http://creativecommons.org/licenses/by-nc-sa/2.5/ >which</a> used to apply to this site. </p><p>After various people taking photographs without acknowledgement and then telling me CC means they're allowed to (<a href=http://creativecommons.org/faq#What_happens_if_someone_misuses_my_Creative_Commons-licensed_work?>it doesn't</a>), I've now discovered another site which has taken literally hundreds of my photos, and reproduced them as the site owner's own work. I've found that the nice people mail me anyway, so why bother giving the thieves an excuse to just help themselves? </p><p>I feel rather disappointed about this: CC was something I really believed in, but I guess right now, for me at least, it just doesn't work. <br><span style="font-size: 80%;">2005.-1.1- @ 22. 1</span> </p><p>Added new gallery for <a href=".?c=118">Cherry Tree Lane Cemetery</a>. <br><span style="font-size: 80%;">2005.-1.1- @ 14. 1</span> </p><p>Added new galleries for <a href=".?c=130">Northwood Cemetery</a> and <a href=".?c=117">Victoria Lane Cemetery</a>. <br><span style="font-size: 80%;">2005.-1.1- @ 11. 1</span> </p><p>Added new galleries for <a href=".?c=129">Eastbrookend Cemetery</a> and <a href=".?c=124">Strayfield Road Cemetery</a>; sadly neither is very exciting. <br><span style="font-size: 80%;">2005.-1.1- @ 10. 1</span> </p><p>Added new photographs to <a href=".?c=1&p=55#pic">St. Pancras &amp; Islington</a> and <a href=".?c=17&p=39#pic">City of London</a>. <br><span style="font-size: 80%;">2005.-1.1- @ 10. 1</span> </p><p>Starting a bit of a redesign around here today, so if anything looks a bit strange, please bear with me.<br><span style="font-size: 80%;">2005.-1.0- @ 30. 1</span> </p><p>Starting a bit of a redesign around here today, so if anything looks a bit strange, please bear with<br><span style="font-size: 80%;">2005.-1.0- @ 30. 1</span> </p></div></div><div id=counter style="padding-left: 10px; text-align: center;"><p class=center><a href="./?page=faqs#copyright">&copy; Sue Bailey &amp; Bart Bousfield 2002-2007</a><br><br><!-- <p><a href="http://validator.w3.org/check/referer">xhtml</a>  <a href="http://jigsaw.w3.org/css-validator/check/referer">css</a> </p> //--><br><br><script type=text/javascript>var site="s15loncems"</script><script type=text/javascript src="http://s15.sitemeter.com/js/counter.js?site=s15loncems">
</script></div></body>",nonspam

"<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN"><html><head><title>London Cemeteries</title><style type=text/css>
	@import "cems.css";

</style></head><body style="margin: 0px;"><div id=top><a href=index.php><img border=0 src=blacktitle.jpg></a><div style="position: absolute; top: 10px; right: 10px;"><a href=./ class=breadcrumbs>Home</a> &gt;&gt; Postcards </div></div><div id=nav><ul style="display: inline; list-style-type: none;"><li class=nav><a href="./?page=list">List all cemeteries</a> </li><li class=nav><a href="./?page=links">Links</a> </li><li class=nav><a href=blog.php>Weblog</a> </li><li class=nav><a href="./?page=postcards">Postcards</a> </li><li class=nav><a href=books.php>Books</a> </li><li class=nav><a href="./?page=faqs">About</a> </li></ul></div><div id=main style="background: #fff; padding: 20px;"><div id=main><h1>Postcards </h1><p>Graves and cemeteries form a small but consistent set amongst the fat ladies and weedy men of the humorous postcard. Alcohol is almost always present too. George Orwell in his <a href=http://www.george-orwell.org/The_Art_of_Donald_McGill/0.html>essay on the art of Donald McGill</a> notes that for the comic postcard, drunkenness is ipso facto funny: I suspect that the same must go for the cemetery: how else to account for the repetition of the not very funny joke about drunks falling asleep on graves? </p><p>Click the pictures for the *very* large scans of the cards. </p><table><tr><td><a href=postcards/big/1.jpg><img src=postcards/med/1.jpg alt="Cynicus Going to a Funeral, c. 1900"></a></td><td>Date: c. 1900<br> Artist: <a href=http://www.madras.fife.sch.uk/archive/fpbiographies/anderson.html>Cynicus</a><p>Here's an early version of the "toffs aren't as posh as they'd like to think" theme, perhaps using funeral attendence as a cypher for respectability. </p></td></tr><tr><td><a href=postcards/big/2.jpg><img src=postcards/med/2.jpg alt="Martin Move Some of the Other Fellows, c. 1920"></a></td><td>Date: c. 1920<br> Artist: Phil Martin <p>The oldest version of this joke I've found so far; the top hat hung on the headstone is a nice touch, as is the immortelle in the background. </p></td></tr><tr><td><a href=postcards/big/3.jpg><img src=postcards/med/3.jpg alt="Asleep No Boozed, 1934"></a></td><td>Date: 1934 (postmark) <br> Artist: A. Taylor <p>Within ten years, the joke has become a bit simpler, but the drunk is still a toff. </p></td></tr><tr><td><a href=postcards/big/4.jpg><img src=postcards/med/4.jpg alt="I'm Blowed if I Remember Dying"></a></td><td>Date: ? <br> Artist: Donald McGill <p>Mr McGill gets in on the joke, with a little bit of a twist in the idea, as the drunk does actually know where he is. This archetypal toff has spats and yellow leather gloves. </p></td></tr><tr><td><a href=postcards/big/5.jpg><img src=postcards/med/5.jpg alt="Miles Fra London"></a></td><td>Date: ? <br> Artist: D. Tempest <p>And you thought we were scraping the barrel before! All drunks on comic postcards hallucinate, but not all as unfunnily as this. </p></td></tr><tr><td><a href=postcards/big/12.jpg><img src=postcards/med/12.jpg alt="I suppose I must have died (hic) but which is my tombstone?"></a></td><td>Date: ? <br> Artist: ? <p>Finally, the same idea but without any attempt at a joke. </p></td></tr><tr><td><a href=postcards/big/7.jpg><img src=postcards/med/7.jpg alt="Just as he wanted it"></a></td><td>Date: 1960 (postmark) <br> Artist: Taylor <p>And everyone is happy ever after. </p></td></tr><tr><td><a href=postcards/big/6.jpg><img src=postcards/med/6.jpg alt="Open a Tin of Peas"></a></td><td>Date: ? <br> Artist: Fitzpatrick <p>The perfidy of women is another favourite theme of postcard artists... </p></td></tr><tr><td><a href=postcards/big/8.jpg><img src=postcards/med/8.jpg alt="Got Out to Go to the Gents"></a></td><td>Date: 1969 (postmark) <br> Artist: Fitzpatrick <p>... as is the devotion of men to beer. </p></td></tr><tr><td><a href=postcards/big/13.jpg><img src=postcards/med/13.jpg alt="'Eh Joe, this weather will make things fairly spring out of the ground!' 
'I 'ope not, I've got two wives buried over there!!'"></a></td><td>Date: ? <br> Artist: Donald McGill <p>Mr McGill lets the widowers get their own back. </p></td></tr><tr><td><a href=postcards/big/14.jpg><img src=postcards/med/14.jpg alt="How peaceful it looks in there!"></a></td><td>Date: 1912 (postmark)<br> Artist: ? <p>The handwritten addition says "Poor wretch don't you pity him I do". </p></td></tr><tr><td><a href=postcards/big/11.jpg><img src=postcards/med/11.jpg alt="Ah well, we can't all dee at the reight time!"></a></td><td>Date: ? (Bamforth Comic Series 2819)<br> Artist: ? <p>Another stereotype - the miserliness of Scotsmen - gets a funereal twist. </p></td></tr><tr><td><a href=postcards/big/9.jpg><img src=postcards/med/9.jpg alt="I wouldn't leave my little wooden hut for you!"></a></td><td>Date: ? <br> Artist: ? <p>It took me a while to figure out this one and the one below it. "I wouldn't leave my little wooden hut for you" was a popular musical hall song, about a stranger attempting to seduce a girl from a 'cannibal isle'. I've found the <a href=http://ingeb.org/songs/iwouldnl.html>lyrics</a> and the <a href=http://meems.imeem.com/FxTPsm4r/music/SfcPns0C/i_wouldnt_leave_my_little_wooden_hut_for_you_studio/ >instrumental</a> online, but don't seem to be able to find the two together! If you can help, please let me know. </p></td></tr><tr><td><a href=postcards/big/10.jpg><img src=postcards/med/10.jpg alt="I wouldn't leave my little wooden hut for you!"></a></td><td>Date: ? <br> Artist: ? <p>Interestingly, this card and the one above appear to have different artists and different publishers. Once more, the joke remains the same. </p></td></tr></table><p>I'm not sure why my postcard collection exists. Probably too much time spent on <a href="http://rover.ebay.com/rover/1/710-5232-2978-22/1?aid=5050638&pid=1776916" target=_top>eBay</a>, plus complete incredulity that these can have sold in their thousands and yet be so unfunny. I suppose the point is that there's no danger at all that the person to whom you sent the card wouldn't get the joke. </p></div></div><div id=counter style="padding-left: 10px; text-align: center;"><p class=center><a href="./?page=faqs#copyright">&copy; Sue Bailey &amp; Bart Bousfield 2002-2007</a><br><br><!-- <p><a href="http://validator.w3.org/check/referer">xhtml</a>  <a href="http://jigsaw.w3.org/css-validator/check/referer">css</a> </p> //--><br><br><script type=text/javascript>var site="s15loncems"</script><script type=text/javascript src="http://s15.sitemeter.com/js/counter.js?site=s15loncems">
</script></div></body>",nonspam

"<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN"><html><head><title>London Cemeteries</title><style type=text/css>
	@import "cems.css";

</style></head><body style="margin: 0px;"><div id=top><a href=index.php><img border=0 src=blacktitle.jpg></a><div style="position: absolute; top: 10px; right: 10px;"><a href=./ class=breadcrumbs>Home</a> &gt;&gt; Faqs </div></div><div id=nav><ul style="display: inline; list-style-type: none;"><li class=nav><a href="./?page=list">List all cemeteries</a> </li><li class=nav><a href="./?page=links">Links</a> </li><li class=nav><a href=blog.php>Weblog</a> </li><li class=nav><a href="./?page=postcards">Postcards</a> </li><li class=nav><a href=books.php>Books</a> </li><li class=nav><a href="./?page=faqs">About</a> </li></ul></div><div id=main style="background: #fff; padding: 20px;"><div id=main><h1>About this site</h1><dl><dt>What is this all about? </dt><dd>There are rather more than 140 cemeteries in London. My mission is to visit and photograph them all. The site owes an enormous debt to Hugh Meller's book London Cemeteries, without which the whole project would have been much harder work. </dd><dt>Why are you doing this?</dt><dd>This is a very good question. Some answers that I have given at various times include: <ul><li>Cemeteries are cheaper than art galleries and contain much more beautiful work. </li><li>I'm interested in changing attitudes to death as evidenced by memorials. </li><li>Cemeteries are some of the very few places in London where you can find peace. </li><li>My route to primary school took me through <a href=http://www.sheffield.gov.uk/environment/how-we-work/bereavement/cemeteries/crookes>a cemetery</a>, the first place I was allowed to go alone. so I associate them with my independence. </li><li>Gravestones stand still and are therefore easy to photograph. </li></ul> Any or none of these may bear some relation to the truth. </dd><dt>How are you defining "London"? </dt><dd>Meller, writing in 1981, says that he has included all the cemeteries of the inner London boroughs, "as well as those within a nine mile radius of central London (or roughly the area covered by the A-Z map of London)." Since then, the scope of the A-Z has been greatly expanded. We have largely taken the M25 as our boundary point, although cemeteries outside that where Londoners might well be buried (primarly <a href="./?c=46">Brookwood</a>) have been included. <br> <br></dd><dt>My ancestor is buried somewhere in London. Can you find them for me?</dt><dd>Sorry, no. Most cemeteries and parish churches have records of those buried in their grounds. You should contact them for information. There is no central register showing places of burial for those who died in London, so be prepared to contact several locations close to where your loved one died. In addition, there are very few burial registers available online, so you should be prepared to visit offices in person to examine the registers, or to pay a (usually small) fee to have this done for you. </dd><dt>Will you photograph a grave/cemetery/something else for me?</dt><dd>Probably not: I'm moving to France so will not be in London on a regular basis. But feel free to <a class=lined href=mailto:sue@londoncemeteries.co.uk>mail me</a> with as much information as you have. <br> <br> </dd><a name=copyright><dt>Can I use some of your photographs?</dt><dd>If you wish to use photographs from this site elsewhere (on the internet or otherwise), you will need my explicit permission. And I'll almost certainly say yes when you ask; I'm just sick of people stealing dozens or hundreds of photos and not even putting my name on them. So do <a class=lined href=mailto:sue@londoncemeteries.co.uk>mail me</a>. <br><br> I will require you to acknowledge my copyright, and to provide a link to this site. In addition, if you use my photographs in a print publication, you will need to send me a copy of it. High-resolution copies can be made available on request. </dd></a><dt>Why is there a "Paypal donate" button on the front page? </dt><dd>This site is expensive to run, less in terms of hosting, than in time spent adding photographs and answering interesting emails. I'm also working on a book of the London dead. If any part of that is worth a couple of quid in support, your generosity is very much appreciated. </dd></dl><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br></div></div><div id=counter style="padding-left: 10px; text-align: center;"><p class=center><a href="./?page=faqs#copyright">&copy; Sue Bailey &amp; Bart Bousfield 2002-2007</a><br><br><!-- <p><a href="http://validator.w3.org/check/referer">xhtml</a>  <a href="http://jigsaw.w3.org/css-validator/check/referer">css</a> </p> //--><br><br><script type=text/javascript>var site="s15loncems"</script><script type=text/javascript src="http://s15.sitemeter.com/js/counter.js?site=s15loncems">
</script></div></body>",nonspam

"<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN"><html><head><title>London Cemeteries</title><style type=text/css>
	@import "cems.css";

</style></head><body style="margin: 0px;"><div id=top><a href=index.php><img border=0 src=blacktitle.jpg></a><div style="position: absolute; top: 10px; right: 10px;"><a href=./ class=breadcrumbs>Home</a> &gt;&gt; Links </div></div><div id=nav><ul style="display: inline; list-style-type: none;"><li class=nav><a href="./?page=list">List all cemeteries</a> </li><li class=nav><a href="./?page=links">Links</a> </li><li class=nav><a href=blog.php>Weblog</a> </li><li class=nav><a href="./?page=postcards">Postcards</a> </li><li class=nav><a href=books.php>Books</a> </li><li class=nav><a href="./?page=faqs">About</a> </li></ul></div><div id=main style="background: #fff; padding: 20px;"><div id=main><h2>Photography Sites</h2><ul><li><a href=http://www.ukgraves.info>UK Graves</a>, a photographic tour of some of the South of England's graveyards, cemeteries and other places of burial. </li><li><a href=http://www.theadamsresidence.co.uk/vault.html>The Adams Family gallery</a>; London and much more </li><li><a href=http://www.xs4all.nl/~androom/dead/kensal.htm>Kensal Green</a> </li><li><a href=http://www.sjerk.clara.net/violet/gravesides.html>Gravesides</a>; London, Cambridge and more </li><li><a href=http://www.afterlifeseasons.com/index.htm>After Life</a>: a stunning series of animated photographs of Streatham Cemetery</li><li><a href=http://www.graveyardsandmonuments.moonfruit.com/ >Graveyards and Monuments</a>: beautiful cemetery photography. </li><li><a href=http://www.londonnecropolis.com/links.htm>London Necropolis</a>: an amazing collection of London cemetery photographs. </li><li><a href=http://www.flickr.com/photos/polstar/sets/999432/ >Polstar's London cemetery photography</a> </li><li><a href=http://www.brown-bread.blogspot.com>Headstones and Worms</a> </li><li><a href=http://www.harolding.com/ >Harolding</a>: very interesting cemetery photoblog. </li> </ul><h2>Cemetery Friends </h2><ul><li><a href=http://www.cemeteryfriends.org.uk>National Federation of Cemetery Friends</a> </li><li><a href=http://www.abney-park.org.uk/ >Abney Park Cemetery Trust</a> </li><li><a href=http://www.royalparks.gov.uk/about/friends.cfm>Friends of Brompton Cemetery</a> </li><li><a href=http://www.tbcs.org.uk/index.htm>The Brookwood Cemetery Society</a> </li><li><a href=http://highgate-cemetery.org/index.asp>Friends of Highgate Cemetery</a>, the <i>only official site</i> LOL. </li><li><a href=http://www.kensalgreen.co.uk/ >Friends of Kensal Green Cemetery</a> </li><li><a href=http://www.mausolea-monuments.org.uk/docs/main.html>The Mausolea and Monuments Trust</a> </li><li><a href=http://www.fonc.org.uk/ >Friends of Nunhead Cemetery</a> </li><li><a href=http://www.towerhamletscemetery.org/index.htm>Friends of Tower Hamlets Cemetery Park</a> </li><li><a href=http://www.fownc.org/ >Friends of West Norwood Cemetery</a></li><li>Friends of Woodgrange Park </li></ul><h2>Cemetery Owners</h2><h3>Borough Councils</h3><p>As council websites seem to change frequently, links are to the home page only. Most have cemeteries listed in the A to Z of services under cemeteries or bereavement services, or occasionally as parks. </p><ul><li><a href=http://www.barking-dagenham.gov.uk/ >Barking and Dagenham Borough Council</a> run Rippleside, Eastbrookend and Chadwell Heath Cemeteries. </li><li><a href=http://www.barnet.gov.uk/ >Barnet Borough Council</a> run Hendon Cemetery </li><li><a href=http://www.bexley.gov.uk/ >Bexley Borough Council</a> run Bexleyheath, Erith, Sidcup and Hill View Cemeteries. </li><li><a href=http://www.brent.gov.uk/ >Brent Borough Council</a> run Alperton, Carpenders Park, Willesden and Paddington Cemeteries. <li><a href=http://www.bromley.gov.uk/ >Bromley Borough Council</a> </li><li><a href=http://www.camden.gov.uk/ >Camden Borough Council</a> run St. Pancras and Hampstead Cemeteries. </li><li><a href=http://www.croydon.gov.uk/ >Croydon Borough Council</a> run Mitcham Road and Queens Road Cemeteries and Greenlawn Memorial Park.</li><li><a href=http://www.ealing.gov.uk/ >Ealing Borough Council</a>, minimal; Acton, Greenford, Havelock, Hortus and South Ealing Cemeteries. </li><li><a href=http://www.enfield.gov.uk/ >Enfield Borough Council</a> run Edmonton, Southgate, Lavender Hill and Hertford Road Cemeteries. </li><li><a href=http://www.greenwich.gov.uk/ >Greenwich Borough Council</a> runs Charlton, Greenwich, Woolwich, Eltham and Plumstead Cemeteries. </li><li><a href=http://www.lbhf.gov.uk/ >Hammersmith and Fulham Borough Council</a>: absolutely minimal. </li><li><a href=http://www.haringey.gov.uk/ >Haringey Borough Council</a>, minimal; Enfield, Wood Green and Tottenham Cemeteries. </li><li><a href=http://www.harrow.gov.uk/ >Harrow Borough Council</a>: absolutely minimal. </li><li><a href=http://www.havering.gov.uk/ >Havering Borough Council</a> run the South Essex Crematorium. </li><li><a href=http://www.hillingdon.gov.uk/ >Hillingdon Borough Council</a> run Cherry Lane, Harlington, Harmondsworth, Hillingdon &amp; Uxbridge, Northwood, Victoria Lane and West Drayton Cemeteries. </li><li><a href=http://www.hounslow.info/ >Hounslow Borough Council</a> run Bedfont, Borough, Chiswick Old and New, Feltham, Hatton, Hounslow, Isleworth and New Brentford Cemeteries.</li><li><a href=http://www.islington.gov.uk/ >Islington Borough Council</a> East Finchley and Trent Park Cemeteries. </li><li><a href=http://www.rbkc.gov.uk/ >Kensington &amp; Chelsea Borough Council</a> run Gunnersbury and Hanwell Cemeteries. </li><li><a href=http://www.kingston.gov.uk/ >Kingston Borough Council</a> run Kingston and Surbiton Cemeteries. </li><li><a href=http://www.lambeth.gov.uk/ >Lambeth Borough Council</a> run West Norwood, Lambeth and Streatham Cemeteries. </li><li><a href=http://www.lewisham.gov.uk/ >Lewisham Borough Council</a> run Hither Green, Grove Park, Ladywell and Brockley Cemeteries and Lewisham Crematorium. </li><li><a href=http://www.merton.gov.uk/ >Merton Borough Council</a> minimal; Church Road, London Road, Merton &amp; Sutton and Wimbledon Cemeteries. </li><li><a href=http://www.newham.gov.uk/ >Newham Borough Council</a> West Ham, East Ham Cemeteries </li><li><a href=http://www.redbridge.gov.uk/ >Redbridge Borough Council</a> run Barkingside, Buckingham Road and Roding Lane North Cemeteries. </li><li><a href=http://www.richmond.gov.uk/ >Richmond Borough Council</a> run Teddington, Twickenham and East Sheen Cemeteries. </li><li><a href=http://www.southwark.gov.uk/ >Southwark Borough Council</a>, excellent; Camberwell Old and New, and Nunhead Cemeteries. </li><li><a href=http://www.spelthorne.gov.uk/ >Spelthorne Borough Council</a> run Ashford, Stanwell, Staines and Sunbury Cemeteries. </li><li><a href=http://www.towerhamlets.gov.uk/ >Tower Hamlets Borough Council</a> on their lovely cemetery park. </li><li><a href=http://www.lbwf.gov.uk/ >Waltham Forest Borough Council</a> run Chingford Mount and Walthamstow Cemeteries. </li><li><a href=http://www.wandsworth.gov.uk/ >Wandsworth Borough Council</a> run Putney Vale, Putney Lower Common, Battersea St. Mary's, Battersea New and Wandsworth Cemeteries. </li><li><a href=http://www.watford.gov.uk/ >Watford Borough Council</a> run North Watford and Vicarage Road Cemteries. </li><li><a href=http://www.westminster.gov.uk/ >Westminster City Council</a>, minimal offering from the Council who sold their cemeteries for 15p.</li></ul><h3>Other Cemetery Owners</h3><ul><li><a href=http://www.fbca.org.uk/information.asp>The Federation of British Cremation Authorities</a> list of all their members: useful resource. </li><li><a href=http://www.badgehurst.co.uk/ >Badgehurst</a>, though you wouldn't guess it from their website, own Tottenham Park and Woodgrange Park Cemeteries. </li><li><a href=http://www.cityoflondon.gov.uk/our_services/health_safety/cemetery_crematorium/ >Corporation of London</a> for the City of London Cemetery. </li><li><a href=http://www.elond-cemetery.demon.co.uk/ >East London Cemetery &amp; Crematorium</a> </li><li><a href=http://www.newsouthgate.com/ >New Southgate Cemetery &amp; Crematorium</a> </li></ul><h2>Other Interesting Sites</h2><ul><li><a href=http://www.timetravel-britain.com/05/April/cemeteries.shtml>London's Victorian Garden Cemeteries</a>: excellent introductory article by Catherine Richards; the photographs might be a bit familiar! </li><li><a href=http://www.londonburials.co.uk/ >London Burials</a> traces the current state of burial grounds listed in Holmes</li><li><a href=http://www.bbc.co.uk/london/yourlondon/unitedcolours/cemeteries/cemetery_ofthe_year.shtml>BBC London's cemetery feature</a><li><a href=http://www.bobdavenport.freeserve.co.uk/cemeteries/ >East Finchley Cemeteries</a> </li><li><a href=http://www.jewishgen.org/cemetery/brit/london.html>Jewish Cemeteries in London</a> </li><li><a href=http://www.hct.org.uk/chapel7london.html>Kensal Green dissenters' chapel</a> </li><li><a href=http://www.wizardsrealmcentral.com/uksg/public_html/ >Saving Graves UK</a>: lots of useful links </li><li><a href=http://www.anrdoezrs.net/click-1776916-10400222 target=_top>England Cemeteries & Tombstones</a><img src=http://www.tqlkg.com/image-1776916-10400222 width=1 height=1 border=0> </li><li><a href=http://www.anrdoezrs.net/click-1776916-10394102 target=_top>Search census records at Ancestry.co.uk</a><img src=http://www.tqlkg.com/image-1776916-10394102 width=1 height=1 border=0></li><li><a href=http://www.ukancestor.co.uk>UK Ancestor</a>: A free website for Family and Local History within the UK and Ireland. </li><li><a href=http://www.scottishgraveyards.org.uk/ >Scottish Graveyards</a>: information on recording and preservation of historical burial sites. </li><li><a href=http://www.bereavement-services.org/ >Bereavement Services Portal</a>: funeral service industry information site. </li><li><a href=http://www.victorianlondon.org/ >The Victorian Dictionary</a> with extensive section on death and dying. </li></ul><p>Want to see your link here? <a href=mailto:sue@londoncemeteries.co.uk>Mail me.</a> </p></div></div><div id=counter style="padding-left: 10px; text-align: center;"><p class=center><a href="./?page=faqs#copyright">&copy; Sue Bailey &amp; Bart Bousfield 2002-2007</a><br><br><!-- <p><a href="http://validator.w3.org/check/referer">xhtml</a>  <a href="http://jigsaw.w3.org/css-validator/check/referer">css</a> </p> //--><br><br><script type=text/javascript>var site="s15loncems"</script><script type=text/javascript src="http://s15.sitemeter.com/js/counter.js?site=s15loncems">
</script></div></body>",nonspam

