					#rel_links {margin-right: -146px;}
				</style><link rel=stylesheet type=text/css href=/no10_css/print.css media=print><link rel="shorcut icon" href=/favicon.ico></head><body class=primeminister><h3 align=center style="color: #cc0000; background-color: #ffffff; "></h3><p class=rm><a class=skip href=#content>Skip to: Content</a><span class=skip> |</span></p><div id=header><a href=http://www.pm.gov.uk/output/page1.asp class=logo><img src=http://www.pm.gov.uk/files/images/crest.gif width=125 height=78 alt="The crest for Number 10 Downing Street" title></a><div id=navigation><h2>Main menu</h2><ul><li class=primeminister><span>&nbsp;</span><a href=http://www.pm.gov.uk/output/Page2.asp>prime minister</a><ul><li><a href=http://www.pm.gov.uk/output/Page3.asp>contact</a></li><li><a href=http://www.pm.gov.uk/output/Page4.asp>biography</a></li><li><a href=http://www.pm.gov.uk/output/Page5.asp>speeches</a></li><li><a href=http://www.pm.gov.uk/output/Page12.asp>PM's office</a></li><li><a href=http://www.pm.gov.uk/output/Page8809.asp>the big issues</a></li><li><a href=http://www.pm.gov.uk/output/Page10318.asp>our nation's future</a></li></ul></li><li class=government><span>&nbsp;</span><a href=http://www.pm.gov.uk/output/Page18.asp>government</a><ul><li><a href=http://www.pm.gov.uk/output/Page19.asp>cabinet</a></li><li><a href=http://www.pm.gov.uk/output/Page29.asp>guide to legislation</a></li><li><a href=http://www.pm.gov.uk/output/Page30.asp>guide to government</a></li><li><a href=http://www.pm.gov.uk/output/Page31.asp>in your area</a></li><li><a href=http://www.pm.gov.uk/output/Page32.asp>links</a></li></ul></li><li class=news><span>&nbsp;</span><a href=http://www.pm.gov.uk/output/Page20.asp>newsroom</a><ul><li><a href=http://www.pm.gov.uk/output/Page21.asp>latest news</a></li><li><a href=http://www.pm.gov.uk/output/Page34.asp>media centre</a></li><li><a href=http://www.pm.gov.uk/output/Page36.asp>email updates</a></li><li><a href=http://www.pm.gov.uk/output/Page9156.asp>photo galleries</a></li><li><a href=http://www.pm.gov.uk/output/Page11249.asp>webchats</a></li></ul></li><li class=downingstreet><span>&nbsp;</span><a href=http://www.pm.gov.uk/output/Page22.asp>downing street</a><ul><li><a href=http://www.pm.gov.uk/output/Page39.asp>welcome</a></li><li><a href=http://www.pm.gov.uk/output/Page175.asp>history of the building</a></li><li><a href=http://www.pm.gov.uk/output/Page123.asp>PMs in history</a></li><li><a href=http://www.pm.gov.uk/output/Page41.asp>tour</a></li></ul></li><li class=broadcasts><span>&nbsp;</span><a href=http://www.pm.gov.uk/output/Page24.asp>broadcasts</a><ul><li><a href=http://www.pm.gov.uk/output/Page306.asp>PM's Question Time</a></li><li><a href=http://www.pm.gov.uk/output/Page308.asp>PM's statements</a></li><li><a href=http://www.pm.gov.uk/output/Page3054.asp>films</a></li><li><a href=http://www.pm.gov.uk/output/Page10617.asp>podcasts</a></li></ul></li></ul></div><span class=clear>&nbsp;</span></div><div id=helpbar><div><p class=help><a href=http://www.pm.gov.uk/output/page6371.asp>Help</a></p><form name=kbs method=get action=http://search.number-10.gov.uk/kbroker/number10/number10/search.lsim><script type=text/javascript language=JavaScript src=http://www.pm.gov.uk/include/js/helper.js></script><label for=qt>Search All No.10</label><input type=text name=qt id=qt maxlength=1000 value="Enter search terms" onfocus=clearInstructions(this)>&nbsp;<input name=go id=go type=submit value=Go><input type=hidden name=sr value=0><input type=hidden name=nh value=10><input type=hidden name=cs value=iso-8859-1><input type=hidden name=sc value=number10><input type=hidden name=sm value=0><input type=hidden name=mt value=1><input type=hidden name=to value=0><input type=hidden name=ha value=368></form><p>You are here: <a href=http://www.pm.gov.uk/output/Page1.asp>home</a>&nbsp;>&nbsp;<a href=/ >petitions</a></p></div></div><div id=main><div id=wrap><div id=content><h1><span dir=ltr>E-Petitions</span></h1><div id=content_clipboard><div id=petition_actions><ul><li id=action_create><a href=/new><img src=/images/clipboard-add.gif alt class=noborder><br>Create a Petition</a></li><li id=action_view><a href=/list><img src=/images/clipboard-write.gif alt class=noborder><br>View Petitions</a></li></ul></div><p>Petitions have long been sent to the Prime Minister by post or delivered to the Number 10 door in person. You can now both create and sign petitions on this website too, giving you the opportunity to reach a potentially wider audience and to deliver your petition directly to Downing Street.</p><form id=search_front name=pet_search method=get action=http://search.petitions.pm.gov.uk/kbroker/number10/petitions/search.lsim><input type=hidden name=ha value=1157><input type=hidden name=sc value=number10><p><label for=q>Search petitions:</label><input type=text name=qt id=q size=20 maxlength=1000 value>&nbsp;<input type=submit value=Go></p></form></div><div id=most_recent><h2><span class=ltr>Five most recent petitions</span></h2><p>We the undersigned petition the Prime Minister to&hellip;</p><ul><li class=a><a href=/expatvote/ >reinstate voting rights for expatrate British Citizens with right of abode</a></li><li><a href=/bikepersecution/ >help address the current prejudice against motorcycles in this country.</a></li><li class=a><a href=/rtneighbours/ >ensure that Neighbours stays on the BBC.</a></li><li><a href=/makeadifference/ >put more money into staffing and resources for hospitals</a></li><li class=a><a href=/worldchildren/ >save our children in this country and throughout the world, by committing the UK to reducing carbon emissions by more than 60% by 2050.</a></li></ul><p align=right><a href="/list/open?sort=date" title="More recent petitions">More</a></p></div><div id=most_popular><h2><span class=ltr>Five most popular open petitions</span></h2><p>We the undersigned petition the Prime Minister to&hellip;</p><ul><li class=a><a href=/licensing/ >recognise that music and dance should not be restricted by burdensome licensing regulations.</a> <small>(72190 signatures)</small></li><li><a href=/Photography/ >Stop proposed restrictions regarding photography in public places</a> <small>(66561 signatures)</small></li><li class=a><a href=/Student-loans/ >Change the current student loan interest repayment, to deduct payments monthly not annually</a> <small>(64976 signatures)</small></li><li><a href=/SaveTheReds/ >Continue funding for the Royal AIr Force Aerobatics Team - The Red Arrows</a> <small>(58307 signatures)</small></li><li class=a><a href=/ScrapMegaMosque/ >Abolish plans to build a £100 million mega Mosque.</a> <small>(42200 signatures)</small></li></ul><p align=right><a href="/list/open?sort=signers" title="More popular petitions">More</a></p></div><h2 style="clear: both"><span class=ltr>How it works</span></h2><!-- <p>This service has been set up in partnership with <a
href="http://www.mysociety.org/">mySociety</a>, a non-partisan charitable
project that runs various democracy focussed websites in the UK, such as
<a href="http://www.hearfromyourmp.com/">HearFromYourMP.com</a>.
</p>
--><p>You can view and sign any <a href=/list>current petitions</a>, and see the Government response to any <a href=/list/closed>completed petitions</a>. If you have signed a petition, you will be sent a response from the Government by email once the petition is closed. </p><p>All petitions that are submitted to this website will be accepted, as long as they are in accordance with our <a href=/terms>terms and conditions</a>. The aim is to enable as many people as possible to make their views known. </p><p>To ensure transparency, any petition that cannot be accepted will be listed, along with the reasons why. A list of <a href=/list/rejected>rejected petitions</a> is available on this website.</p><img src=http://www.pm.gov.uk/files/images/clear.gif width=1 height=1 alt class=emptyGif></div></div><div id=rel_links><div class="primeminister submenu"><h2><span class=ltr>E-Petitions</span></h2><ul><li><a href=/ >Petitions home</a></li><li><a href=/list>View petitions</a></li><li><a href=/new>Create a petition</a></li><li><a href=/about>About e-petitions</a></li><li><a href=/steps>Step-by-Step Guide</a></li><li><a href=/faq><acronym title="Frequently Asked Questions">FAQs</acronym></a></li><li><a href=/terms>Terms and Conditions</a></li><li><a href=/privacy>Privacy Policy</a></li></ul></div></div></div><div id=ilinks><h3 id=beta>BETA TEST</h3><p> The e-petitions system launched in November 2006. It is currently in a public "beta test". This means that users are welcome to sign and create petitions, but we will be making changes to the site, as we fix technical problems, improve usability and respond to feedback. </p><p><a href=http://www.pm.gov.uk/output/Page11051.asp>E-petitions: Facts, figures and progress</a></p><img src=http://www.pm.gov.uk/files/images/clear.gif width=1 height=1 alt class=emptyGif></div><div id=footer><div><p>| <a href=http://www.pm.gov.uk/output/Page49.asp>copyright</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page7035.asp>freedom of information</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page50.asp>feedback</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page52.asp>privacy policy</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page53.asp>search</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page54.asp>sitemap</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page4049.asp>accessibility</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page6508.asp>rss and podcasts</a>&nbsp;|&nbsp;<a href=http://www.pm.gov.uk/output/Page9899.asp>directgov</a>&nbsp;|&nbsp;</p></div></div><script type=text/javascript>
sitestat("http://uk.sitestat.com/primeministersoffice/downingstreet/s?Petitions.Home");
</script><noscript><img width=1 height=1 alt src=http://uk.sitestat.com/primeministersoffice/downingstreet/s?Petitions.Home></noscript></body>",nonspam

