    </script><div class=siteNavigation><a href=/index.asp><img src=graphics/template/nav/home.gif alt="Home |"></a><a href=aboutus/index.asp><img src=../../graphics/template/nav/about.gif alt="About Us |" name=aboutus id=aboutus onmouseover="popup('About Us Menu','aboutus')" onmouseout=popdown()></a><a href=information/index.asp><img src=../../graphics/template/nav/information.gif alt="Information |" id=information name=information onmouseover="popup('Information Menu','information')" onmouseout=popdown()></a><a href=news/index.asp><img src=../../graphics/template/nav/news.gif alt="News |" id=news name=news onmouseover="popup('News Menu','news')" onmouseout=popdown()></a><a href=performance/index.asp><img src=../../graphics/template/nav/performance.gif alt="Performance |" id=performance name=performance onmouseover="popup('Performance Menu','performance')" onmouseout=popdown()></a><a href=causes/index.asp><img src=../../graphics/template/nav/worthwhile_causes.gif alt="Worthwhile Causes |" id=causes name=causes onmouseover="popup('Worthwhile Causes Menu','causes')" onmouseout=popdown()></a></div><noscript></noscript><div class=siteSearch><form name=ecmsearch method=post action=../searchdisplay.asp><div style=margin-top:2px;><input type=text name=ecmsearchtext style="width: 110px;display: inline;"><input type=submit name=submit value=Search style="padding:0px; margin:0px;display:inline;background-color:#7AD84B;border:0px solid #7AD84B; height:16px;"></div><input type=hidden name=ecmstartingfolder value=\><input type=hidden name=ecmrecursive value=1></form></div></td><td class=siteNavigation>&nbsp;</td></tr><tr><td class=siteMainContent style=width:770px;><div id=divMainContent style=margin-right:100px><h1>Glastonbury Festival of Contemporary Performing Arts</h1></div><div id=divRelatedLinks><p><b>Quick Links:</b><li><a href=http://boards.glastonburyfestivals.co.uk>Message Boards</a></li><li><a href="/extravaganza/index.asp?id=167">Extravaganza</a></li><li><a href="/information/index.asp?id=113">Emerging Talent</a></li><li><a href="/information/index.asp?id=166">Traders</a></li><li><a href=http://shop.glastonburyfestivals.co.uk>Shop</a></li><li><a href="/news/index.asp?id=388">2005 Review</a></li><li><a href=http://guardian.co.uk/arts/glastonbury>Guardian UnLtd</a></li><li><a href=/film/ >GLASTONBURY film</a></li><li><a href="/information/index.asp?id=446">Ethical Living Links</a></li><li><a href="/news/index.asp?id=401">Worthy Farm Cheddar from Glastonbury Festival</a></li><li><a href=http://bbc.co.uk/glastonbury/webcam/webcam2.shtml>Glastonbury Webcam</a></li></p></div><div id=divMainContent style=margin-right:100px><ecm_content><!--Ektron CMS Content Block--><h3 align=center>22nd, 23rd and 24th June 2007</h3><h1>Tickets for Glastonbury 2007 Sell Out</h1><p><em><img class=Content_IMG_W109 height=145 alt="Mendip 07 Michael Outside 109" src=/uploadedImages/News/michael-outside-mendip-109pxwidth.jpg width=109 border=0>"I'm sorry that so many of you couldn't get a ticket to Glastonbury this year. I hope there will be another chance for you to come during the next four years.</em></p><p><em>"I know it sounds a bit tame to mention BBC TV and Radio as an alternative but can I suggest another alternative that might be more attractive - namely the "Latitude Festival" set in a beautiful part of Suffolk. Although much smaller it has some terrific music and has a similar feel to it, by way of theatre, comedy, circus, and atmosphere.</em></p><p><em>"Best wishes and thank you so much for supporting our Festival through the years."</em></p><p><em>Michael Eavis</em></p><p>Both coach ticket packages and standard weekend&#160;tickets are now completely sold out.&#160;There will be no further sale of tickets for this year's Festival.&#160;</p><p>If&#160;you have any questions about any aspect of your purchase, please contact <a href=mailto:queries@wayahead.com>queries@wayahead.com</a> or telephone <strong>0870 163 1781</strong>.</p><h2>Tipis Still Available</h2><p>There are a limited amount of Tipis still available at the&#160;<a href=http://www.cockmillhideaway.com/ target=_blank>Cockmill Hideaway</a>.&#160;<a href="/information/index.asp?id=72#Cockmill_Tipi">Click here</a>&#160;for more details.</p><h2>Coach and Ticket Packages</h2><p>If you were looking for&#160;information about the&#160;<a href="/information/index.asp?id=462">combined coach and ticket</a> packages, <a href=http://seetickets.com/ target=_blank>Seetickets</a>&#160;will be in touch with customers in due course with exact timings and pick up points for Coach Travel.</p><h2>Car parking and campervan tickets</h2><p>Ticket holders can buy car parking tickets online or by telephoning <strong>0870 165 2007</strong>.&#160;Campervan/caravan tickets have now sold out.</p><h2><strong>Further&#160;tickets questions are answered</strong> <a href=/tickets/ ><strong>here</strong></a><strong>.</strong></h2><p><strong>No announcement about the line up will be made by the Festival before tickets go on sale. The Festival will announce the lineup of all the main stages at the beginning of June.</strong></p><!--/Ektron CMS Content Block--></ecm_content></div><div id=divIntroContent><!--Ektron CMS Collection --><p><a href="/news/index.asp?id=467">Glastonbury Donates to Tsunami Charity</a>&nbsp;(May 3, 2007)</p><p><p><img class=Content_IMG_W109 height=82 alt="Glastonbury Donates to Muslim Aid" src=/uploadedImages/News/muslimaid109.jpg width=109 border=0>Michael Eavis has donated more than &#163;63,000 to aid tsunami-affected families in Indonesia. The Glastonbury organiser has presented a cheque to the charity Muslim Aid as a tribute to a friend who died in the disaster.</p><p><a href="/news/index.asp?id=467">Click here</a> to read more.</p></p><p><a href="/extravaganza/index.asp?id=167">Glastonbury Abbey Extravaganza 2007</a>&nbsp;(Mar 29, 2007)</p><p><p><img class=Content_IMG_W109 title="Extravaganza Fireworks by Jason Bryant Thumbnail " height=78 alt="Extravaganza Fireworks by Jason Bryant Thumbnail " src=/uploadedImages/Extravaganza/ExtravaStagebyJason-Bryant(1).jpg width=109 border=0> Michael Eavis has announced the line up for his other show this year - the <strong>Glastonbury Abbey Musical Extravaganza</strong> to be held on <strong>Friday 10th</strong>, <strong>Saturday 11th</strong> and <strong>Sunday 12th August</strong>, <strong>2007</strong>. Over the years the Extravaganza has developed into a series of three separate and very different evening concerts.</p><p>Friday night will see the return of the ever popular <strong>Van Morrison</strong>, and rising star <strong>Corinne Bailey Rae</strong> - a combination of performances that will make for a truly amazing and memorable evening. The Saturday night concert features world famous <strong>Charles Hazlewood</strong> conducting the <strong>Royal Philharmonic Orchestra</strong> performing an anniversary Tchaikovsky programme and Sunday's concert will feature performances by <strong>Ray Davies</strong> (of the Kinks) and singing sensation <strong>Paolo Nutini</strong>.</p><p>Please&#160;<a href="/extravaganza/index.asp?id=167"><strong>click here</strong></a>&#160;for more details.</p></p><p><a href="/news/index.asp?id=463">Emerging Talent Winner - Interview with Liz Green</a>&nbsp;(Apr 11, 2007)</p><p><p><img class=Content_IMG_W109 height=80 alt="Liz Green 109" src=/uploadedImages/News/lizgreenfcu.jpg width=109 border=0>Every so often, you listen to a singer and hear a sound that's utterly&#160;of the moment and yet completely timeless; Liz Green, overall winner of the Glastonbury Festival Emerging Talent contest, is such a singer.</p><p><a href="/index.asp?id=463">Click here</a>&#160;to read&#160;Liz's exclusive interview with Adam Horovitz of the official Glastonbury website.</p></p><!--/Ektron CMS Collection --></div><div id=divMainContent style=margin-right:100px><ecm_content><!--Ektron CMS Content Block--><p></p><p><a href=http://www.drugdrive.com/ target=_blank><img height=137 alt="Drug Driving - Not A Safe Trip. Click Here for more Information" src="/uploadedImages/Drug Driving.gif" width=450 border=0></a></p><hr><p align=justify><a href="/gallery/index.asp?id=360"><img class=Content_IMG_W109 title="Happy People by Kim Howells" height=81 alt="Happy People by Kim Howells" src=/uploadedImages/Gallery/Happy109-KH.jpg width=109 align=left border=0></a><a href="/blogs/index.asp?id=266"><img class=AddBorder title="Rinky Dink cover picture 2" height=199 alt="Rinky Dink cover picture 2" src=/uploadedImages/Rinky_Dink-350c2.jpg width=250 align=right border=0></a>This website will be significantly updated in the next few weeks. You can choose to receive&#160;emails&#160;as future&#160;updates are avaialble&#160; <a href="/information/index.asp?id=464">(read more, to receive email updates)...</a>&#160;</p><p align=justify></p><h2 align=justify>Travel Advice</h2><p align=justify>Please see&#160;our <a href="http://admin.glastonburyfestivals.co.uk/information/index.asp?id=54">Travel Page</a>&#160;for advice on getting here by bus, and other means. Now we're licensed the information&#160;can be confirmed. Please note the last updated date and time at the bottom of each page&#160;will always indicate&#160;when the information posted was current.</p><p>&#160;</p><!--/Ektron CMS Content Block--></ecm_content></div><div id=divFooter><a href=#top>Back to top</a> &copy; 1997 - 2007 Glastonbury Festival | <a href="index.asp?id=29">Internet Policy</a></div></td><td class=siteRightContent>&nbsp;</td></tr><tr><td class=siteMainFooter><div style="display:block; float:left; clear:left; width:400px"><a href="causes/index.asp?id=148"><img src=graphics/template/oxfam.gif alt="Oxfam Logo"></a><a href="causes/index.asp?id=130"><img src=graphics/template/greenpeace.gif alt="Greenpeace logo"></a><a href="causes/index.asp?id=131"><img src=graphics/template/water.gif alt="Water Aid Logo"></a></div><div style="display:block; float:right;margin-right:10px;"><a href=http://www.qmediastream.com target=_blank><img src=graphics/template/qms.gif alt="QMediaStream Logo"></a></div></td><td class=siteRightFooter>&nbsp;</td></tr><tr><td colspan=2>&nbsp;</td></tr></table></body>",nonspam

"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"><html xmlns=http://www.w3.org/1999/xhtml lang=en-gb><!--include virtual="/_templates/local/connection.asp"--><!--include virtual="/_templates/inc/recordset_create.asp"--><!-- numPageID -1--><!-- 01 good --><!-- Begin Page properties --><!-- strSQL = SELECT tblPages.* FROM tblPages WHERE tblPages.PageID = 1;--><!-- 02 good --><!-- 03 good --><!-- 03a good --><!-- 04 good --><!--SELECT tblFeatures.*, tblFeatureList.FeatureName, tblFeatureList.Location FROM tblFeatureList INNER JOIN tblFeatures ON tblFeatureList.FeatureNameID = tblFeatures.FeatureNameID WHERE (tblFeatures.Display =True) AND (tblFeatures.PageID = 1) Order by tblFeatures.ranking;--><!-- 05 good --><!-- 06 good --><!-- 07 good --><head><meta http-equiv=Content-Type content="text/html; charset=windows-1252"><meta name=description content="Parent of all pages in site"><title>London Cycling Campaign - London Cycling Campaign</title><link rel=stylesheet type=text/css href=/_templates/basic_square/_css/main.css><!--[if lt IE 7]>
<link rel="stylesheet" type="text/css" href="" />
<![endif]--></head><body id=PageID1><div id=cdiv><div id=layout><div class=spacer></div><div id=header><div id=logo><a title="London Cycling Campaign - Home" href=/index.asp><img border=0 src=/_templates/basic_square/images/logo_temp.gif alt="London Cycling Campaign - Home" title="London Cycling Campaign - Home"></a></div><div id=banner><a target=_blank href=http://www.londonbicycle.com/ title="London Bicycle"><img border=0 src=/images/banner_londonbicycle.gif alt="London Bicycle" title="London Bicycle"></a></div><div id=globalnav><a class=box_84 href="/index.asp?PageID=27">Join</a><div class=spacer></div><a class=box_84 href="/index.asp?PageID=158">Donate</a></div></div><div class=spacer></div><div id=menutop><div class=bar><ul><li><a href="/index.asp?Pageid=1" class=ancestor title=Home accesskey=1>Home</a></li><li><a href="/index.asp?Pageid=14" title="Get involved" accesskey=2>Get involved</a></li><li><a href="/index.asp?Pageid=118" title="What we do" accesskey=3>What we do</a></li><li><a href="/index.asp?Pageid=31" title="Local groups" accesskey=4>Local groups</a></li><li><a href="/index.asp?Pageid=12" title=News accesskey=5>News</a></li><li><a href="/index.asp?Pageid=111" title="Cycling info" accesskey=6>Cycling info</a></li><li><a href="/index.asp?Pageid=4" title="About us" accesskey=7>About us</a></li><li><a href="/index.asp?Pageid=10" title="Contact us" accesskey=8>Contact us</a></li></ul></div></div><div class=spacer></div><div id=main><div id=left><!-- INCLUDE LEFT - LINKS INTERNAL --><!-- PLACE STARTING CODE (BEFORE LISTING) HERE --><div class="feature internallinks"><div class=title>Membership</div><div class=content><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=27">Join London Cycling Campaign</a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=48">Renew your membership</a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=195">Gift membership </a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=49">Members' benefits</a></p><!-- PLACE ENDING CODE HERE --></div></div><!-- INCLUDE DIY LEFT --><div class=diy><hr><p><a title="Latest campaign" href="/index.asp?PageID=846">Latest campaign</a></p><p/><p><a href="/index.asp?PageID=846"><img title="AN HGV on the road" alt="HGVs are a potential danger to cyclists" src=/images/hgv_m.jpg></a></p><a title="Lobby your MEP to vote for safer lorries" href="/index.asp?PageID=846">Lobby your MEP to vote for safer lorries</a><p/><p>Each year, 400 people lose their lives because they were not seen by lorries. Download our template letter and lobby your MEP to vote for all lorries to be fitted with life-saving mirrors.</p><p><a title="Each year, 400 people lose their lives because they were not seen by lorries. Download our template letter and lobby your MEP to vote for all lorries to be fitted with life-saving mirrors." href="/index.asp?PageID=846"></a></p></div><!-- INCLUDE lEFT - Election--><div class="feature internallinks"><div class=bartop></div><div class=title>Vote now</div><div class=content><p>Do you think all lorries should be fitted with life-saving mirrors?</p><!-- CHECK SESSION FOR STATUS --><form action=/_templates/basic_square/features/election/election_handler.asp method=post><input type=hidden name=PageID value=1><input type=hidden name=ElectionID value=6><input type=hidden id=strRedirect name=strRedirect value="/index.asp?PageID=1"><p><input type=radio value=13 name=candidateid id=13><label for=13>Yes</label></p><p><input type=radio value=14 name=candidateid id=14><label for=14>No</label></p><p>Vote now</p><p><input type=submit value=Submit id=Submit1 name=Submit1></p></form></div><div class=borderbot></div></div><!-- INCLUDE DIY LEFT --><div class=diy><hr><p><a href="/index.asp?PageID=51"><img title="London Cyclist Cover April-May 07" alt="London Cyclist Cover April-May 07" src=/images//fclc0405_homepage.jpg></a></p><p>Latest issue of <a href="/index.asp?PageID=51">London Cyclist magazine</a>out now</p><p><a href="/index.asp?PageID=27">Click here to join and receive your copy.</a></p><hr></div></div><div id=middle><h1>London Cycling Campaign</h1><!-- Include htmlArea form if editing, otherwise, just the text --><p><img title="Enjoying the canals by bike Credit: Charlotte Rushton" alt="Enjoying the canals by bike Credit: Charlotte Rushton" src=images//canal_l.jpg><br></p><p><a href="index.asp?PageID=42">London Cycling Campaign's vision is to make London a world class cycling city.</a></p><h3><hr>Featured pages <br><hr></h3><!--BEGIN Middle FEATURES--><!--INCLUDE Internal Link Index Middle--><!-- PLACE STARTING CODE (BEFORE LISTING) HERE --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=860"><img src=/images//girllookleftadrianlewis_s.jpg alt="Good cycling code" border=0></a><p><a href="/index.asp?PageID=860">&#39;Good cycling&#39; guidelines for cyclists</a><br>LCC's tips on how to enjoy your ride while showing consideration for others</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=804"><img src=/images//tourofbritain_s.JPG alt="Join LCC at the Tour de France this summer" border=0></a><p><a href="/index.asp?PageID=804">The Tour de France is coming to London! </a><br>Festivities in London start on Friday 6th July and LCC has secured an exclusive viewing area for the Prologue</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=839"><img src=/images//eastway_s.jpg alt="Help ensure a good Eastway legacy" border=0></a><p><a href="/index.asp?PageID=839">Help ensure a good Eastway legacy</a><br>The legacy of Eastway Cycle Circuit is under threat. You can help to campaign for a continued legacy of the Eastway circuits.</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=183"><img src=/images//kidramp_s.JPG alt="Community cycling grants" border=0></a><p><a href="/index.asp?PageID=183">2007 Community cycling grants </a><br>Find out how your group can apply for a grant for up to 5000 from the Community Cycling Fund for London (CCFL).</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=215"><img src=/images//pothole_s.JPG alt="Reporting potholes" border=0></a><p><a href="/index.asp?PageID=215">Reporting potholes</a><br>Potholes are a danger to cyclists and other road users. Find information on reporting a pothole or road defect in London here.<br> <br></p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=791"><img src=/images//southwarkrides_s.JPG alt="Free bike checks and cycling tips" border=0></a><p><a href="/index.asp?PageID=791">Get free bike checks and cycling tips on a Southwark Healthy Ride</a><br>Southwark Cyclists are hosting 8 free, fun and friendly Saturday bike rides led by professional cycle trainers this spring</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=175"><img src=/images//ctuk_s.JPG alt="Cycle training" border=0></a><p><a href="/index.asp?PageID=175">Cycle training</a><br>Specialist training can help you gain the skills and confidence to get on your bike.</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=24"><img src=/images//doubledeckerparking_s.JPG alt="Consultancy services" border=0></a><p><a href="/index.asp?PageID=24">Consultancy services</a><br>Our consultancy services can advise you and your business on the benefits of implementing cycling initiatives.<br></p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=283"><img src=/images//cyclelanels_s.JPG alt="How to get started" border=0></a><p><a href="/index.asp?PageID=283">How to get started</a><br>Whether you are a complete beginner or someone who is dusting off an old bike, this information is useful.</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=723"><img src=/images//city_s.JPG alt="The Cycle to Work scheme" border=0></a><p><a href="/index.asp?PageID=723">The Cycle to Work scheme</a><br>The Cycle to Work scheme is a government initiative allowing employees to buy a tax-free bike</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- START REPEATING ROW - WITH TMB --><div class=index><a href="/index.asp?PageID=728"><img src=/images//memberleafletforweb_s.JPG alt="The LCC website" border=0></a><p><a href="/index.asp?PageID=728">The LCC website</a><br>Find out just how much information on cycling in London is covered in this website, and where you can find it.</p></div><!-- END REPEATING ROW - WITH TMB --><!-- START SPACER ROW --><div class=spacer></div><!-- END SPACER ROW --><!-- PLACE ENDING CODE HERE --><!--END Middle FEATURES--><!-- Include index if so needed --></div><div id=right><div class="feature searchbox"><div class=title><label for=search1>Search</label></div><div class=content><form action="/index.asp?PageID=9" method=post name=searchbox><input type=text name=search id=search1 size=18 value="Search text" title="Enter your search text here" onfocus="this.value='';"><input class=go name=go type=submit title="Click to search" value=GO></form><div class=spacer></div></div></div><!--BEGIN RIGHT FEATURES --><!-- INCLUDE RIGHT - LINKS INTERNAL --><!-- PLACE STARTING CODE (BEFORE LISTING) HERE --><div class="feature internallinks"><div class=bartop></div><div class=title>Quick links</div><div class=content><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=15">Campaigns</a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=28">Rides and events</a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=16">Working with communities</a></p><!-- BEGIN REPEATING CODE --><p><a href="/index.asp?PageID=13">Working with businesses</a></p><!-- PLACE ENDING CODE HERE --></div><div class=borderbot></div></div><!-- INCLUDE RIGHT - RSS newsbox --><div class="feature news"><div class=bartop></div><div class=title>News</div><div class=content><p><a href="http://www.lcc.org.uk//index.asp?PageID=849"> Transport for London to address cyclist and pedestrian needs at Goswell Road island</a><br> A big thank to everyone who signed the Goswell Road Island Petition either in person or via email <br><br><a href="http://www.lcc.org.uk//index.asp?PageID=853"> Met police appeal against decision to allow Critical Mass</a><br> Met Commissioner insists on going ahead with appeal against the decision to allow the Critical Mass bike ride to continue in London. <br><br><a href="http://www.lcc.org.uk//index.asp?PageID=848"> Community Cycling Fund for London is now accepting applications</a><br> LCC's community grants scheme CCFL, funded by Transport for London, is now accepting applications. Find out how your group can apply for a grant of up to 5000 <br><br><a href="http://www.lcc.org.uk//index.asp?PageID=844"> The national roll-out of the Bikeability training scheme has arrived</a><br> Following a very successful pilot scheme, the national roll-out of the Bikeability cycle training scheme has begun <br><br><a href="http://www.lcc.org.uk//index.asp?PageID=842"> Cyclists need more protection from HGVs, say campaigners</a><br> LCC, CTC and Roadpeace are calling on the Government and local authorities to take immediate steps to reduce the danger of HGVs to pedestrians, cyclists and bikers </p><p><a href=/rss/LCCNews.xml title="LCC News RSS feed. Drag to your newsreader to subscribe"><img border=0 src=/_templates/basic_square/images/rss.gif width=28 height=14></a>&nbsp;<a href=/rss/LCCNews.xml title="LCC News RSS feed. Drag to your newsreader to subscribe">LCC News</a></p></div><div class=borderbot></div></div><!--END RIGHT FEATURES--><div><script type=text/javascript><!--
