</script></td></tr><tr><td></td></tr></table></td><td valign=top><table width=100% border=0 cellspacing=0 cellpadding=8><tr><td><div class=Title><strong><font size=5 color=#006600 face="Times New Roman, Times, serif"><em>Why grow grapes?</em></font><br></strong><span class=body>Grapes are a tremendously satisfying fruits to grow in your own garden. They have a wide range of uses i.e. for, eating (dessert), making into juice, wine (sparkling and still), vinegar and the vine leaves, which have such beautiful shapes and colours, are wonderful decoration for both indoors and outdoors, cut and uncut.</span></div><p><strong><font size=5 color=#006600 face="Times New Roman, Times, serif"><em>An ancient crop.</em></font><font face="Times New Roman, Times, serif"><br></font><span class=body> Grape vines have been on earth for millions of years. Fossil remains of Vitas sezzanensis, the 'European' vine's ancestor, have been found which are ten million years old.</span></strong></p><p><strong><font size=5 color=#006600 face="Times New Roman, Times, serif"><em>Lacking the ability or confidence?</em></font><font face="Times New Roman, Times, serif"><br></font><span class=body> There are thousands of gardeners who would just love to 'have a go' at growing a grape vine or two but dare not embark on the project because of lack of confidence and the fear of failing. There are many today who are growing vines quite successfully - the accomplished amateur- but need a little more help to promote better cropping or, perhaps, help with pests and disease control.</span></strong></p><strong><font size=5 color=#006600 face="Times New Roman, Times, serif"><em>Helpful, practical information.</em></font><br><span class=body><font class=body face="Helvetica, Geneva, Arial, sans-serif">Whether you are a first-time grower with little or no knowledge of vines or a grower of some experience but still needing some practical guidance, this new book will give you the answers to your queries.</font></span></strong></td></tr><tr><td></td></tr></table></td></tr></table><p></p></body>",nonspam

