		</style></head><body style="background-color: #000000"><script type=text/javascript src=code.js></script><div id=frame><div class=innerframe><div class=contentheader><a href=index.htm title="Polished plaster UK">HOME</a> &nbsp; <a href=gallery.htm title="Polished plaster gallery">GALLERY</a> &nbsp; <a href=products.htm title="Polished plaster products">PRODUCTS</a> &nbsp; <a href=whyus.htm title="Why choose Polished plaster">WHY CHOOSE US</a> &nbsp; <a href=faq.htm title="Frequently Asked Questions">FAQ</a></div><div id=layer6 class=content><div class=contenttop style="width: 665; height: 456"><div id=layer2 class=flash><script type=text/javascript src=flash.js></script></div><h1>The POLISHED PLASTER Co</h1><p>Welcome to our Polished Plaster website. I hope to tell you a little more about Italian polished plaster and the brilliant wall finishes we can achieve with our plaster products. </p><p><span class=style1>Polished plaster - <a href=http://www.polishedplastercompany.co.uk/store/catalog/POLISHED-PLASTER-COURSE-p-1-c-3.html>Course</a></span><br> We are now offering a 4 day intensive hands-on Polished Plastering Course. For more details visit<br><a href=http://www.polishedplastercompany.co.uk>www.polishedplastercompany.co.uk</a></p><p>Polished Plaster - Italian Plaster - Venetian Plaster </p><p>Polished plaster is also known as Italian plaster, Venetian plaster, Marble plaster, or Stucco. All of our plasters are available in a standard palette or in custom colours. </p></div><div id=layer1 class=contentleft><div align=center style="color:#FFFFFF; font-size:10px; "><p>MENU</p></div><p><a href=index.htm title="Polished plaster UK">HOME</a><br><a href=gallery.htm title="Polished plaster gallery">GALLERY</a><br><a href=products.htm title="Polished plaster products">PRODUCTS</a><br><a href=whyus.htm title="Why choose Polished plaster">WHY CHOOSE US</a><br><a href=faq.htm title="Frequently Asked Questions">FAQ</a><br><a href=links.htm title="Links of interest">LINKS OF INTEREST</a> <br><a title="History of polished plaster" href=history.htm>HISTORY</a></p></div><div id=layer5 class=contentmiddle><p class=title>CONTACT INFO</p><ul><li>Phil 077898 61315</li><li>Cain 07900 998033</li><li>Phil 01535 603956</li><li>fax 01535 662708</li><li><a href=mailto:info@polishedplaster.co.uk title="Email Polished Plaster">info@polishedplaster.co.uk</a></li></ul></div><div id=layer4 class=contentright><p class=title>SPOT LIGHT</p><p><a href=http://www.polishedplaster.co.uk/MARM.jpg title="Marmorino Polished Plaster"><img src=http://www.polishedplaster.co.uk/MARMSMALL.jpg alt="Polished Plaster" width=100 height=100 hspace=10 border=0 align=right></a>This is a classic Marmorino plaster in our colour 51. The venetian plaster has a cut stone texture.</p></div><div id=layer3 class=message><script type=text/javascript src=message.js></script></div><div class=contentfoot style=' color: black; font-size: medium; font-family: "Century Gothic"; background-color: #4a4a4a; text-align: left; visibility: visible; display: block; padding: 10px 0 0 3px; position: absolute; top: 516px; left: -1px; width: 664px; height: 26px'><p>&copy; 2004 the POLISHED PLASTER Co</p></div></div></div></div><script src=http://www.google-analytics.com/urchin.js type=text/javascript>
