order=0 alt></td><td><img src=images/spacer.gif width=3 height=1 border=0 alt></td><td><img src=images/spacer.gif width=13 height=1 border=0 alt></td><td><img src=images/spacer.gif width=13 height=1 border=0 alt></td><td><img src=images/spacer.gif width=23 height=1 border=0 alt></td><td><img src=images/spacer.gif width=10 height=1 border=0 alt></td><td><img src=images/spacer.gif width=22 height=1 border=0 alt></td><td><img src=images/spacer.gif width=21 height=1 border=0 alt></td><td><img src=images/spacer.gif width=19 height=1 border=0 alt></td><td><img src=images/spacer.gif width=10 height=1 border=0 alt></td><td><img src=images/spacer.gif width=5 height=1 border=0 alt></td><td><img src=images/spacer.gif width=9 height=1 border=0 alt></td><td><img src=images/spacer.gif width=101 height=1 border=0 alt></td><td><img src=images/spacer.gif width=6 height=1 border=0 alt></td><td><img src=images/spacer.gif width=7 height=1 border=0 alt></td><td><img src=images/spacer.gif width=1 height=1 border=0 alt></td></tr><tr><td colspan=34><img src=images/image_r1_c1.gif alt name=image_r1_c1 width=759 height=124 border=0 usemap=#image_r1_c1Map id=image_r1_c1></td><td><img src=images/spacer.gif width=1 height=124 border=0 alt></td></tr><tr><td colspan=25 valign=top bgcolor=#f7f7f7><table width=100% border=0 cellspacing=4 cellpadding=4><tr><td><p><span class=heading>Welcome to the web site of Lepton United Football club</span><br><span class=text>We are based in the village of Lepton, 3 miles south of Huddersfield, West Yorkshire, England.<br> The club was formed in 1993 with the name Lepton Badgers Junior Football Club and remained for a number of years a club which focused on junior football for the Under 10s. In the last five years the club has developed in size and success and now has 8 teams playing junior football (Under 11s - Under 16s) and 4 teams (Under 9s &amp; Under 10s) playing mini soccer in the Huddersfield &amp; District Junior Football league. The club membership now exceeds 200 and our plans to expand this with girls and open age football are showing great promise. In this our tenth anniversary year, a new club name and big plans to develop sports facilities in partnership with our local school bring new challenges for our club and supporters. I hope you like our site and please come back soon to keep up with what is happening at Lepton United.</span></p></td></tr></table></td><td rowspan=2 colspan=9><div align=right><img src=images/u9s_score.jpg alt name=image_r2_c26 width=194 height=145 border=1 id=image_r2_c26><!--Lepton United Under 9s scoring the winning goal against Wakefield Celtic - 13/9/03 --></div></td><td><img src=images/spacer.gif width=1 height=124 border=0 alt></td></tr><tr><td colspan=6><img src=images/image_r3_c1.gif alt name=image_r3_c1 width=142 height=27 border=0 id=image_r3_c1></td><td colspan=19><img src=images/image_r3_c7.gif alt name=image_r3_c7 width=417 height=27 border=0 usemap=#image_r3_c7Map id=image_r3_c7></td><td><img src=images/spacer.gif width=1 height=27 border=0 alt></td></tr><tr><td rowspan=12 background=images/image_r4_c1.gif><img src=images/image_r4_c1.gif alt name=image_r4_c1 width=10 height=8 border=0 id=image_r4_c1></td><td colspan=4 rowspan=12 align=left valign=top><!-- Poll Starts Here --><script language=JavaScript>
