745 bgcolor=#CCFF99> <div align=justify><font size=2 face="Arial, Helvetica, sans-serif">The picturesque village of <strong>Ashton under Hill</strong> is situated in the south of the county of Worcestershire, England, at the eastern end of Bredon Hill and overlooking the Vale of Evesham. The northern Cotswolds are close at hand and nearby towns include <a href=http://www.evesham.uk.com/ >Evesham</a>, <a href=http://www.visitpershore.co.uk/ >Pershore</a>, <a href=http://www.cotswolds.info/places/broadway.shtml>Broadway</a> and <a href=http://www.tewkesbury.net/default.asp>Tewkesbury</a>. Formerly part of of the county of Gloucestershire, Ashton under Hill is now in the <a href=http://wychavon.whub.org.uk/static/wdcindex.htm>Wychavon</a> district of <a href=http://hub.whub.org.uk/home/hubindex.htm>Worcestershire.</a></font></div></td></tr></table><p><a href="http://maps.google.co.uk/maps?f=q&hl=en&q=ashton+under+hill&sll=53.098145,-2.443696&sspn=8.621018,20.43457&ie=UTF8&z=12&ll=52.041933,-2.005348&spn=0.137895,0.4319&om=1&iwloc=addr" target=_blank style="margin-top: 0; margin-bottom: 0;" align=left>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=images/HowtoFindusbutton.gif width=200 height=50 border=0></a>&nbsp; <a href="http://uk.weather.com/weather/local/UKXX1521?x=20&post=&code=&y=11" target=_blank><img src=images/Localweatherbutton.gif width=200 height=50 border=0></a>&nbsp; <a href=information/index.shtml><img src=images/Bustimetablesbutton.gif width=200 height=50 border=0></a></p><table width=749 height=1480 border=0 cellpadding=5 bgcolor=#FFFFFF><tr valign=top><th width=260 height=1232 align=left bgcolor=#BDF57E scope=row><p align=center style="margin-bottom: 0">&nbsp;</p><p align=center style="margin-top: 0;"><a href=images/Cherry-Tree-for-Web.jpg target=_blank><img src=images/Cherry-Tree-thumbnail.jpg width=240 height=167 border=0></a></p><p align=center><a href=images/Native-Daffodil-2-for-Web_000.jpg target=_blank><img src=images/Native-Daffodil-2-thumbnail_000.jpg width=180 height=245 hspace=0 vspace=0 border=0></a></p><p align=center><a href=images/Bluebells-Ashton-Wood-for-w.jpg target=_blank><img src=images/Bluebells-Ashton-Wood-thumb_000.jpg width=240 height=180 border=0></a></p><p>&nbsp;<a href=images/hedgehogsforWeb.jpg target=_blank><img src=images/hedgehogsthumb.jpg width=240 height=170 border=0></a></p><p align=center>&nbsp;</p><p align=center><a href=images/CorylopsisSpicataforweb.JPG target=_blank><img src=images/CorylopsisSpicatathumb.JPG width=180 height=254 hspace=0 vspace=0 border=0></a></p><p align=center style="margin-bottom: 0;"><strong><font size=2><em>See more pictures</em></font></strong><em><font size=2> in our </font></em></p><p align=center style="margin-top: 0; margin-bottom: 0;"><em><a href=gallery/index.shtml target=_blank><font size=2>Village Gallery</font></a></em></p></th><td width=463 valign=top bgcolor=#CCFF99> <h3 style="margin-top: 0;"><font color=#339933 size=5>Village News</font></h3><p align=justify class=style2><span class=style4><span class=style5>New </span></span><span class=style3>See pictures of Ashton's</span><span class=style4> Palm Sunday procession </span><span class=style3>in our </span><span class=style4><a href=gallery/events.shtml>Village Events</a> </span><span class=style3>gallery </span></p><ul><li><font size=2 style="margin-top: 0; margin-bottom: 0;" align=justify>The <strong>Minutes of the Parish Council Meeting</strong> and the <strong>Annual Parish Meeting</strong> on <strong>13th March 2007 </strong>are now available. <a href=council/minutes.shtml>Click here to visit our Parish Council Minutes page</a>.</font></li></ul><div align=justify><ul style="margin-top: 0; margin-bottom: 0;"><li><font color=#FF0000 size=2 style="margin-top: 0; margin-bottom: 0;"><font color=#000000> The <strong>March/April edition</strong> of our regular village newsletter <strong>ASHTON NEWS </strong>is available for download. <a href=filearchive/newsletter.shtml>Click here to go to our Ashton News page.</a> </font></font><font color=#000000 size=2 style="margin-top: 0; margin-bottom: 0;"><em>The deadline for contributions to the next issue (May/June) is <strong>Friday 4th May</strong>.</em></font></li></ul></div><div><div align=justify><div></div></div></div><ul style="margin-top: 0;"><li><div align=justify><font size=2>The final published version (in full colour with photos) of the <strong>Ashton under Hill Conservation Area Appraisal</strong> is available to download from the <a href=http://wychavon.whub.org.uk/home/wdc-planning-her-con>Wychavon District Council </a>website. <a href=http://wychavon.whub.org.uk/home/wdc-planning-her-ashton-under-hill.pdf.pdf target=_blank>Click here to download the document (2.93MB PDF). </a>See also our <a href=news/articles/150106ConsArea.shtml>Conservation Area Review</a> page.</font></div></li></ul><div align=justify><ul style="margin-top: 0; margin-bottom: 0;"><li><font size=2>A new booklet, <strong>The History of St Barbara's Church</strong>, Ashton under Hill, has recently been published. <a href=news/articles/160107StBarbaras.shtml>Click here for more details</a></font></li></ul></div><div align=justify></div><div align=justify></div><div align=justify></div><div align=justify></div><div align=justify><ul style="margin-bottom: 0;"><li><font size=2><strong><font color=#FF0000><font color=#000000><span style="background-color: #CCFF99">Old pictures of Ashton wanted! </span></font></font></strong><font color=#FF0000><font color=#000000><span style="background-color: #CCFF99">Photos are needed for a planned new exhibition in the village, during this year's <a href=http://www.ashtonopengardens.co.uk>Ashton Open Gardens </a>in June. If you have any old photos - up to and including the 60s, 70s and 80s - which you're willing to let us copy, please contact <strong>John Dodge 01386 881487 </strong>at The Old Farmhouse, Elmley Road, Ashton.</span></font></font></font></li></ul></div><div align=justify> </div><div align=justify></div><div align=justify><ul style="margin-bottom: 0;"><li><font size=2><strong style="margin-top: 0; margin-bottom: 0;">Wanted! </strong>Volunteers are needed to help on the day with the <strong><a href=http://www.ashtonopengardens.co.uk/index.html target=_blank>Ashton Open Gardens</a> </strong>event, Saturday and Sunday <strong>June 9th and 10th</strong>. Even if you can only spare an hour or so to help with things like programme sales, car parking, catering, plant stalls or point duty, your time would be very much appreciated. Please contact <strong>John Kenrick 881431</strong> or <strong>07767 464 826</strong>. Thanks!</font></li></ul></div><div align=justify></div><div align=justify></div><div align=justify></div><div align=justify> </div><div align=justify></div><ul style="margin-bottom: 0;"><li><font size=2>Updated <strong>Footpaths Progress Report.</strong></font></li></ul><blockquote style="margin-top: 0;"><p style="margin-top: 0;"><font size=2><a href=information/footpaths.shtml style="margin-top: 0; margin-bottom: 0;">Click here to visit our Footpaths page</a>.</font></p></blockquote><ul style="margin-bottom: 0;"><li><font size=2 face=Arial style="margin-top: 0; margin-bottom: 0;"><strong><a href=http://www.eveshamartscentre.co.uk/whatson.html target=_blank>What's On at the Evesham Arts Centre?</a> </strong></font></li></ul><blockquote style="margin-top: 0; margin-bottom: 0;"><p style="margin-top: 0; margin-bottom: 0;"><font size=2 face=Arial style="margin-top: 0; margin-bottom: 0;"><strong>&nbsp; </strong></font></p></blockquote><p style="margin-top: 0;"><font color=#339933 size=5 face=Arial><strong>Useful Information</strong></font></p><p><strong><font size=2><a href=http://auhcc.play-cricket.com/home/home.asp target=_blank>Ashton under Hill Cricket Club Centenary</a></font></strong></p><p><font size=2><a href=http://www.canbush.com/boxes.htm target=_blank><strong>Bredon Hill Postboxes</strong></a><strong> </strong><em>(including two in Ashton)</em></font></p><p><font face=Arial size=2><a href=news/articles/150106ConsArea.shtml><strong>Ashton under Hill Conservation Area</strong> description and map</a></font></p><p><font size=2><a href=news/articles/310306VPlanfinal.shtml><strong>Ashton under Hill Village Plan 2006</strong></a></font></p><p><font size=2><a href=documents/VillageInformationBooklet2006.pdf target=_blank><strong>2006 Ashton Under Hill Information Booklet</strong>.</a></font></p><p><font size=2><strong><a href=organisations/gardening/documents/2007GardeningClubProgramme.pdf>Gardening Club Programme for 2007</a></strong></font></p><p><font color=#000000 size=2><span style="background-color: #D5F9AC"><a href=organisations/music/index.shtml><strong>Parish Music Programme 2006/7</strong></a></span></font></p><p><font size=2><a href=http://www.wdcra.org.uk/ashton.htm target=_blank><strong>Bell Ringing at St. Barbara's</strong></a></font></p><p><font size=2><a href=information/surroundingvillages.shtml><strong>Websites of neighbouring villages</strong></a></font></p><p style="margin-bottom: 0;"><font size=2><a href=news/articles/AircrashinAuH.shtml><strong>A wartime aircrash in Ashton</strong></a></font></p></td></tr><tr valign=top><th height=241 align=left bgcolor=#BDF57E scope=row> <p align=center><a href=images/Winter-Snow1-for-web.jpg target=_blank><img src=images/Winter-Snow1-thumb.jpg width=240 height=180 border=0></a></p><p align=center style="margin-bottom: 0;"><em><font size=2>See more pictures in our</font></em></p><p align=center style="margin-top: 0; margin-bottom: 0;"><em><font size=2><a href=gallery/seasons_winter.shtml>Winter Gallery </a></font></em></p></th><td valign=top bgcolor=#D5F9AC> <h3 style="margin-top: 0;"><font color=#339900 size=5><strong>Upcoming Events</strong><a href=events/index.php>&nbsp; <font size=3>Click here for our events diary</font></a> </font></h3><p style="margin-bottom: 0;"><em><font size=2>6th May - Tea on the Lawn - Rail's End Nursery - 3.00pm</font></em></p><p style="margin-top: 0; margin-bottom: 0;"><em><font size=2>12th May - Parish Music Concert - Alstone Church - 8.00pm</font></em></p><p style="margin-top: 0;"><em><font size=2>20th May - Annual Service of Thanksgiving - St Barbara's Church - 9.30am</font></em></p><p style="margin-bottom: 0;">&nbsp;</p><p align=center style="margin-top: 0; margin-bottom: 0;"><em><font size=2>Pictures on this page by Russ Cook, Jeremy King,</font></em></p><p align=center style="margin-top: 0; margin-bottom: 0;"><em><font size=2>Malcolm Nelson and Roger Umpelby.</font></em></p></td></tr></table><div align=left><table width=750 height=91 border=0 align=left bgcolor=#F9EDAC><tr valign=top><th width=744 scope=row> <p style="margin-bottom: 0">&nbsp;</p><p style="margin-top: 0;"><font color=#000000 size=3><a href=images/Robin07-for-web.jpg target=_blank><img src=images/Robin07-thumb.jpg width=148 height=210 border=0></a><a href=images/Autumn-Colour-1-for-web_000.jpg target=_blank>&nbsp;&nbsp; </a><a href=Winter-deer-for-web.jpg.jpg target=_blank><img src=images/Winter-deer-thumb.jpg width=297 height=210 border=0></a><a href=images/Frost-on-cobweb-for-Web.jpg target=_blank> &nbsp; </a><a href=images/Early-snowdrop.jpg target=_blank><img src=images/Early-snowdrop-thumb.jpg alt="Early snowdrop in Ashton, November 2006; Jeremy King" width=157 height=210 hspace=0 vspace=0 border=0></a><a href=images/12310008.jpg target=_blank>&nbsp; &nbsp;&nbsp;&nbsp; </a><a href=images/Ashton-Woods-for-Web.jpg target=_blank>&nbsp; &nbsp; </a></font></p><div align=left><p align=left style="margin-top: 0; margin-bottom: 0;"><font size=2>If you have any information such as news, events or village information you'd like to contribute to the village site, then please <a href=/contactus/ >email us</a> your item and we will put it online as soon as possible. We would be most grateful for any assistance you may be able to provide</font></p></div><p align=left><font size=2>Any feedback you have about our website would be most appreciated, please use the <a href=/contactus/ >contact form</a> to let us know how we can improve it.</font></p></th></tr></table></div></div></td></tr><tr><td valign=bottom colspan=2><div class=footer>Designed by <a href="http://www.deepmedia.co.uk/landing.php?source=ashton" style=color:AAAAAA; target=_top>Deepmedia Solutions Ltd.</a></div></td></tr></table></td> </tr> </table></body>",nonspam

