ttons/printer.gif title="Show Printable Version"></a></span><span class=smallfont> 0 Replies | 3 Views</span></td></tr></tbody></table><div><img src=http://www.anglerscircle.co.uk/Fishing-Forums/clear.gif height=15 alt></div><table align=center border=0 cellpadding=6 cellspacing=1 class=tborder width=100%><thead><tr><td class=tcat colspan=0><a href=#top onclick="return toggle_collapse('module_4_10')" style=float:right><img alt border=0 id=collapseimg_module_4_10 src=http://www.anglerscircle.co.uk/Fishing-Forums/images/buttons/collapse_tcat.gif></a><span class=smallfont><strong> <a href="http://www.anglerscircle.co.uk/Fishing-Forums/showthread.php?t=10">Hooked On Maggots</a></strong></span></td></tr></thead><tbody id=collapseobj_module_4_10 style><tr><td class=thead> Apr 04, 2007 - 2:02 PM - by <a href="http://www.anglerscircle.co.uk/Fishing-Forums/member.php?s=0c21479d37419ac0c97fae35211a51d2&u=1" rel=nofollow>Darren</a></td></tr><tr><td align=left class=alt1 valign=top> Maggots in their uncoloured, unflavoured form are often highly successful but a bright, enticingly flavoured bait will sometimes give you the edge.<br><br> It's Obviously important when fishing that the fish can see your bait and they like what they see. For example when fishing on murky waters a plain maggot may be hardly visible, whereas a bright red or yellow specimen may show up clearly. There are a few things you can do to enhance their appeal.<br><br> ... <span class=smallfont>[<a href="http://www.anglerscircle.co.uk/Fishing-Forums/showthread.php?s=0c21479d37419ac0c97fae35211a51d2&t=10">Read More</a>]</span></td></tr><tr class=alt2 valign=middle><td valign=middle><span style=float:right><a href="http://www.anglerscircle.co.uk/Fishing-Forums/sendmessage.php?s=0c21479d37419ac0c97fae35211a51d2&do=sendtofriend&t=10"><img alt border=0 src=http://www.anglerscircle.co.uk/Fishing-Forums/images/buttons/sendtofriend.gif title="Send to Friend"></a><a href="http://www.anglerscircle.co.uk/Fishing-Forums/printthread.php?s=0c21479d37419ac0c97fae35211a51d2&t=10"><img alt border=0 src=http://www.anglerscircle.co.uk/Fishing-Forums/images/buttons/printer.gif title="Show Printable Version"></a></span><span class=smallfont> 0 Replies | 105 Views</span></td></tr></tbody></table><div><img src=http://www.anglerscircle.co.uk/Fishing-Forums/clear.gif height=15 alt></div><table align=center border=0 cellpadding=6 cellspacing=1 class=tborder width=100%><thead><tr><td class=tcat colspan=0><a href=#top onclick="return toggle_collapse('module_4_2')" style=float:right><img alt border=0 id=collapseimg_module_4_2 src=http://www.anglerscircle.co.uk/Fishing-Forums/images/buttons/collapse_tcat.gif></a><span class=smallfont><strong> <a href="http://www.anglerscircle.co.uk/Fishing-Forums/showthread.php?t=2">Making the Most of Meat as a Fishing Bait</a></strong></span></td></tr></thead><tbody id=collapseobj_module_4_2 style><tr><td class=thead> Apr 04, 2007 - 9:00 AM - by <a href="http://www.anglerscircle.co.uk/Fishing-Forums/member.php?s=0c21479d37419ac0c97fae35211a51d2&u=1" rel=nofollow>Darren</a></td></tr><tr><td align=left class=alt1 valign=top><img src=http://www.langfordlakes.co.uk/fishing/images/bait/Luncheon%20Meat01.jpg align=left border=0 hspace=5 alt=Image><br><font face=Arial>Chub, Barbel, and Carp enjoy meet as much as we do. Even fish as different as dace and catfish will occasionally feast on it. Luncheon meet is the most popular of the meat baits for fishing and sausage meet is also effective. </font><br><br><font face=Arial>We have all heard tales of fisherman who, often out of desperation,... <span class=smallfont>[<a href="http://www.anglerscircle.co.uk/Fishing-Forums/showthread.php?s=0c21479d37419ac0c97fae35211a51d2&t=2">Read More</a>]</span></td></tr><tr class=alt2 valign=middle><td valign=middle><span style=float:right><a href="http://www.anglerscircle.co.uk/Fishing-Forums/sendmessage.php?s=0c21479d37419ac0c97fae35211a51d2&do=sendtofriend&t=2"><img alt border=0 src=http:/