				<p>Fundraising now hits 13 million since 1992 for the UK and $450 million globally since the launch.</p>
				--></div><div id=bodyArticle><!--
			<p>With your support, in 2005, the Avon Breast Cancer Crusade raised 1.2 million.  The Shake It campaign raised over 400,000 to benefit both Breakthrough Breast Cancer and Breast Cancer Care and the rest of the fundraising continues to support our long-term charity partner, Breakthrough Breast Cancer.  For further information on how this money is being used, please visit the <a href="support.asp" title="Who we support">who we support</a> section.</p>
