                @import url(/css/custom.css);
            </style><link href=/css/print.css media=print type=text/css rel=stylesheet><script src=/javascript/form-check.js type=text/javascript> </script><meta content="text/html;charset=utf-8" http-equiv=Content-Type><meta content=follow name=robots><meta content=http://www.apig.org.uk/ name=author><meta content="© All Party Parliamentary Internet Group 2006" name=copyright><meta content="text/html;charset=utf-8" http-equiv=Content-Type><meta content=Triple-A scheme=WCAG name=eGMS.accessibility><meta content=text/html name=DC.format><meta content="Client Area for Example" name=DC.title><meta content="All Party Parliamentary Internet Group, Editor" name=DC.creator><meta content=11-05-2005 name=DC.date.issued><meta content=en name=DC.language></head><body><div id=mainwrap><div id=header><img alt="APIG, All Party Internet Group" src=/images/apig_logo.jpg><span class=rm>|</span><a href=#navigation class=rm>skip to navigation</a><span class=rm>|</span><div id=decoration> </div></div><div id=wrap1><div id=content><h1>Home</h1><p>The All Party Parliamentary Internet Group (APIG) exists to provide a discussion forum between new media industries and Parliamentarians for the mutual benefit of both parties. Accordingly, the group considers Internet issues as they affect society informing current Parliamentary debate through meetings, informal receptions and reports. The group is open to all Parliamentarians in both the House of Commons and House of Lords.</p><p>The All Party Parliamentary Internet Group (APIG) released its report into Digital Rights Management on Monday June 5th. The inquiry received over 90 written submissions from consumers, Think Tanks, libraries, print media publishers, the film and music industries and lawyers. An oral evidence session was organised at the House of Commons in February when a cross selection of the respondents were invited to give evidence to APIG officers. <a href=/current-activities/apig-inquiry-into-digital-rights-management.html>Visit the Digital Rights Management page for full details.</a> </p><p>On October 12th, APIG took part in the Parliament and the Internet Conference held in Portcullis House, the Houses of Parliament. More details about this conference can be found <a href=http://www.parliamentandinternet.org.uk/ >here</a></p><p>If you would like to find out more about APIG, please <a href=mailto:admin@apig.org.uk>contact the secretariat.</a> </p></div></div><div id=navigation><div><h2 class=rm>Main Navigation</h2><ul><li class=selected><strong>Home</strong></li><li><a href=/membership.html>Membership</a></li><li><a href=/apig-officers.html>APIG officers</a></li><li><a href=/current-activities.html>Current activities</a></li><li><a href=/apig-in-the-news.html>APIG in the news</a></li><li><a href=/archive.html>Archive</a></li><li><a href=/contact.html>Contact</a></li></ul></div></div><br class=cl></div><div id=footer><p><img src=/images/portcullis.gif alt="Portcullis House Logo"><br>All Party Parliamentary Internet Group </p><ul><li><a href=mailto:admin@apig.org.uk>admin@apig.org.uk</a> | </li><li><a href=/terms.html>Terms and Conditions</a> | </li><li><a href=/privacy.html>Privacy Statement</a> | </li><li><a href=/about-site.html>About This Site</a> | </li><li><a href=/help.html>Help</a> | </li><li><span>Developed by </span><a href=http://www.nomensa.com/ >Nomensa</a></li></ul></div></body>",nonspam

