f alt="Men's 2nd XI v Woking Wasps - Click here to see more images" width=240 height=144 border=0></a></td></tr></table><p><br></p></td><td valign=top><table width=100% height=80 border=0 cellpadding=0 cellspacing=0><tr><td width=30 valign=top background=img/pageLayout/header_middle.gif><a name=top></a></td><td align=center valign=top background=img/pageLayout/header_bg.gif> <table width=400 height=60><tr><td valign=bottom><a href=#xmas></a><a href=#racenight></a></td></tr></table></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>Welcome to the Cheam Hockey Club website</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p>Founded in 1920, Cheam Hockey Club is one of the oldest hockey clubs in Surrey. At Cheam Hockey Club we welcome new supporters, spectators and playing members of all ages and abilities! We run Ladies, Men's, Men's Vets, Mixed and Junior sides and play League and Friendly games from September to April, with occasional summer fixtures too. There is weekly training, an annual tour and many other social events organised throughout the year.</p><p align=right>Interested in Joining us? <a href=new_member_info.html class=bodyLink>click here</a>.</p></td><td width=28 background=img/pageLayout/box_rightMiddle.gif>&nbsp;</td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height