</td><td>8.15pm</td><td>Croydon v Cheam</td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Tuesday 22 MAY</td><td>7.15pm</td><td>Cheam v Epsom Cocktails </td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Wednesday 30 MAY</td><td>8.15pm</td><td>Mitcham v Cheam</td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Tuesday 12 JUNE</td><td>7.15pm</td><td>Cheam v Pikey&rsquo;s Pearls</td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Wednesday 20 JUNE</td><td>7.15pm</td><td>Merton v Cheam </td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Tuesday 26 JUNE</td><td>7.15pm</td><td>Surbiton v Cheam</td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Tuesday 3 JULY</td><td>8.15pm</td><td>Cheam v Surbiton 3 + 1</td><td>&nbsp;</td></tr><tr align=center valign=middle><td>Monday 9 JULY</td><td>8.15pm</td><td>Barnes B v Cheam</td><td>&nbsp;</td></tr></table><p align=center>Contact <a href=mailto:sarah.jones@cheamhockeyclub.co.uk class=bodyLink>Sarah Jones</a> (07961 068822) if you are interested in playing.<br></p></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>AGM - May 21st </td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td valign=top background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p align=center>The Club AGM will be held at the clubhouse on May 21st 2007 </p></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>The Seige of Troy 2007 - Photos </td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td align=center valign=top background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p align=center><strong><a href=events/2007_04_08_trojans_tour_part_1/2007_02_11%20037.html><img src=events/2007_04_08_trojans_tour_part_1/images/2007_02_11%20089.jpg alt="Click here to see the photos from this years Easter Tour" width=450 height=276 border=0 class=imgBorder title></a></strong></p><p align=center>As there were so many pictures (after editing them down)<br> I have had to group the pictures into four batches. </p><p align=center><a href=events/2007_04_08_trojans_tour_part_1/index.html class=bodyLink>Part 1</a> | <a href=events/2007_04_08_trojans_tour_part_2/index.html class=bodyLink>Part 2</a> | <a href=events/2007_04_08_trojans_tour_part_3/index.html class=bodyLink>Part 3</a> | <a href=events/2007_04_08_trojans_tour_part_4/index.html class=bodyLink>Part 4</a> </p></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class="boxTitle style11">Rotterdam - 6-a-side Tournament </td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><table width=100% border=0 cellpadding=0 cellspacing=0><tr><td valign=top><p align=center><strong>When: </strong>15th-17th June<br><strong>Where:</strong> Rotterdam</p><p align=center>&nbsp;&nbsp;&hellip; A fun weekend at the 19th International HVB Six-a-Side hockey tournament with Hockey, Pasta, Parties, Vino, Beer, Festa <br> &nbsp;&nbsp;&hellip; An International hockey weekend for Women, Men and/or Mixed teams (competition- or recreational teams) <br> &nbsp;&nbsp;&hellip; Friday night a Buona Sera for the first guests in our Espresso Bar <br> &nbsp;&nbsp;&hellip; Saturday hockey matches 6 against 6 on half a pitch, followed by the Big Bad Italian BBQ <br> &nbsp;&nbsp;&hellip; Saturday night Birra and Vino during the Italian Style Vestiti <br> &nbsp;&nbsp;&hellip; Swinging party with hot dj's and Italian (Gangster) Style as dresscode! <br> &nbsp;&nbsp;&hellip; Sunday the Hockey finals and a sunny Festa to end the weekend <br> &nbsp;&nbsp;&hellip; Bonus when payment is fulfilled <u>before</u> 28 May 2007 * 10 beer tokens for free!! <br> &nbsp;&nbsp;&hellip; Camping facilities near the pitch available (bring your own tent!) </p><p align=center><img src=img/temp/rotterdam_tour.gif alt="Rotterdam Tour" width=150 height=97 border=1></p><p align=center>We are likely to be taking both mens and ladies teams, so anyone interested in playing, please let me know.</p><p align=center><a href=http://six-a-side.hvbleiswijk.nl/gb/index.html target=_blank class=bodyLink>Click here for more details</a> </p><p align=center><a href=mailto:sparky@cheamhockeyclub.co.uk class=bodyLink>Sparky</a><br></p></td></tr></table></td><td width=28 valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class="boxTitle style11">Riverside Tournament - August </td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><table width=100% border=0 cellpadding=0 cellspacing=0><tr><td valign=top><p align=center>Riverside Mixed Hockey Club are organising their sixth Mixed 7-a-side hockey tournament this August on the weekend of the 11th &amp; 12th August 07. After last years successful tournament for 40 teams, we aim to improve to provide a weekend you will enjoy and want to return to, so <br><br><strong>The Venue</strong><br><a href="http://www.multimap.com/map/browse.cgi?pc=SM7%203HU" target=_blank class=bodyLink>Purley Walcountians Hockey Club, Cashalton Road, Woodmansterne, Surrey, SM7 3HU </a><br><br><strong>The Event: </strong><br> 40+ teams to play on half size pitches (2 pitches on Astro the rest on grass) with games on Saturday to determine your entry into a plate or cup competition on the Sunday. There is also now an award for The Most Sociable Team<br><br><strong>The party </strong><br> We will provide each team with its own jug for the tournament (which we will fill with larger or bitter or Snake bite on your teams arrival) There will be a disco for Friday night &amp; Saturday night for your entertainment</p><p><strong>Facilities </strong><br> As many of you who have been to PW&rsquo;s before, there is plenty of room for camping on site &amp; the infamous PWHC bar staff will be on hand to provide sustenance in the form of breakfast, followed by hot food &amp; sandwiches throughout the day finishing with a barbeque in the evening. The bar as ever will be as ever flowing till late both evenings!</p><p align=center>Any takers, please let me know. </p><p align=center><a href=mailto:sparky@cheamhockeyclub.co.uk class=bodyLink> Sparky</a><br></p></td></tr></table></td><td width=28 valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>Mixed Hockey</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td align=center background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><div align=center>For those interested in playing mixed hockey, please let <a href=mailto:sylvana.fellowes@cheamhockeyclub.co.uk class=bodyLink>Sylvana</a> know.</div></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>RULE CHANGE REMINDER</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td valign=middle background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><div align=left><p align=left><strong>Check your stick NOW!</strong></p><p>All players and clubs are reminded that the stick bow rule that was introduced to international hockey in January 06 (published to the England Hockey website and publications from June 05 onwards) was introduced to ALL hockey at all levels on 1st June 2006. It is essential that you check your playing stick and ensure that the bow does not exceed 25mm. If it is more than 25mm it will be confiscated if checked.</p><p><strong>How do you measure it?</strong></p><p>Lay the stick face down on a flat and level surface (e.g. a table on a level floor) and measure the gap (at the deepest point) from the edge / underside of the stick to the table. If the space is in excess of 25mm, it&rsquo;s time to think about replacing the stick with a newer model.</p></div></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>International Hockey Federation - Rules of Hockey</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td align=center valign=middle background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p>The rules of hockey can be viewed on The International Hockey Federation website.</p><p><a href=http://www.fihockey.org/vsite/vfile/page/fileurl/0,11040,1181-162501-179716-83571-0-file,00.pdf target=_blank class=bodyLink>Click here to see the 'Rules of Hockey' 60 page pdf</a></p><p><a href=http://www.fihockey.org/ target=_blank class=bodyLink>Click here</a> to visit the International Hockey Federation website.</p></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif>&nbsp;</td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>Mistakes and incorrect information</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td align=center valign=middle background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p>If you notice any mistakes on this website or if any information is incorrect, please do <a href=mailto:sparky@cheamhockeyclub.co.uk class=bodyLink>let me know</a> and I will endeavour to correct them. Cheers,</p><p>Sparky<br> (Website Administrator)</p></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=28 height=30 background=img/pageLayout/box_topLeft.gif><span class=eventMarginLeft><a name=contactdetails></a></span></td><td height=30 background=img/pageLayout/box_topMiddle.gif class=boxTitle>Member Details</td><td width=28 height=30 background=img/pageLayout/box_topRight.gif>&nbsp;</td></tr><tr><td width=28 background=img/pageLayout/box_leftMiddle.gif>&nbsp;</td><td valign=top background=img/pageLayout/box_middleMiddle.gif class=boxTopMargin><p>To be certain that you receive all the Home/News &amp; Events for Cheam Hockey Club, please make sure that we have your up-to-date details by filling in the form below:</p><p><span class=style1>(Your details will be used only by Cheam Hockey Club and will NOT be passed on to any third parties)</span> </p><form action=memberdetailsconfirm.php method=post name=memberdetails id=memberdetails><table width=100% border=0 cellspacing=0 cellpadding=0><tr><td width=100 valign=top>Name:</td><td width=15>&nbsp;</td><td><input name=name type=text id=name size=40 maxlength=40></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td valign=top>Team:</td><td>&nbsp;</td><td><input name=team type=text id=team size=40 maxlength=40></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td valign=top>Email:</td><td>&nbsp;</td><td><input name=email type=text id=email size=40 maxlength=40></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td valign=top>Phone No: </td><td>&nbsp;</td><td><input name=phone type=text id=phone size=40 maxlength=40></td></tr><tr><td valign=top>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td valign=top>&nbsp;</td><td>&nbsp;</td><td><input type=Submit name=Submit value="Submit Details" onclick="return fnSubmit(this.form)"><input name=MM_Form type=hidden id=MM_Form value=memberdetails></td></tr></table></form></td><td width=28 align=left valign=bottom background=img/pageLayout/box_rightMiddle.gif><a href=#top><img src=img/pageLayout/top.gif alt="Return to the top of the page" width=12 height=11 border=0 align=left></a></td></tr><tr><td width=28 height=20 background=img/pageLayout/box_bottomLeft.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td><td height=20 background=img/pageLayout/box_bottomMiddle.gif><img src=img/pageLayout/invisibleGif.gif width=380 height=1></td><td width=28 height=20 background=img/pageLayout/box_bottomRight.gif><img src=img/pageLayout/invisibleGif.gif width=28 height=1></td></tr></table><br><table width=100% border=0 cellspacing=0 cellpadding=0></table></td></tr></table><table width=100% height=20 border=0 cellpadding=0 cellspacing=0 bgcolor=#000031><tr><td width=20 height=20 valign=middle background=img/pageLayout/bottomBanner_left.gif>&nbsp;</td><td valign=middle><div align=right><a class=fourleafLink style="TEXT-DECORATION: none" href=http://www.fourleaf.co.uk/wdm_web_development.php title="Web Design by Fourleaf Limited" target=_blank>&copy;</a> <a class=fourleafLink style="TEXT-DECORATION: none" href=http://www.fourleaf.co.uk/wdm_web_development.php title="Web Design by Fourleaf Limited" target=_blank>Web Design</a> <a class=fourleafLink style="TEXT-DECORATION: none" href=http://www.fourleaf.co.uk title="Fourleaf Web Design & Communications" target=_blank>by Fourleaf Limited</a></div></td><td width=20 align=right valign=bottom><a href=http://www.fourleaf.co.uk target=_blank><img height=16 width=15 alt="Fourleaf Web Design & Communications" src=img/pageLayout/fourleaf_balls.jpg border=0></a></td><td width=20 h