"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"><html xmlns=http://www.w3.org/1999/xhtml><head><meta http-equiv=Content-Type content="text/html; charset=ISO-8859-1"><title>Cinemagic international film festival for young people based in Belfast, Northern Ireland.</title><link href=styles/main.css rel=stylesheet type=text/css></head><body><div id=header><h1>Cinemagic International Film Festival</h1></div><div id=title><h1>Welcome to the Cinemagic World Screen Festival For Young People</h1></div><div id=wrap><div id=sidenav><ul><li id=home><a href=index.asp><img src=images/home.gif alt="Home Link"></a></li><li id=news><a href=news.asp><img src=images/news.gif alt="News Link"></a></li><li id=about><a href=about.asp><img src=images/about.gif alt="About Link"></a></li><li id=education><a href=education.asp><img src=images/education.gif alt="Education Link"></a></li><li id=festival07><a href=festival07.asp><img src=images/CINEMAGIC2007.gif alt="Cinemagic Festival 2007 Link"></a></li><li id=filmmaker><a href=filmmaker.asp><img src=images/filmmaker.gif alt="Young Flimmaker Link"></a></li><li id=opps><a href=opps.asp><img src=images/opps.gif alt="Opportunities Link"></a></li><li id=press><a href=press.asp><img src=images/press.gif alt="Press Link"></a></li><li id=archive><a href=festivalarchive.asp><img src=images/archive.gif alt="Archive Link"></a></li><li id=gallery><a href=gallery.asp><img src=images/gallery.gif alt="Gallery Link"></a></li><li id=funds><a href=fundraising.asp><img src=images/funds.gif alt="Fundraising Link"></a></li><li id=sponsers><a href=sponsers.asp><img src=images/sponsers.gif alt="Sponsers Link"></a></li><li id=contact><a href=contact.asp><img src=images/contact.gif alt="Contact Us Link"></a></li><li id=links><a href=links.asp><img src=images/links.gif alt=Links></a></li></ul></div><div id=content><a href=maillist.asp id=maillist><img src=images/blank.gif alt="Join Our Mailing List"></a><!-- bookmark script --><script language=JavaScript1.2 type=text/javascript>
