</script><br><br><h1>CINEMAGIC <br> WORLD SCREEN FESTIVAL FOR YOUNG PEOPLE <br> 16th November 2nd December 2007 <br><br> CALL FOR ENTRIES</h1> Cinemagic is an international film festival for young people based in Belfast, Northern Ireland. It was established in 1989 and over the years it has developed a worldwide reputation for excellence in childrens programming and is currently the largest award-winning childrens film festival in Great Britain and Ireland <br><br> The 17-day festival includes international film screenings, big movie premieres, special guests, discussions, competitions and masterclasses in all aspects of filmmaking. <br><br> Cinemagic is a competitive festival with prizes for:<br><span class=bold>* Best feature and best short film for a teenage audience</span> judged by a jury of young people aged 15-18<br><span class=bold>* Best feature and best short film for a children's audience</span> judged by a jury of young people aged 8-14 <br><br> Films made within the years 2005 2007 are eligible for competition. We are interested in all types of films and programmes for children and young people from preschool through to young adult. We can screen 35mm, Beta SP (PAL) and DV cam. <br><br><a href="docs/ENTRY FORM 07.doc">Download the ENTRY FORM here</a><br><a href="docs/2007 REGULATIONS.doc">Download the REGULATIONS here</a><br><br> To enter, just send a DVD/VHS preview, either in English or with English subtitles, and a completed entry form to:<br><span class=bold>Chris Shaw, Festival Programmer <br> Cinemagic <br> 49 Botanic Avenue <br> Belfast BT7 1JL <br> Northern Ireland <br><br> DEADLINE FOR ENTRIES IS 1st AUGUST 2007.</span> All entries will be judged by a previewing committee. Successful entrants will be notified by 3rd September 2007. <br> For more information<br><span class=bold>email: <a href=Mailto:chris@cinemagic.org.uk>chris@cinemagic.org.uk</a><br> tel: +44 (0)28 90311900 <br> web: <a href=http://www.cinemagic.org.uk>www.cinemagic.org.uk</a></span><div class=emailfriend><a href=emailfriend.asp>Email this page to a friend</a></div><div class=clear></div><div id=bottomimages><a href=festivalarchive.asp><img src=images/festival_recap.gif alt="Click for Festival Recap"></a><a href=filmmaker.asp><img src=images/young_filmmaker.gif alt="Click for Young Filmmaker"></a><a href=gallery.asp><img src=images/gallery_bottom.gif alt="Click for Photo Gallery"></a></div></div><div id=footer><div id=address> Cinemagic<br> 49 Botanic Avenue, Belfast<br> BT7 1JL </div><div id=phone><span class=tel>Tel</span> 028 9031 1900<br><span class=fax>Fax</span> 028 9031 9709<br><span class=email>Email</span> <a href=mailto:info@cinemagic.org.uk>info@cinemagic.org.uk</a></div></div></div></body>",nonspam

