an>&gt; Prof Indemnity</span></a></div><div class=navBtn><a href=news.htm title="About Us"><img src=gfx/navOn.gif alt=News><span>&gt; News</span></a></div><div class=navBtn><a href=online_calculators.htm title="Online Tax Calculators"><img src=gfx/navOn.gif alt=Home><span>&gt; Tax Calculators</span></a></div><div class=navBtn><a href=tax_centre.htm title="Tax Centre"><img src=gfx/navOn.gif alt="Tax Centre"><span>&gt; Tax Centre</span></a></div><div class=navBtn><a href=contact.htm title="Contact Details"><img src=gfx/navOn.gif alt=Home><span>&gt; Contact Details</span></a></div><div class=navBtn><a href=agency_links.htm title="Contact Details"><img src=gfx/navOn.gif alt=Links><span>&gt; Useful Links </span></a></div><div class=navBtn><a href=client_survey.htm title="Contact Details"><img src=gfx/navOn.gif alt=Feedback><span>&gt; Clients Feedback </span></a></div><div class=navBtn><a href=sitemap.htm title=Sitemap><img src=gfx/navOn.gif alt=Sitemap><span>&gt; Sitemap</span></a></div><br><br><div align=center><p><a href=press_apr07_pcg_onestop.htm><img src=gfx/pcg_onestop.gif alt="PCG OneStop" width=120 height=53 border=0></a></p><a href="http://www.pcg.org.uk/cms/index.php?option=com_content&task=view&id=1554&Itemid=487" target=_blank><img src=gfx/PCG-(QA)-logo-RGB-Word-web.gif width=80 height=152 border=0></a><br><br><img src=gfx/AccAgeAwards.jpg alt="AccountancyAge Awards 2005 Finalist" width=98 height=142><br><p><a href=bupa/index.htm target=_blank><img src=gfx/bupa.jpg alt=Bupa width=99 height=66 border=0></a></p><p><br><img src=gfx/pcg_logo.gif alt="PCG Professional Contractors Group" width=85 height=85></p><p><br><img src=gfx/construction_industry_council.gif alt="PCG Professional Contractors Group" width=100 height=68></p><p><br></p></div></div></td><td align=left valign=top><h1><script language=JavaScript>displayGreeting();</script>... welcome</h1><p>Danbro provides a pro-active accounting service to many hundreds of Contractors and temporary workers throughout the UK. Whether you choose to run your own <a href=ltd_company.htm class=link_lt_blue>Limited Company</a> or wish to work through a Danbro <a href=umbrella-company/umbrella-company.htm class=link_lt_blue>Umbrella Company</a> or the <a href=complete-solution-benefits.htm class=link_lt_blue> Complete Solution</a>, we can help you to work out which accounting option works best for you. </p><p>We will alleviate the burden of administration and tax that comes with contracting work allowing you to get on with what you do best, safe in the knowledge that every tax minimisation opportunity will be utilised to your advantage. &gt;&gt; <a href=the-contractors-accountant-aboutus.htm>More</a></p><p class=contDeviHeadFullWidth><strong> Update on MSC Legislation following the Budget on 21 March 2007</strong></p><div align=justify class=contDeviMainFullWidth><p>Most people in the Contractor/Freelancer sector will now be aware that the Budget announcement significantly changed the way that HMRC will be &lsquo;Tackling Managed Service Companies&rsquo; from the draft legislation in December 2006. </p><p><img src=gfx/bullet_toggle_plus.gif width=7 height=7><a href=#></a><a href=ltd_premier_service.htm>&nbsp;</a><a href=press_apr07_msc_legislation.htm>More Information</a></p></div><p>Working with Danbro you have a choice of:<br></p><div class=contDeviMainWide></div><table width=427 border=0 cellspacing=0 cellpadding=0><tr><td valign=top><h1 class=contDeviHead>&gt; Umbrella Company Option</h1><div class=contDeviMain><p class=pTop> Danbro provides <a href=umbrella-company/umbrella-company.htm class=link_lt_blue>Umbrella services for contractors</a> all over the UK. </p><p class=pTop>The Umbrella company option works for contractors who want to have some of the benefits of the advantages of operating through a limited company but don&rsquo;t want to be burdened with the bookkeeping.</p><p>There is a flat rate fee and we have NO HIDDEN CHARGES AND NO EXTRA CHARGES for processing expenses and insurance cover.</p><p><a href=umbrella-company/umbrella-company.htm>Umbrella Company</a></p><p><a href=umbrella-company/umbrella-company-benefits.htm class=link_lt_blue><img src=gfx/bullet_toggle_plus.gif width=7 height=7 border=0> Benefits<br></a><a href=umbrella-company/umbrella-company-benefits.htm class=link_lt_blue><img src=gfx/bullet_toggle_plus.gif width=7 height=7 border=0></a> <a href=umbrella-company/umbrella-company-howitworks.htm> How it works? </a><br><a href=umbrella-company/umbrella-company-benefits.htm class=link_lt_blue><img src=gfx/bullet_toggle_plus.gif width=7 height=7 border=0></a> <a href=umbrella-company/umbrella-company-fee.htm>Fee Structure<br></a><a href=umbrella-company/umbrella-company-benefits.htm class=link_lt_blue><img src=gfx/bullet_toggle_plus.gif width=7 height=7 border=0></a> <a href=umbrella-company-testimonials.htm class=link_lt_blue> Client Testimonials</a><a href=umbrella-company/umbrella-company-fee.htm></a><br><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=# onclick="MM_openBrWindow('calculators/custom/calc.htm','calc','scrollbars=yes,resizable=yes,width=800,height=600')">Calculator for NET Pay</a><br><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=word/dispensation_cover.doc target=_blank>IR Dispensation</a><br><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=umbrella-company/umbrella-company-expense-claim.htm>Expense Policy</a><br><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=umbrella-company/umbrella-company-faq.htm>Frequently asked questions</a><br><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=https://secure.co-comp.co.uk/danbro/dots/register/ >Register Here</a></p><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=umbrella-company/umbrella-company.htm>More Information</a></div><h1 class=contDeviHead>&gt; Own Ltd Company </h1><div class=contDeviMain><p class=pTop>As a client of Danbro, nearly all the work and certainly all the worry of running a Limited Company, will be borne by us. We offer complete accounting, financial and tax planning advice all under one roof.</p><img src=gfx/bullet_toggle_plus.gif width=7 height=7><a href=#></a><a href=ltd_premier_service.htm>&nbsp;</a><a href=ltd_company.htm>More Information </a></div><h1 class=contDeviHead>&gt; Chosen by National Organisation </h1><div class=contDeviMain><p align=left><a href=http://www.danbro.co.uk/press_sept06_national_org.htm><img src=gfx/PCG-(QA)-logo-small.gif width=47 height=90 border=0 class=image_align></a>Danbro has received accreditation from the prestigious nationwide Professional Contractors Group (PCG).</p><p align=left><img src=gfx/bullet_toggle_plus.gif width=7 height=7><a href=#></a><a href=ltd_premier_service.htm>&nbsp;</a><a href=http://www.danbro.co.uk/press_sept06_national_org.htm>More Information </a></p></div><h1 class=contDeviHead>&gt; Free Contractors Newswire</h1><div class=contDeviMain><p class=pTop>Latest Newswire.</p><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=#></a><a href=newswires_budget07_summary.htm>Budget Report Summary 2007 Newswire</a><br><!--   <img src="gfx/bullet_toggle_plus.gif" width="7" height="7" /> <a href="#"></a><a href="newswires_dec06.htm">December
					  Newswire</a><br />/--><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=#></a><a href=newswires.htm>View all</a></div></td><td width=11>&nbsp;</td><td valign=top><h1 class=contDeviHead>&gt; Danbro's Premier Service</h1><div class=contDeviMain> <img src=gfx/premier_logo.gif alt="Premier Service" width=80 height=45 style=margin:5px;><p>The Premier Service includes everything a contractor could need when choosing to operate as a limited company.</p><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=ltd_premier_service.htm>More Information</a></div><h1 class=contDeviHead>&gt; The Complete Solution</h1><div class=contDeviMain><p class=pTop>The Complete service offers an alternative to running your own Limited Company, and takes away all the administrative duties involved in having your own Limited Company. </p><p>Each client taking this option will be the Director and shareholder of their own Limited Company, and will exercise financial and managerial control over the company. They will enjoy the benefits of hassle free accounting and administration, provided by qualified professionals.</p><p>At the same time, they can rest assured that every opportunity is taken to maximise their income to which they are legally entitled. Danbro administers all payroll, accounting functions and statutory obligations for the Limited Company.</p><p><img src=gfx/bullet_toggle_plus.gif width=7 height=7><a href=#></a><a href=ltd_premier_service.htm>&nbsp;</a><a href=complete-solution-benefits.htm>More Information</a></p></div><h1 class=contDeviHead>&gt; Free Guide to Freelancing</h1><div class=contDeviMain><p class=pTop><img src=gfx/bullet_toggle_plus.gif width=7 height=7> <a href=#></a><a href=umbrella-company/umbrella-company-faq.htm></a><a href=pdf/guide_to_freelancing.pdf target=_blank>Click here</a> to download the PCG Guide to Freelancing.</p></div></td></tr></table></td><td width=150 valign=top bgcolor=#CCCCCC><div id=subCont><div class=subContHead>&gt; U