obal5 link</a> | <a href=#>subglobal5 link</a> | <a href=#>subglobal5 link</a> | <a href=#>subglobal5 link</a> | <a href=#>subglobal5 link</a> | <a href=#>subglobal5 link</a> | <a href=#>subglobal5 link</a> </div><div id=subglobal6 class=subglobalNav> <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> | <a href=#>subglobal6 link</a> </div><div id=subglobal7 class=subglobalNav> <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> | <a href=#>subglobal7 link</a> </div><div id=subglobal8 class=subglobalNav> <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> | <a href=#>subglobal8 link</a> </div></div><!-- end masthead --><div id=pagecell1><!--pagecell1--><img alt src=file:///C|/Program%20Files/Macromedia/Dreamweaver%208/Configuration/BuiltIn/PageDesigns/images/tl_curve_white.gif height=6 width=6 id=tl> <img alt src=file:///C|/Program%20Files/Macromedia/Dreamweaver%208/Configuration/BuiltIn/PageDesigns/images/tr_curve_white.gif height=6 width=6 id=tr><div id=breadCrumb></div><div id=pageName><h2>Welcome To Dean Gibson Catholic Primary School </h2></div><div id=pageNav><div id=sectionLinks><p><a href=#>Reception</a> <a href=#> Class 1 </a> <a href=#>Class 2 </a> <a href=#>Class 3 </a> <a href=#>Class 4 </a> <a href=#>Class 5</a><a href=#>Class 6</a> </p></div><div class=relatedLinks><h3>&nbsp;</h3></div></div><div id=content><div class=feature> <img src=../images/school.jpg alt width=280 height=200><h3>Success For All </h3><p>Dean Gibson Catholic Primary School is situated on the edge of Kendal. We serve a wide area including surrounding villages. As a Catholic School, the philosophy and ethos of Dean Gibson is firmly rooted in Catholic tradition, with an emphasis on the teachings of Jesus Christ.&nbsp; </p><p>Having only been in post as Headteacher since January 2006 the school has been through a number of changes. We now have in place a stable and strong leadership team, with a renewed focus on improvement throughout the school. The staffs commitment, dedication and ability to work as a team, has greatly contributed to our rising standards particularly at Key Stage 2.<br><br> We have well behaved motivated children, who are keen to learn and enjoy their work. Our new ICT suite has enhanced our ICT facilities and contributes to the raising of standards in this area and across the whole of the curriculum.</p><p>It is our aim to make Dean Gibson Catholic Primary School a happy place: an extension of a happy family home. The teachers and staff wish to be partners with parents/carers in sharing the privilege of educating children to a high standard.</p><p>Should you require any further information please contact the school by telephone, letter or email.</p><p>Yours sincerely,</p><p>Norah Mercer<br> Headteacher</p></div><div class=story><h3>The School Mission Statement </h3><p>&ldquo;We believe that every child is a unique creation of God. We promote the education of the whole child in a loving and supportive environment.&rdquo;</p></div><div class=story><table width=100% cellpadding=0 cellspacing=0 summary><tr valign=top><td class=storyLeft><p> <a href=news.html class=capsule>News</a> Each week the children take home the weekly newsletter, this provides information on the school activities and any other developments which we feel the parents need to know. You can also view your newsletter online...........<a href=news.html>More....... </a></p> </td><td><p> <a href=parishlinks.html class=capsule>Parish Links </a>Dean Gibson is the Parish School for Holy Trinity and St. George&rsquo;s Church in Kendal. Strong links have been developed between the parish and the school to provide for the spiritual and pastoral care of the children and their families.&nbsp; These help to enhance the distinctive Catholic ethos, which permeates the school community. <a href=parishlinks.html>more.... </a></p> </td></tr><tr valign=top><td class=storyLeft><p> <a href=# class=capsule>What's On </a>Dean Gibson events.....Check back soon. </p> </td><td><p> <a href=pta.html class=capsule>PTA</a>We will update this section on a regular basis to keep you informed on PTA developments and meeting dates. </p> </td></tr></table></div></div><div id=siteInfo><a href=default.html>Home</a> | <a href=staff.html>Staff</a> | <a href=news.html>News</a> | <a href=termdates.html>Term Dates </a> | <a href=prospectus.html>Prospectus</a> | <a href=Contact.html>Contact Us</a> | &copy;2007 Dean Gibson RC Primary School </div></div><!--end pagecell1--><br><script type=text/javascript>
