itemap accesskey=8>Site map</a></li><li><a href=/contact_us accesskey=9>Contacting Energy Saving Trust</a></li><li><a href=/accessibility accesskey=0>Accessibility statement</a></li></ul><div id=header-tools><h2 class=accessibility>Other Energy Saving Trust Channels</h2><ul id=channels><li><a href=/aboutest/ >Corporate</a></li><li><a href=/housingbuildings/ >Housing Professionals</a></li><li><a href=/fleet/ >Transport in Business</a></li><li class=last><a href=/cafe/welcome/ >Community Projects</a></li></ul><form action=/google/search method=get name=fSearchForm id=fSearchForm><fieldset><label class=accessibility for=fSearch>Search</label><input type=text id=fSearch name=SearchText></fieldset><fieldset><input type=submit value=Go id=fGo name=SearchButton></fieldset></form><h2 class=accessibility>Energy Saving Trust information</h2><ul id=about-tools><li><a href=/about_us>About us</a></li><li><a href=/resources>Resources</a></li><li class=last><a href=/contact_us>Contact Us</a></li></ul></div> </div><h2 class=accessibility>Main navigation</h2><ul id=mainnav><li class="first selected"><a href=/ >Home</a></li><li><a href=/your_impact_on_climate_change>Your impact on climate change</a></li><li><a href=/what_can_i_do_today>What can I do today?</a></li><li><a href=/energy_saving_products>Energy saving products</a></li><li><a href=/home_improvements>Home improvements</a></li><li><a href=/generate_your_own_energy>Generate your own energy</a></li><li class=last><a href=/help_and_support>Help and support</a></li></ul><div id=main-frame><div id=content-frame><div id=maincontent-design><a name=back-to-top></a><div class=content-view-full><div class=class-folder><div class="row first"><div class=home-title-introduction-container><div class=page-title><h1>Making the most of your energy</h1></div><div class=content-attribute-introduction><p> Almost half of the UK's carbon dioxide emissions come from energy we use every day - at home and when we travel. By saving energy we can all help prevent climate change. </p></div></div><div class=main-promo><!--[if !IE]> --><object type=application/x-shockwave-flash data=/extension/est/design/est/flash/home_promo_chimneys_360x173.swf height=173 width=360><!-- <![endif]--><!--[if IE]>
                <object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000"
                        codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,0,0"
                        width="360" height="173">
                        <param name="movie" value="/extension/est/design/est/flash/home_promo_chimneys_360x173.swf" />
                <!--><!----><param name=loop value=true><param name=menu value=false><a href=#><img src=/extension/est/design/est/images/temp/home_main-promo.jpg alt="Meet the energy savers of 2006" height=173 width=360></a></object><!-- <![endif]--></div></div><div class=content-attribute-body><div class="row second"><div class="block left" style="background-image: url(/var/storage/images/media/teaserimages/home_page_what_can_i_do_today/9087-3-eng-GB/home_page_what_can_i_do_today_gu_front_page.jpg);"><h2>What can I do today?</h2><div><p> There are lots of simple things you can do right now to save energy, from turning your thermostat down by 1°C, to insulating your home. </p></div><p class=arrow><a href=/what_can_i_do_today>What can I do today?</a></p></div><div class="block right" style="background-image: url(/var/storage/images/media/teaserimages/generate_own_energy_home/17948-2-eng-GB/generate_own_energy_home_gu_front_page.jpg);"><h2>Generate your own energy</h2><div><p> Wind, solar, water, and bio fuels - there are effective alternatives to fossil fuels to help you meet your energy needs and reduce your home's carbon dioxide emissions. </p></div><p class=arrow><a href=/generate_your_own_energy>Generate your own energy</a></p></div></div><div class="row third"><div class="block left" style="background-image: url(/var/storage/images/media/teaserimages/eco_driving/22519-2-eng-GB/eco_driving_gu_front_page.jpg);"><h2>Efficient driving</h2><div><p> Become an eco-driver and drive your fuel costs down. You can follow ten simple steps to save £120 per year and reduce your car's impact on the environment. </p></div><p class=arrow><a href=/what_can_i_do_today/efficient_driving>Efficient driving</a></p></div><div class="block right" style="background-image: url(/var/storage/images/media/teaserimages/home_page_your_impact/9096-5-eng-GB/home_page_your_impact_gu_front_page.jpg);"><h2>Your impact on climate change</h2><div><p> We are seeing the effect of climate change in our everyday lives. In the UK, the nine warmest summers since records began have occurred in the last 10 years. </p></div><p class=arrow><a href=/your_impact_on_climate_change>Your impact on climate change</a></p></div></div></div></div></div></div></div><div id=tools><div class=toolbox><div class=toolbox-design id=page-tools><h2><span title="Page tools"></span>Page tools</h2><ul><li id=email-page><a href=/content/tipafriend/2>Email this page</a></li><li id=rate-page><div><p>Rate this page</p><div id=rate-page-tool><form action=/ratethispage/rate method=post name=fRateX id=fRateX><input type=hidden value=/ name=RedirectURI><input type=hidden name=ViewMode value=full><input type=hidden name=Ratevalue value=5 id=Ratevalue><input type=hidden name=ContentObjectID value=127><input type=hidden name=ContentNodeID value=2><fieldset class=radio-buttons id=fRateXRadio><label for=fRadio1opt1 class=accessibility>Rating: 1 - Bad</label><input type=radio name=fRateRadio id=fRadio1opt1 value=1><label for=fRadio1opt2 class=accessibility>Rating: 2 - Poor</label><input type=radio name=fRateRadio id=fRadio1opt2 value=2><label for=fRadio1opt3 class=accessibility>Rating: 3 - OK</label><input type=radio name=fRateRadio id=fRadio1opt3 value=3><label for=fRadio1opt4 class=accessibility>Rating: 4 - Good</label><input type=radio name=fRateRadio id=fRadio1opt4 value=4><label for=fRadio1opt5 class=accessibility>Rating: 5 - Great</label><input type=radio name=fRateRadio id=fRadio1opt5 value=5></fieldset><fieldset class=submit><input type=submit value=Submit></fieldset></form></div><p>Average rating: <span id=fRateXAvg>3</span> - OK </p></div></li></ul></div></div><div class=toolbox><div class=toolbox-design id=help-advice><h2><span title="Help & advice"></span>Help and advice</h2><p><strong>Call</strong><span class=telephone>0800 512 012</span> for free, independent and local energy saving advice</p><p class=arrow><a href=/content/view/full/368>Find out more about the local advice centres</a></p></